INSERT INTO `description` VALUES
    (1, 1, 'While it is young,  it uses the nutrients that are stored in the seed on its back in order to grow.'),
    (1, 2, 'Quand il est jeune,  il absorbe les nutriments conservés dans son dos pour grandir et se développer.'),
    (2, 1, 'Exposure to sunlight adds to its strength. Sunlight also makes the bud on its back grow larger.'),
    (2, 2, 'La lumière du soleil le rend plus fort et vigoureux. Le bulbe sur son dos grossit en conséquence.'),
    (3, 1, 'A bewitching aroma wafts from its flower. The fragrance becalms those engaged in a battle.'),
    (3, 2, 'Une douce senteur émane de sa plante. Cette fragrance calme tous ceux qui sont engagés dans un combat.'),
    (4, 1, 'From the time it is born,  a flame burns at the tip of its tail. Its life would end if the flame were to go out.'),
    (4, 2, 'Depuis sa naissance,  une petite flamme brûle au bout de sa queue. Si cette flamme s’éteint,  la vie de ce Pokémon s’éteindra elle aussi.'),
    (5, 1, 'If it becomes agitated during battle,  it spouts intense flames,  incinerating its surroundings.'),
    (5, 2, 'S’il s’excite pendant un combat,  il crache de grandes flammes,  brûlant tout ce qui se trouve aux alentours.'),
    (6, 1, 'Its wings can carry this Pokémon close to an altitude of 4, 600 feet. It blows out fire at very high temperatures.'),
    (6, 2, 'Ses ailes lui permettent de voler à plus de 1 400 m d’altitude. Ce Pokémon crache du feu à des températures très élevées.'),
    (7, 1, 'When it feels threatened,  it draws its limbs inside its shell and sprays water from its mouth.'),
    (7, 2, 'S’il se sent menacé,  il rétracte ses pattes dans sa carapace pour se protéger et crache de l’eau.'),
    (8, 1, 'It cleverly controls its furry ears and tail to maintain its balance while swimming.'),
    (8, 2, 'Il se sert habilement de sa queue et de ses oreilles touffues pour garder son équilibre sous l’eau.'),
    (9, 1, 'The rocket cannons on its shell fire jets of water capable of punching holes through thick steel.'),
    (9, 2, 'Les canons sur sa carapace tirent des jets d’eau capables de percer même de l’acier trempé.'),
    (10, 1, 'Its short feet are tipped with suction pads that enable it to tirelessly climb slopes and walls.'),
    (10, 2, 'Ses petites pattes munies de ventouses lui permettent de monter les pentes et de grimper aux murs sans se fatiguer.'),
    (11, 1, 'Even though it is encased in a sturdy shell,  the body inside is tender. It can’t withstand a harsh attack.'),
    (11, 2, 'Bien que son corps soit entouré d’une carapace solide,  l’intérieur est si mou qu’il ne résisterait pas à une attaque violente.'),
    (12, 1, 'It collects honey every day. It rubs honey onto the hairs on its legs to carry it back to its nest.'),
    (12, 2, 'Il ramasse du nectar chaque jour et l’agglutine sur les poils de ses pattes pour le transporter jusqu’à son nid.'),
    (13, 1, 'Beware of the sharp stinger on its head. It hides in grass and bushes where it eats leaves.'),
    (13, 2, 'L’aiguillon sur son front est très pointu. Il se cache dans les bois et les hautes herbes,  où il se gave de feuilles.'),
    (14, 1, 'Able to move only slightly. When endangered,  it may stick out its stinger and poison its enemy.'),
    (14, 2, 'Il peut à peine bouger. Quand il est menacé,  il sort parfois son aiguillon pour empoisonner ses ennemis.'),
    (15, 1, 'It has three poisonous stingers on its forelegs and its tail. They are used to jab its enemy repeatedly.'),
    (15, 2, 'Il se sert de ses trois aiguillons empoisonnés situés sur les pattes avant et l’abdomen pour attaquer sans relâche ses adversaires.'),
    (16, 1, 'Very docile. If attacked,  it will often kick up sand to protect itself rather than fight back.'),
    (16, 2, 'De nature très docile,  il préfère projeter du sable pour se défendre plutôt que contre-attaquer.'),
    (17, 1, 'This Pokémon is full of vitality. It constantly flies around its large territory in search of prey.'),
    (17, 2, 'Ce Pokémon est très endurant. Il survole en permanence son territoire pour chasser.'),
    (18, 1, 'This Pokémon flies at Mach 2 speed,  seeking prey. Its large talons are feared as wicked weapons.'),
    (18, 2, 'Ce Pokémon vole à Mach 2 quand il chasse. Ses grandes serres sont des armes redoutables.'),
    (19, 1, 'Will chew on anything with its fangs. If you see one,  you can be certain that 40 more live in the area.'),
    (19, 2, 'Il peut ronger n’importe quoi avec ses deux dents. Quand on en voit un,  il y en a certainement 40 dans le coin.'),
    (20, 1, 'Its hind feet are webbed. They act as flippers,  so it can swim in rivers and hunt for prey.'),
    (20, 2, 'Ses pattes arrière sont palmées. Il peut donc poursuivre sa proie dans les cours d’eau et les rivières.'),
    (21, 1, 'Inept at flying high. However,  it can fly around very fast to protect its territory.'),
    (21, 2, 'Il est incapable de voler à haute altitude. Il se déplace très vite pour protéger son territoire.'),
    (22, 1, 'A Pokémon that dates back many years. If it senses danger,  it flies high and away,  instantly.'),
    (22, 2, 'Un Pokémon très ancien. S’il perçoit un danger,  il fuit instantanément à haute altitude.'),
    (23, 1, 'The older it gets,  the longer it grows. At night,  it wraps its long body around tree branches to rest.'),
    (23, 2, 'Plus il est âgé,  plus son corps est long. La nuit,  il s’enroule autour de branches d’arbres pour se reposer.'),
    (24, 1, 'The frightening patterns on its belly have been studied. Six variations have been confirmed.'),
    (24, 2, 'Des études ont révélé que les marques effrayantes de son corps pouvaient former six motifs différents.'),
    (25, 1, 'Possesses cheek sacs in which it stores electricity. This clever forest-dweller roasts tough berries with an electric shock before consuming them.'),
    (25, 2, 'Les Pikachu se disent bonjour en se frottant la queue et en y faisant passer du courant électrique.'),
    (26, 1, 'It can discharge bursts of electricity exceeding 100, 000 volts— a single strike with that amount of power would incapacitate one of the Copperajah of my homeland.'),
    (26, 2, 'Si ses joues sont à court d’énergie,  il lève la queue et capte l’électricité contenue dans l’atmosphère.'),
    (27, 1, 'It burrows into the ground to create its nest. If hard stones impede its tunneling,  it uses its sharp claws to shatter them and then carries on digging.'),
    (27, 2, 'Il creuse le sol pour construire sa tanière. Rien n’arrête ses griffes acérées,  pas même la roche la plus solide.'),
    (28, 1, 'It climbs trees by hooking on with its sharp claws. Sandslash shares the berries it gathers,  dropping them down to Sandshrew waiting below the tree.'),
    (28, 2, 'Il grimpe aux arbres grâce à ses griffes acérées et fait tomber des Baies pour les Sabelette qui attendent au sol.'),
    (29, 1, 'It uses its hard incisor teeth to crush and eat berries. The tip of a female Nidoran’s horn is a bit more rounded than the tip of a male’s horn.'),
    (29, 2, 'Ce Pokémon se nourrit de Baies en les ouvrant avec ses incisives. Le bout de sa corne est plus arrondi que celui du mâle.'),
    (30, 1, 'If the group is threatened,  these Pokémon will band together to assault enemies with a chorus of ultrasonic waves.'),
    (30, 2, 'Si un danger menace le groupe,  ces Pokémon se réunissent et l’affrontent en émettant des ultrasons en chœur.'),
    (31, 1, 'It pacifies offspring by placing them in the gaps between the spines on its back. The spines will never secrete poison while young are present.'),
    (31, 2, 'Ce Pokémon calme les petits de son espèce en les plaçant entre ses épines dorsales. Dans ce cas,  elles ne libèrent pas de poison.'),
    (32, 1, 'Small but brave,  this Pokémon will hold its ground and even risk its life in battle to protect the female it’s friendly with.'),
    (32, 2, 'Malgré sa petite taille,  il est très téméraire. Afin de protéger sa compagne,  il est prêt à se battre et à risquer sa vie.'),
    (33, 1, 'It’s nervous and quick to act aggressively. The potency of its poison increases along with the level of adrenaline present in its body.'),
    (33, 2, 'D’un naturel nerveux,  il est prompt à se battre. Lorsqu’il a une montée d’adrénaline,  la concentration de son poison augmente.'),
    (34, 1, 'Nidoking prides itself on its strength. It’s forceful and spirited in battle,  making use of its thick tail and diamond-crushing horn.'),
    (34, 2, 'Très fier de sa force,  il se bat vigoureusement à l’aide de sa queue robuste et de sa corne capable de briser le diamant.'),
    (35, 1, 'It can be found in quiet mountain areas on a full moon\'s night. Its dancing and its tiny,  faintly glowing wings confer upon it a lovely fairylike quality.'),
    (35, 2, 'Son comportement et son cri adorables font de lui un Pokémon très populaire. Malheureusement,  il est difficile d’en croiser un spécimen.'),
    (36, 1, 'Legend says that on clear,  quiet nights,  it listens for the voices of its kin living on the moon. I,  too,  often think of my homeland,  so far away.'),
    (36, 2, 'Capable d’entendre une aiguille tomber à plus d’un kilomètre,  ce Pokémon préfère les endroits calmes et isolés.'),
    (37, 1, 'In its belly burns a fire,  which Vulpix spits out in the form of fireballs. When young,  this Pokémon has but one white tail. As the Pokémon matures,  this single tail splits into six.'),
    (37, 2, 'Avec l’âge,  la fourrure de ses six queues devient de plus en plus belle et soyeuse. Elle est chaude au toucher.'),
    (38, 1, 'The coat of gleaming golden fur is quite magnificent. This species is said to store sacred power in its nine long tails and to live for a millennium.'),
    (38, 2, 'Il est très intelligent et rancunier. Quiconque attrape une de ses queues se fera maudire pour 1 000 ans.'),
    (39, 1, 'By freely changing the wavelength of its voice,  Jigglypuff sings a mysterious melody sure to make any listener sleepy.'),
    (39, 2, 'Il module librement la longueur d’onde de sa voix pour chanter une étrange mélodie qui endort à tous les coups celui qui l’écoute.'),
    (40, 1, 'It’s proud of its fur,  which is fine and delicate. In particular,  the curl on its forehead has a texture that’s perfectly heavenly.'),
    (40, 2, 'Sa fourrure soyeuse fait sa fierté. La touffe sur son front est si douce que la caresser donne l’impression d’être sur un petit nuage.'),
    (41, 1, 'Makes its home in gloomy caves. Atrophied eyes have left this Pokémon blind,  so it scans its surroundings via sound waves that it emits from its mouth as it flies.'),
    (41, 2, 'Ils vivent dans les grottes où la lumière du jour ne perce jamais. Le matin,  ils se blottissent les uns contre les autres pour se réchauffer et dormir.'),
    (42, 1, 'It sinks its sharp fangs into other creatures and slurps up their blood. A closer look at the fangs reveals that they are hollow and akin to straws.'),
    (42, 2, 'Il se déplace habilement sur ses petites pattes,  s’approche silencieusement de sa proie endormie,  et lui suce le sang à l’aide de ses crocs.'),
    (43, 1, 'During the day,  it stays in the cold underground to avoid the sun. It grows by bathing in moonlight.'),
    (43, 2, 'Pendant la journée,  il reste en sous-sol et évite le soleil. Il grandit en se baignant au clair de lune.'),
    (44, 1, 'What appears to be drool is actually sweet honey. It is very sticky and clings stubbornly if touched.'),
    (44, 2, 'Ce qui semble être sa bave est en fait du nectar très collant. Si on le touche,  il est très difficile de s’en dépêtrer.'),
    (45, 1, 'The larger its petals,  the more toxic pollen it contains. Its big head is heavy and hard to hold up.'),
    (45, 2, 'Plus ses pétales sont grands,  plus il produit de pollen toxique. Toutefois,  le poids de sa tête le fatigue.'),
    (46, 1, 'Sometimes seen at the foot of trees in humid forests. The mushrooms on its back—called tochukaso—are not present on infant specimens and instead emerge as Paras matures.'),
    (46, 2, 'Il s’enfouit pour ronger des racines,  mais ce sont les champignons sur son dos qui absorbent presque tous les nutriments.'),
    (47, 1, 'Mushroom-lacking specimens of this Pokémon lie unmoving in the forest,  lending credence to the hypothesis that the large mushroom is in control of Parasect\'s actions.'),
    (47, 2, 'À force de voir son énergie aspirée,  il semblerait que ce ne soit plus l’insecte qui réfléchisse,  mais le champignon sur son dos.'),
    (48, 1, 'Its large eyes act as radar. In a bright place,  you can see that they are clusters of many tiny eyes.'),
    (48, 2, 'Ses grands yeux lui servent de radar. En pleine lumière,  on peut y distinguer des facettes.'),
    (49, 1, 'The powdery scales on its wings are hard to remove from skin. They also contain poison that leaks out on contact.'),
    (49, 2, 'Les écailles de ses ailes sont presque impossibles à retirer lorsqu’elles se collent à la peau,  et elles libèrent un poison violent au contact.'),
    (50, 1, 'It burrows through the ground at a shallow depth. It leaves raised earth in its wake,  making it easy to spot.'),
    (50, 2, 'Ce Pokémon creuse sous terre à faible profondeur. La terre qu’il laisse dans son sillage le rend facile à repérer.'),
    (51, 1, 'These Diglett triplets dig over 60 miles below sea level. No one knows what it’s like underground.'),
    (51, 2, 'Ce trio de Taupiqueur est capable de creuser jusqu’à 100 km sous terre,  vers l’inconnu.'),
    (52, 1, 'It loves to collect shiny things. If it’s in a good mood,  it might even let its Trainer have a look at its hoard of treasures.'),
    (52, 2, 'Tatillon sur la propreté de la pièce sur son front,  il se lave la figure avec grand soin. Il ne s’entend pas avec les Miaouss de Galar.'),
    (53, 1, 'Its elegant and refined behavior clashes with that of the barbaric Perrserker. The relationship between the two is one of mutual disdain.'),
    (53, 2, 'Il se comporte avec grâce et élégance,  et ne s’entend pas avec les rustres Berserkatt : les deux espèces se méprisent.'),
    (54, 1, 'Suffers perpetual headaches. If the agony grows too great,  Psyduck\'s latent power erupts,  contrary to Psyduck\'s intent. Ergo,  I am exploring ways to ease the pain.'),
    (54, 2, 'Sa migraine s’intensifie à mesure que son stress monte. Il libère une force psychique puissante qui terrasse tous ceux qui l’entourent.'),
    (55, 1, 'Its body is strong,  and it has webbing on its hands and feet. Golduck can swim easily through rough seas,  clawing its way through the high waves.'),
    (55, 2, 'D’après de vieilles légendes,  ce Pokémon entraînait au fond de l’eau tous ceux qui osaient souiller sa rivière.'),
    (56, 1, 'An agile Pokémon that lives in trees. It angers easily and will not hesitate to attack anything.'),
    (56, 2, 'Agile et rapide,  ce Pokémon vit dans les arbres. Il s’énerve facilement et s’attaque à tout ce qui bouge quand il est en colère.'),
    (57, 1, 'It stops being angry only when nobody else is around. To view this moment is very difficult.'),
    (57, 2, 'Sa fureur prend fin quand il n’a plus personne à frapper. Il est difficile d’en être témoin.'),
    (58, 1, 'They patrol their territory in pairs. I believe the igneous rock components in the fur of this species are the result of volcanic activity in its habitat.'),
    (58, 2, 'Très fidèle,  il aboie de toutes ses forces pour protéger son Dresseur d’Origine quand un danger le guette.'),
    (59, 1, 'Snaps at its foes with fangs cloaked in blazing flame. Despite its bulk,  it deftly feints every which way,  leading opponents on a deceptively merry chase as it all but dances around them.'),
    (59, 2, 'Ce Pokémon est admiré depuis toujours pour sa beauté. Il court avec tellement de légèreté qu’on dirait qu’il vole.'),
    (60, 1, 'In rivers with fast-flowing water,  this Pokémon will cling to a rock by using its thick lips,  which act like a suction cup.'),
    (60, 2, 'Dans les rivières au courant puissant,  il se sert de ses lèvres épaisses comme d’une ventouse pour s’accrocher aux rochers.'),
    (61, 1, 'This Pokémon’s sweat is a slimy mucus. When captured,  Poliwhirl can slither from its enemies’ grasp and escape.'),
    (61, 2, 'Il sécrète une sorte de mucus huileux qui lui permet d’échapper aux ennemis qui tentent de l’attraper.'),
    (62, 1, 'Poliwrath is skilled at both swimming and martial arts. It uses its well-trained arms to dish out powerful punches.'),
    (62, 2, 'Aussi habile à la nage qu’au combat,  il peut donner de vigoureux coups de poing avec ses bras musclés.'),
    (63, 1, 'Spends 18 hours of the day sleeping. Even while asleep,  Abra can control its psychic powers—should danger approach,  the Pokémon will simply teleport away.'),
    (63, 2, 'Il peut se téléporter en dormant. On dit que plus son sommeil est profond,  plus il se téléporte loin.'),
    (64, 1, 'There are rumors that a child with mystical powers became a Kadabra; however,  this remains unverified. I suspect that the spoon Kadabra holds enhances its brain waves.'),
    (64, 2, 'Incroyablement doué en télékinésie,  il concentre son énergie psychique dans l’étoile sur son front en prévision de son évolution.'),
    (65, 1, 'The longer Alakazam lives,  the larger and heavier its head becomes. Our tests have shown that the strength of its psychic powers correlates positively to the weight of its head.'),
    (65, 2, 'Il dispose d’immenses pouvoirs psychiques. On raconte qu’il s’en est servi afin de créer les cuillères qu’il tient dans chaque main.'),
    (66, 1, 'Though as small as a child,  it has strength enough to easily throw a well-built adult. Striving to become ever stronger,  Machop trains by carrying a Graveler on its shoulders.'),
    (66, 2, 'Il essaie de dépenser son énergie débordante en soulevant des rochers,  ce qui le rend encore plus fort.'),
    (67, 1, 'A sturdy creature boasting a robust physique and boundless stamina. Loves training above all else and voluntarily assists with tasks such as construction and clearing land.'),
    (67, 2, 'Son corps robuste ne se fatigue jamais. Il n’hésite pas à aider les gens lorsqu’il s’agit de soulever des objets très lourds.'),
    (68, 1, 'In close combat,  its four arms afford it offensive and defensive supremacy. In but a blink,  this valiant Pokémon can overwhelm its foes with more than 1, 000 blows from its fists.'),
    (68, 2, 'Il enchaîne les coups de poing avec ses quatre bras à une vitesse surprenante.'),
    (69, 1, 'Prefers hot and humid places. It ensnares tiny bugs with its vines and devours them.'),
    (69, 2, 'Il préfère les endroits chauds et humides. Il capture les Pokémon Insecte avec ses lianes pour les dévorer.'),
    (70, 1, 'When hungry,  it swallows anything that moves. Its hapless prey is dissolved by strong acids.'),
    (70, 2, 'Quand il a faim,  il avale tout ce qui bouge,  puis achève ses proies avec de l’acide.'),
    (71, 1, 'Lures prey with the sweet aroma of honey. Swallowed whole,  the prey is dissolved in a day,  bones and all.'),
    (71, 2, 'Il attire ses proies avec une odeur de miel et les avale tout entières. Il les digère en un jour seulement,  les os y compris.'),
    (72, 1, 'They fire beams from the glassy,  magenta orbs that resemble eyes atop their heads,  and they drift in shallow seas. During low tide,  they can sometimes be found on beaches,  desiccated.'),
    (72, 2, 'Il est presque totalement composé d’eau. Lorsqu’il s’immerge dans les flots,  son corps se fond dans l’eau,  ce qui le rend presque invisible.'),
    (73, 1, 'It has 80 tentacles,  each with a venomous tip. These tentacles are also extendible,  lengthening when Tentacruel attempts to catch prey. Use caution.'),
    (73, 2, 'Il peut allonger ses 80 tentacules à volonté et les utiliser comme un filet pour attraper sa proie et la transpercer de ses pics empoisonnés.'),
    (74, 1, 'Makes its home in mountainous regions,  using its arms to climb along harsh mountain roads. Can be troublesome—carelessly kicking one will cause it to fly into a rage and chase after you.'),
    (74, 2, 'On en trouve près des sentiers de montagne. Si vous marchez dessus par inadvertance,  ils s’énervent et attaquent.'),
    (75, 1, 'Dwells in holes dug into sheer walls of stone. It enjoys rolling down slopes as though it were a boulder during a rockfall,  so keep an eye upward while traversing mountain roads.'),
    (75, 2, 'Il dévale les sentiers de montagne et traverse les obstacles en les pulvérisant.'),
    (76, 1, 'The rocklike shell is shed each year. The cast-off shell then crumbles,  reverting to a mass of soil,  which can be spread across fields to promote crop growth.'),
    (76, 2, 'Juste après la mue,  son corps est blanc et tendre. Au contact de l’air,  sa peau se solidifie et forme une armure.'),
    (77, 1, 'These Pokémon live in herds out in the grassland. Newborn foals lack their fiery manes,  which will develop about an hour after birth.'),
    (77, 2, 'Il semblerait qu’une fois qu’un Dresseur a gagné la confiance de Ponyta,  sa crinière enflammée ne le brûle plus au toucher.'),
    (78, 1, 'Fiery mane aglow,  Rapidash darts like an arrow across the land. This prodigiously swift creature can traverse the vast region of Hisui in a day and a half.'),
    (78, 2, 'Au sein d’un troupeau,  c’est le plus rapide qui devient le chef. Il choisit les lieux où se rendre et détermine la vitesse de galop.'),
    (79, 1, 'When this Pokémon’s tail is soaked in water,  sweetness seeps from it. Slowpoke uses this trait to lure in and fish up other Pokémon.'),
    (79, 2, 'Lorsqu’il trempe le bout de sa queue dans l’eau,  une substance sucrée s’en dégage. Il s’en sert pour appâter ses proies quand il pêche.'),
    (80, 1, 'Being bitten by a Shellder shocked this Pokémon into standing on two legs. If the Shellder lets go,  it seems Slowbro will turn back into a Slowpoke.'),
    (80, 2, 'La morsure du Kokiyas l’a tellement surpris qu’il est devenu bipède. Il paraît qu’il redevient un Ramoloss si le Kokiyas lâche prise.'),
    (81, 1, 'A bizarre Pokémon with but a single eye embedded in an iron sphere. I suspect this creature levitates due to the magnetism it emits from its arms,  which resemble horseshoe-shaped magnets.'),
    (81, 2, 'Il se nourrit d’électricité et flotte dans les airs en libérant des ondes électromagnétiques avec les aimants situés de part et d’autre de son corps.'),
    (82, 1, 'Three Magnemite gathered to evolve into this Pokémon. The source of much vexation on my part,  as its powerful magnetism destroys my research equipment.'),
    (82, 2, 'Il émet constamment une énergie magnétique puissante qui interfère avec la grande majorité des ordinateurs dont il s’approche.'),
    (83, 1, 'They use a plant stalk as a weapon,  but not all of them use it in the same way. Several distinct styles of stalk fighting have been observed.'),
    (83, 2, 'Il se bat à l’aide de sa tige. Il existe plusieurs écoles quant à son maniement.'),
    (84, 1, 'Its short wings make flying difficult. Instead,  this Pokémon runs at high speed on developed legs.'),
    (84, 2, 'Ses petites ailes ne lui permettent pas de voler,  mais grâce à ses puissantes pattes,  il peut courir très rapidement.'),
    (85, 1, 'One of Doduo’s two heads splits to form a unique species. It runs close to 40 mph in prairies.'),
    (85, 2, 'Quand une des têtes de Doduo se divise,  il devient un Dodrio capable de courir à 60 km/h.'),
    (86, 1, 'Loves freezing-cold conditions. Relishes swimming in a frigid climate of around 14 degrees Fahrenheit.'),
    (86, 2, 'Il est à l’aise dans les endroits gelés. Il nage avec plaisir dans de l’eau à -10 ºC.'),
    (87, 1, 'Its entire body is a snowy white. Unharmed by even intense cold,  it swims powerfully in icy waters.'),
    (87, 2, 'Son corps entier est aussi blanc que la neige. Il résiste bien au froid et peut même nager au milieu des icebergs.'),
    (88, 1, 'Made of congealed sludge. It smells too putrid to touch. Even weeds won’t grow in its path.'),
    (88, 2, 'Ce tas de fange sent si mauvais qu’il est impossible de le toucher. Plus rien ne pousse dans son sillage putride.'),
    (89, 1, 'Smells so awful,  it can cause fainting. Through degeneration of its nose,  it lost its sense of smell.'),
    (89, 2, 'Son odeur immonde provoque des évanouissements. Son odorat s’est atrophié à cause de sa propre puanteur.'),
    (90, 1, 'Its hard shell repels any kind of attack. It is vulnerable only when its shell is open.'),
    (90, 2, 'Sa coquille est si résistante qu’elle repousse toutes les attaques. En revanche,  il est vulnérable quand celle-ci s’ouvre.'),
    (91, 1, 'Once it slams its shell shut,  it is impossible to open,  even by those with superior strength.'),
    (91, 2, 'Quand il referme sa coquille,  il est impossible de la rouvrir,  même avec une force hors du commun.'),
    (92, 1, 'Gaseous and completely impalpable. Also highly dangerous— inhaling part of its poisonous body will cause one to faint instantly.'),
    (92, 2, 'Son corps gazéiforme lui permet de se glisser n’importe où,  mais au moindre coup de vent,  il s’envole.'),
    (93, 1, 'This frightful,  malevolent spirit can glide through walls,  appearing wherever it likes. According to rumor,  victims of a Haunter\'s lick will wither to death day by day.'),
    (93, 2, 'On dit que lorsque quelqu’un a l’impression d’être surveillé dans le noir,  c’est sûrement qu’un Spectrum se trouve dans les parages.'),
    (94, 1, 'Possesses potential victims\' shadows in an effort to steal away the victims\' lives. If your shadow begins to laugh,  you must take hold of a protective charm posthaste!'),
    (94, 2, 'On dit qu’Ectoplasma surgit parfois des ténèbres pour prendre la vie des personnes égarées en montagne.'),
    (95, 1, 'This chain of immense stones resembles a giant serpent. Tremors shake the earth above as it burrows deep beneath the ground,  feeding on boulders as it goes.'),
    (95, 2, 'Il creuse dans le sol à une vitesse de 80 km/h en contorsionnant son immense corps de pierre.'),
    (96, 1, 'If you sleep by it all the time,  it will sometimes show you dreams it had eaten in the past.'),
    (96, 2, 'Si vous dormez tout le temps près de lui,  il partagera parfois avec vous les rêves qu’il a dévorés par le passé.'),
    (97, 1, 'Avoid eye contact if you come across one. It will try to put you to sleep by using its pendulum.'),
    (97, 2, 'Évitez son regard quand vous en croisez un,  ou il pourrait essayer de vous hypnotiser avec son pendule.'),
    (98, 1, 'If it senses danger approaching,  it cloaks itself with bubbles from its mouth so it will look bigger.'),
    (98, 2, 'S’il se sent menacé,  il se cache derrière les bulles émises par sa bouche pour paraître plus gros.'),
    (99, 1, 'Its oversized claw is very powerful,  but when it’s not in battle,  the claw just gets in the way.'),
    (99, 2, 'Sa pince gigantesque possède une puissance destructrice phénoménale,  mais hors combat,  son poids devient un handicap.'),
    (100, 1, 'An enigmatic Pokémon that happens to bear a resemblance to a Poké Ball. When excited,  it discharges the electric current it has stored in its belly,  then lets out a great,  uproarious laugh.'),
    (100, 2, 'On dit qu’il se déguise en Poké Ball. Il s’autodétruit à la moindre stimulation.'),
    (101, 1, 'The tissue on the surface of its body is curiously similar in composition to an Apricorn. When irritated,  this Pokémon lets loose an electric current equal to 20 lightning bolts.'),
    (101, 2, 'Il stocke de l’énergie électrique dans son corps,  ce qui le rend instable et explosif.'),
    (102, 1, 'These Pokémon get nervous when they’re not in a group of six. The minute even one member of the group goes missing,  Exeggcute become cowardly.'),
    (102, 2, 'Il a besoin d’être constitué de ses six membres pour rester calme. Sitôt qu’il en manque un,  il lui prend soudainement l’envie de fuir.'),
    (103, 1, 'When they work together,  Exeggutor’s three heads can put out powerful psychic energy. Cloudy days make this Pokémon sluggish.'),
    (103, 2, 'Les attaques psychiques lancées par ses trois têtes à l’unisson sont très puissantes. Par temps nuageux,  ses mouvements sont plus lents.'),
    (104, 1, 'This Pokémon wears the skull of its deceased mother. Sometimes Cubone’s dreams make it cry,  but each tear Cubone sheds makes it stronger.'),
    (104, 2, 'Il porte sur sa tête le crâne de sa défunte mère. Il lui arrive de rêver d’elle et de pleurer,  mais chaque larme qu’il verse le rend plus fort.'),
    (105, 1, 'When this Pokémon evolved,  the skull of its mother fused to it. Marowak’s temperament also turned vicious at the same time.'),
    (105, 2, 'En évoluant,  il est devenu violent,  et le crâne de sa mère qu’il portait a fusionné avec sa tête.'),
    (106, 1, 'The legs freely contract and stretch. The stretchy legs allow it to hit a distant foe with a rising kick.'),
    (106, 2, 'Kicklee peut rétracter et étendre ses jambes à sa guise. La formidable allonge dont il dispose lui permet de frapper des adversaires éloignés.'),
    (107, 1, 'Its punches slice the air. However,  it seems to need a short break after fighting for three minutes.'),
    (107, 2, 'Ses poings fendent l’air,  mais il se fatigue au bout de trois minutes à enchaîner les coups.'),
    (108, 1, 'Wields its long tongue deftly,  as though it were an arm. The Pokémon\'s viscous saliva,  once it has been collected and boiled down,  yields a strong and highly useful adhesive.'),
    (108, 2, 'Excelangue se nourrit essentiellement de Pokémon Insecte. Il lèche ses ennemis avec sa longue langue pour les paralyser,  puis les avale tout rond.'),
    (109, 1, 'It adores polluted air. Some claim that Koffing used to be more plentiful in the Galar region than they are now.'),
    (109, 2, 'On raconte qu’il y a longtemps,  ces Pokémon amateurs d’air pollué étaient beaucoup plus nombreux à Galar.'),
    (110, 1, 'It can’t suck in air quite as well as a Galarian Weezing,  but the toxins it creates are more potent than those of its counterpart.'),
    (110, 2, 'Il ne peut pas aspirer autant d’air que le Smogogo de Galar,  mais le poison qu’il produit est plus puissant.'),
    (111, 1, 'Ludicrously strong—when it butts heads with a mountain,  it is the mountain that shatters. But its short legs struggle with turns,  and it is incapable of stopping unless it collides with something.'),
    (111, 2, 'Il ne peut se souvenir que d’une chose à la fois. S’il se met à courir,  il en oublie tout de suite la raison.'),
    (112, 1, 'Rapidly rotates its horn to bore through bedrock. It swaggers around volcanic regions,  protected from the lava\'s heat by its tough,  armorlike hide.'),
    (112, 2, 'Son épiderme est si épais qu’il lui permet même de survivre dans du magma d’une température de 2 000 °C.'),
    (113, 1, 'This purehearted Pokémon shares its eggs with the injured.'),
    (113, 2, 'Ce Pokémon lent à l’origine a appris à fuir plus vite pour protéger ses œufs des voleurs.'),
    (114, 1, 'It is cloaked entirely in blue vines,  preventing any glimpse of its true identity. The vines impart a refreshing sensation when chewed—they\'re useful as a spice.'),
    (114, 2, 'Ses lianes ont une odeur particulière. Elles servent d’herbes aromatiques dans une certaine zone de Galar.'),
    (115, 1, 'There are records of a lost human child being raised by a childless Kangaskhan.'),
    (115, 2, 'Certains documents certifient que les Kangourex sans progéniture élevaient des enfants humains en détresse.'),
    (116, 1, 'They swim with dance-like motions and cause whirlpools to form. Horsea compete to see which of them can generate the biggest whirlpool.'),
    (116, 2, 'Hypotrempe crée des tourbillons en dansant sous l’eau. Il s’amuse à comparer la taille des remous qu’il fait avec ceux de ses congénères.'),
    (117, 1, 'Seadra’s mouth is slender,  but its suction power is strong. In an instant,  Seadra can suck in food that’s larger than the opening of its mouth.'),
    (117, 2, 'Sa puissance de succion est si forte qu’il peut aspirer en un instant ses proies pour les manger,  même si elles sont plus grosses que sa bouche.'),
    (118, 1, 'Its dorsal and pectoral fins are strongly developed like muscles. It can swim at a speed of five knots.'),
    (118, 2, 'Ses nageoires dorsales et pectorales sont très développées. Elles lui permettent de nager à une vitesse de cinq nœuds.'),
    (119, 1, 'Using its horn,  it bores holes in riverbed boulders,  making nests to prevent its eggs from washing away.'),
    (119, 2, 'S’il fait des trous dans les rochers avec sa corne pour bâtir son nid,  c’est pour éviter que ses Œufs ne soient emportés par les flots.'),
    (120, 1, 'Fish Pokémon nibble at it,  but Staryu isn’t bothered. Its body regenerates quickly,  even if part of it is completely torn off.'),
    (120, 2, 'Il ne se soucie guère des Pokémon poissons qui viennent le grignoter,  car même si son corps est déchiqueté,  il se régénère aussitôt.'),
    (121, 1, 'Starmie swims by spinning its body at high speed. As this Pokémon cruises through the ocean,  it absorbs tiny plankton.'),
    (121, 2, 'Il aspire du plancton quand il nage dans la mer en faisant tourner son corps à grande vitesse.'),
    (122, 1, 'The behavior of this clown-like Pokémon reminds one of pantomime. It creates invisible walls using a force emitted from its fingertips.'),
    (122, 2, 'Son talent pour le mime est indéniable. Il émet des ondes du bout des doigts pour créer un mur qui le protège de nombreuses attaques.'),
    (123, 1, 'The large,  wickedly sharp scythes on its forearms are truly fearsome weapons. Prey\'s attempts to flee are unfailingly thwarted by this Pokémon\'s nimble motions.'),
    (123, 2, 'Si l’on voit un grand nombre d’arbres abattus au même endroit dans une forêt,  cela signifie que l’on se trouve sur le territoire d’un Insécateur.'),
    (124, 1, 'The Jynx of Galar often have beautiful and delicate voices. Some of these Pokémon have even gathered a fan base.'),
    (124, 2, 'Les Lippoutou vivant à Galar sont souvent dotés d’une belle voix cristalline,  ce qui leur vaut d’attirer des fans.'),
    (125, 1, 'Feeds on electrical energy. During sudden showers beneath looming thunderclouds,  one can observe Electabuzz scaling tall trees,  where the Pokémon will then wait for lightning to strike.'),
    (125, 2, 'Quand un orage approche,  ils se réunissent tous autour d’un grand arbre et attendent patiemment que la foudre s’abatte.'),
    (126, 1, 'Legend has it that this Pokémon was born from the crater of a volcano. When wounded,  it bathes in lava to heal its body,  much as one would soak in a hot spring.'),
    (126, 2, 'Tout son corps est en combustion permanente. Il est craint,  car on dit qu’il cause des incendies.'),
    (127, 1, 'This Pokémon clamps its pincers down on its prey and then either splits the prey in half or flings it away.'),
    (127, 2, 'Une fois sa proie enserrée entre ses cornes,  deux choix s’offrent à lui : la couper en deux ou la projeter au loin de toutes ses forces.'),
    (128, 1, 'The Tauros of the Galar region are volatile in nature,  and they won’t allow people to ride on their backs.'),
    (128, 2, 'Les Tauros vivant à Galar ont un tempérament violent et ne tolèrent pas que les êtres humains montent sur leur dos.'),
    (129, 1, 'A feeble,  pitiful imbecile of a Pokémon that is nonetheless very hardy. Unperturbed by turbid water,  it can be found living in all sorts of places.'),
    (129, 2, 'Ce Pokémon est si faible que,  dans les eaux à forts courants,  il se contente de se laisser porter lamentablement.'),
    (130, 1, 'I suspect this Pokémon to be the true identity of a dragon written of in ancient texts,  which claimed that it razed an entire village with white-hot beams from its maw.'),
    (130, 2, 'Quand il se laisse emporter par la rage,  même la plus violente des tempêtes ne peut l’empêcher de détruire tout ce qui l’entoure.'),
    (131, 1, 'Crossing icy seas is no issue for this cold-resistant Pokémon. Its smooth skin is a little cool to the touch.'),
    (131, 2, 'Il résiste bien aux très basses températures et peut nager dans des mers glaciales. Sa peau est lisse et légèrement froide au toucher.'),
    (132, 1, 'When it encounters another Ditto,  it will move faster than normal to duplicate that opponent exactly.'),
    (132, 2, 'Quand il rencontre l’un de ses semblables,  il s’agite avec plus de vivacité que d’habitude pour adopter exactement la même forme que lui.'),
    (133, 1, 'Harbors the potential to evolve into manifold forms. Within Eevee lies the key to the mysteries of Pokémon evolution—I\'m certain of it.'),
    (133, 2, 'L’ADN de ce Pokémon très particulier recèle de nombreuses possibilités d’évolution.'),
    (134, 1, 'Tests show that its cells closely resemble water molecules,  which perhaps explains its ability to conceal its form while submerged. I believe the origins of mermaid folklore lie with this Pokémon.'),
    (134, 2, 'Sa structure cellulaire est similaire à la composition moléculaire de l’eau. Une fois dans cet élément,  il devient indétectable à l’œil nu.'),
    (135, 1, 'Bristles its fur into sharp,  needlelike points when enraged. One can hear electricity crackle in its breath when it exhales.'),
    (135, 2, 'Il se charge d’ions négatifs contenus dans l’air pour envoyer des décharges d’environ 10 000 volts.'),
    (136, 1, 'Flames burn within a saclike organ inside this Pokémon. When Flareon inhales,  these flames grow in intensity,  reaching a mighty 3, 000 degrees Fahrenheit.'),
    (136, 2, 'Il emmagasine de l’air dans sa poche de flammes et le chauffe à une température de 1 700 °C.'),
    (137, 1, 'It has no discernible heartbeat and does not seem to draw breath,  and yet it appears to function without issue. I cannot even begin to explain this utterly bizarre anomaly.'),
    (137, 2, 'Ces dernières années,  il s’est rendu très utile dans le cyberespace,  qu’il arpente pour s’assurer qu’il n’y a aucune donnée suspecte.'),
    (138, 1, 'This Pokémon is a member of an ancient,  extinct species. Omanyte paddles through water with its 10 tentacles,  looking like it’s just drifting along.'),
    (138, 2, 'Un Pokémon préhistorique aujourd’hui disparu. Il semble flotter lorsqu’il nage en brassant l’eau avec ses dix tentacules.'),
    (139, 1, 'Omastar’s sharp fangs could crush rock,  but the Pokémon can attack only the prey that come within reach of its tentacles.'),
    (139, 2, 'Ses crocs sont capables de broyer la roche,  mais il ne peut s’attaquer qu’aux proies à portée de ses tentacules.'),
    (140, 1, 'While some say this species has gone extinct,  Kabuto sightings are apparently fairly common in some places.'),
    (140, 2, 'On raconte qu’ils se seraient éteints,  mais apparemment,  on peut souvent en croiser dans une zone particulière.'),
    (141, 1, 'The cause behind the extinction of this species is unknown. Kabutops were aggressive Pokémon that inhabited warm seas.'),
    (141, 2, 'Nul ne sait pourquoi il s’est éteint. Ce Pokémon préhistorique féroce vivait dans les mers chaudes.'),
    (142, 1, 'Aerodactyl’s sawlike fangs can shred skin to tatters—even the skin of Steel-type Pokémon.'),
    (142, 2, 'Sa dentition semblable à une scie peut même broyer la peau des Pokémon Acier.'),
    (143, 1, 'This glutton appears in villages without warning and devours the entirety of their rice granaries—such occurrences have long been counted among the gravest of disasters.'),
    (143, 2, 'L’estomac de ce Pokémon est si résistant qu’il peut même digérer de la nourriture avariée.'),
    (144, 1, 'This Pokémon can control ice at will. Articuno is said to live in snowy mountains riddled with permafrost.'),
    (144, 2, 'Il possède le pouvoir de contrôler la glace. Selon les dires,  il vivrait sur les sommets recouverts de neiges éternelles.'),
    (145, 1, 'Zapdos is a legendary bird Pokémon. It’s said that when Zapdos rubs its feathers together,  lightning will fall immediately after.'),
    (145, 2, 'On raconte que lorsque ce Pokémon oiseau légendaire fait vibrer ses plumes,  le frottement fait tomber la foudre instantanément.'),
    (146, 1, 'There are stories of this Pokémon using its radiant,  flame-cloaked wings to light up paths for those lost in the mountains.'),
    (146, 2, 'On raconte qu’il a sauvé des personnes perdues en montagne en illuminant les sentiers à l’aide de ses splendides ailes flamboyantes.'),
    (147, 1, 'This Pokémon was long considered to be no more than a myth. The small lump on a Dratini’s forehead is actually a horn that’s still coming in.'),
    (147, 2, 'On a longtemps douté de l’existence de ce Pokémon. La petite bosse sur son front est en fait sa corne en pleine croissance.'),
    (148, 1, 'This Pokémon gathers power in the orbs on its tail and controls the weather. When enshrouded by an aura,  Dragonair has a mystical appearance.'),
    (148, 2, 'Il contrôle la météo en accumulant de l’énergie dans les orbes au bout de sa queue. Sa silhouette nimbée d’une aura lui confère un air mystique.'),
    (149, 1, 'This Pokémon is known as the Sea Incarnate. Figureheads that resemble Dragonite decorate the bows of many ships.'),
    (149, 2, 'On l’appelle « l’avatar de la mer ». Nombreux sont les navires arborant une figure de proue en forme de Dracolosse.'),
    (150, 1, 'Its DNA is almost the same as Mew’s. However,  its size and disposition are vastly different.'),
    (150, 2, 'Son ADN est presque le même que celui de Mew,  mais sa taille et son caractère sont très différents.'),
    (151, 1, 'When viewed through a microscope,  this Pokémon’s short,  fine,  delicate hair can be seen.'),
    (151, 2, 'À l’aide d’un microscope,  on peut distinguer le pelage extrêmement court,  fin et délicat de ce Pokémon.'),
    (152, 1, 'In battle,  Chikorita waves its leaf around to keep the foe at bay. However,  a sweet fragrance also wafts from the leaf,  becalming the battling Pokémon and creating a cozy,  friendly atmosphere all around.'),
    (152, 2, 'Lorsqu’il se bat,  Germignon secoue sa feuille pour tenir son ennemi à distance. Un doux parfum s’en dégage également,  apaisant les Pokémon qui se battent et créant une atmosphère agréable et amicale.'),
    (153, 1, 'Bayleef’s neck is ringed by curled-up leaves. Inside each tubular leaf is a small shoot of a tree. The fragrance of this shoot makes people peppy.'),
    (153, 2, 'Le cou de Macronium est entouré de nombreuses feuilles. Dans chacune d’elles se trouve une pousse d’arbre. Le parfum de cette pousse donne la pêche aux personnes qui le sentent.'),
    (154, 1, 'The fragrance of Meganium’s flower soothes and calms emotions. In battle,  this Pokémon gives off more of its becalming scent to blunt the foe’s fighting spirit.'),
    (154, 2, 'Le parfum de la fleur de Méganium apaise et calme les esprits. Pendant les combats,  ce Pokémon émet son parfum relaxant pour atténuer l’agressivité de l’ennemi.'),
    (155, 1, 'Hails from the Johto region. Though usually curled into a ball due to its timid disposition,  it harbors tremendous firepower.'),
    (155, 2, 'Héricendre se protège en faisant jaillir des flammes de son dos. Ces flammes peuvent être violentes si le Pokémon est en colère. Cependant,  s’il est fatigué,  seules quelques flammèches vacillent laborieusement.'),
    (156, 1, 'This creature\'s fur is most mysterious—it is wholly impervious to the burning touch of flame. Should Quilava turn its back to you,  take heed! Such a posture indicates a forthcoming attack.'),
    (156, 2, 'Feurisson garde ses ennemis à distance grâce à l’intensité de ses flammes et à des rafales d’air brûlant. Ce Pokémon utilise son incroyable agilité pour éviter les attaques,  tout en enflammant ses ennemis.'),
    (157, 1, 'Said to purify lost,  forsaken souls with its flames and guide them to the afterlife. I believe its form has been influenced by the energy of the sacred mountain towering at Hisui\'s center.'),
    (157, 2, 'Typhlosion se cache derrière un chatoyant nuage de chaleur qu’il crée en attisant ses flammes intenses. Ce Pokémon peut générer des rafales explosives qui réduisent tout en cendres.'),
    (158, 1, 'Despite the smallness of its body,  Totodile’s jaws are very powerful. While the Pokémon may think it is just playfully nipping,  its bite has enough power to cause serious injury.'),
    (158, 2, 'Malgré son tout petit corps,  la mâchoire de Kaiminus est très puissante. Parfois,  ce Pokémon mordille les gens pour jouer,  sans se rendre compte que sa morsure peut gravement blesser quelqu’un.'),
    (159, 1, 'Once Croconaw has clamped its jaws on its foe,  it will absolutely not let go. Because the tips of its fangs are forked back like barbed fishhooks,  they become impossible to remove when they have sunk in.'),
    (159, 2, 'Une fois que Crocrodil a refermé sa mâchoire sur son ennemi,  il est impossible de le faire lâcher prise. Ses crocs sont recourbés comme des hameçons et ne peuvent pas être retirés une fois enfoncés.'),
    (160, 1, 'Feraligatr intimidates its foes by opening its huge mouth. In battle,  it will kick the ground hard with its thick and powerful hind legs to charge at the foe at an incredible speed.'),
    (160, 2, 'Aligatueur impressionne ses ennemis en ouvrant son énorme gueule. Pendant les combats,  il piétine le sol de ses puissantes pattes arrière avant de charger ses adversaires à pleine vitesse.'),
    (161, 1, 'When Sentret sleeps,  it does so while another stands guard. The sentry wakes the others at the first sign of danger. When this Pokémon becomes separated from its pack,  it becomes incapable of sleep due to fear.'),
    (161, 2, 'Lorsqu’un Fouinette dort,  un autre monte la garde. La sentinelle réveille les autres au moindre signe de danger. Si un de ces Pokémon est séparé de sa meute,  il est incapable de dormir,  car il a peur.'),
    (162, 1, 'Furret has a very slim build. When under attack,  it can slickly squirm through narrow spaces and get away. In spite of its short limbs,  this Pokémon is very nimble and fleet.'),
    (162, 2, 'Fouinar est très mince. Lorsqu’il est attaqué,  il peut s’enfuir en se faufilant habilement dans les recoins étroits. Malgré ses pattes courtes,  ce Pokémon est très agile et rapide.'),
    (163, 1, 'It begins to hoot at the same time every day. Some Trainers use them in place of clocks.'),
    (163, 2, 'Il hulule chaque jour aux mêmes moments. Certains Dresseurs s’en servent comme d’une montre.'),
    (164, 1, 'When it needs to think,  it rotates its head 180 degrees to sharpen its intellectual power.'),
    (164, 2, 'Quand il réfléchit,  il tourne sa tête sur 180 degrés pour optimiser son mode de pensée.'),
    (165, 1, 'These very cowardly Pokémon join together and use Reflect to protect their nest.'),
    (165, 2, 'Extrêmement timide,  ce Pokémon défend le nid qu’il partage avec ses congénères en utilisant Protection.'),
    (166, 1, 'It flies through the night sky,  sprinkling sparkly dust. According to some,  if that dust sticks to you,  good things will happen to you.'),
    (166, 2, 'Il vole dans le ciel nocturne en répandant une poudre scintillante. Si elle vous touche,  quelque chose de positif devrait bientôt vous arriver.'),
    (167, 1, 'Although the poison from its fangs isn’t that strong,  it’s potent enough to weaken prey that gets caught in its web.'),
    (167, 2, 'Le poison contenu dans les mandibules de ce Pokémon n’est pas très violent,  mais il suffit à immobiliser les proies piégées dans sa toile.'),
    (168, 1, 'It spews threads from its mouth to catch its prey. When night falls,  it leaves its web to go hunt aggressively.'),
    (168, 2, 'Il capture ses proies en projetant un fil qu’il sécrète. À la nuit tombée,  il quitte sa toile et part chasser activement.'),
    (169, 1, 'Its hind limbs have become another set of wings. Crobat expertly maneuvers its four wings to dart in exquisite fashion through even the most confined caves without losing any speed.'),
    (169, 2, 'Il vole en contrôlant librement ses quatre ailes et peut se déplacer sans avoir besoin de ralentir,  même dans les grottes étroites.'),
    (170, 1, 'On the dark ocean floor,  its only means of communication is its constantly flashing lights.'),
    (170, 2, 'Au plus profond de l’océan,  son seul moyen de communication est la lumière de ses antennes,  qui clignotent constamment.'),
    (171, 1, 'This Pokémon flashes a bright light that blinds its prey. This creates an opening for it to deliver an electrical attack.'),
    (171, 2, 'Il dégage une vive lumière pour éblouir ses proies,  puis leur inflige un choc électrique bien senti.'),
    (172, 1, 'Pichu stores electricity in the sacs on its cheeks but discharges it inadvertently when agitated or excited. Being yet immature,  the Pokémon\'s handling of electricity is rather inept.'),
    (172, 2, 'Les poches électriques de ses joues sont très petites. Lorsqu’elles sont surchargées,  il s’électrocute lui-même.'),
    (173, 1, 'In silhouette,  they resemble twinkling starlight. When shooting stars rain from the night sky,  Cleffa gather in numbers and dance as though they are indeed incarnations of the stars.'),
    (173, 2, 'Il ressemble un peu à une étoile. On suppose qu’il est venu sur terre accroché à une météorite.'),
    (174, 1, 'Taking advantage of the softness of its body,  Igglybuff moves as if bouncing. Its body turns a deep pink when its temperature rises.'),
    (174, 2, 'Il se déplace en faisant rebondir son corps tout mou. Lorsque sa température corporelle augmente,  il devient rose foncé.'),
    (175, 1, 'This ovate creature is frequently mistaken for a moving egg when encountered out in the fields or in the mountains. Its guileless smile soothes the soul.'),
    (175, 2, 'C’est un symbole de chance. On dit que sa coquille est remplie de joie.'),
    (176, 1, 'No records exist of Togetic being seen in the wilds. Rumors abound that it evolves under the loving care of a trusted human companion,  upon whom the Pokémon then bestows great joy.'),
    (176, 2, 'Ce Pokémon est capable de léviter sans battre des ailes. Il est vite démoralisé s’il n’est pas en compagnie de gens sympathiques.'),
    (177, 1, 'Because its wings aren’t yet fully grown,  it has to hop to get around. It is always staring at something.'),
    (177, 2, 'Ses ailes ne sont pas assez développées donc il ne peut se déplacer qu’en sautillant. Il fixe toujours quelque chose du regard.'),
    (178, 1, 'This odd Pokémon can see both the past and the future. It eyes the sun’s movement all day.'),
    (178, 2, 'Capable de voir le passé et l’avenir,  ce Pokémon mystérieux consacre toutes ses journées à observer la course du soleil.'),
    (179, 1, 'Rubbing its fleece generates electricity. You’ll want to pet it because it’s cute,  but if you use your bare hand,  you’ll get a painful shock.'),
    (179, 2, 'Il a beau être mignon,  sa laine génère de l’électricité quand on la frotte. Tentez de le caresser,  et il vous mettra vite au courant !'),
    (180, 1, 'It stores electricity in its fluffy fleece. If it stores up too much,  it will start to go bald in those patches.'),
    (180, 2, 'Il accumule de l’électricité dans sa toison duveteuse. Il en a tellement stocké qu’il en a perdu sa laine par endroits.'),
    (181, 1, 'Its tail shines bright and strong. It has been prized since long ago as a beacon for sailors.'),
    (181, 2, 'Sa queue brille d’une lumière éclatante. Depuis des temps très anciens,  il est vénéré comme le guide des marins.'),
    (182, 1, 'Bellossom gather at times and appear to dance. They say that the dance is a ritual to summon the sun.'),
    (182, 2, 'Les Joliflor se réunissent parfois pour danser. On pense que c’est un rituel pour invoquer le soleil.'),
    (183, 1, 'Even after Marill swims in a cold sea,  its water- repellent fur dries almost as soon as Marill leaves the water. That’s why this Pokémon is never cold.'),
    (183, 2, 'Sa fourrure est hydrophobe,  si bien qu’elle sèche en un instant. Il n’a donc jamais froid,  même lorsqu’il sort d’une mer glaciale.'),
    (184, 1, 'These Pokémon create air-filled bubbles. When Azurill play in rivers,  Azumarill will cover them with these bubbles.'),
    (184, 2, 'Il crée des bulles d’air dont il enveloppe gentiment les Azurill venus jouer dans la rivière.'),
    (185, 1, 'Though it pretends to be a tree,  it fails to fool even children. To the touch,  its body feels more like rock than tree bark. Sudowoodo\'s extreme aversion to water merits special note.'),
    (185, 2, 'Il se déguise en arbre pour éviter de se faire attaquer. Il déteste l’eau et se cache par temps de pluie.'),
    (186, 1, 'The cry of a male is louder than that of a female. Male Politoed with deep,  menacing voices find more popularity with the opposite gender.'),
    (186, 2, 'Le cri des mâles est plus puissant que celui des femelles,  qui préfèrent les voix fortes et intimidantes.'),
    (187, 1, 'This Pokémon drifts and floats with the wind. If it senses the approach of strong winds,  Hoppip links its leaves with other Hoppip to prepare against being blown away.'),
    (187, 2, 'Ce Pokémon flotte à la dérive,  porté par le vent. S’il sent qu’un vent très fort approche,  Granivol attache ses feuilles aux autres Granivol pour ne pas être emporté par la bourrasque.'),
    (188, 1, 'Skiploom’s flower blossoms when the temperature rises above 64 degrees Fahrenheit. How much the flower opens depends on the temperature. For that reason,  this Pokémon is sometimes used as a thermometer.'),
    (188, 2, 'La fleur de Floravol éclot lorsque la température atteint 18 °C. L’ouverture de la fleur change en fonction de la température. Certaines personnes se servent de ce Pokémon comme d’un thermomètre.'),
    (189, 1, 'Jumpluff rides warm southern winds to cross the sea and fly to foreign lands. The Pokémon descends to the ground when it encounters cold air while it is floating.'),
    (189, 2, 'Cotovol traverse la mer,  porté par les vents,  pour découvrir de nouveaux territoires. Ce Pokémon se rapproche du sol quand le vent est trop froid.'),
    (190, 1, 'This treetop dweller possesses a tail as dexterous as a hand. Ancient writings describe this Pokémon as a one-armed oddity.'),
    (190, 2, 'Il guette ses proies depuis la cime des arbres. Quand il aperçoit un Croquine,  son mets préféré,  il se jette dessus.'),
    (191, 1, 'Sunkern tries to move as little as it possibly can. It does so because it tries to conserve all the nutrients it has stored in its body for its evolution. It will not eat a thing,  subsisting only on morning dew.'),
    (191, 2, 'Tournegrin essaie de bouger le moins possible. C’est parce qu’il veut conserver tous les nutriments qu’il stocke dans son corps pour son évolution. Il ne mange pas,  ne subsistant que grâce à la rosée matinale.'),
    (192, 1, 'Sunflora converts solar energy into nutrition. It moves around actively in the daytime when it is warm. It stops moving as soon as the sun goes down for the night.'),
    (192, 2, 'Héliatronc convertit l’énergie solaire en nutriments. Il remue activement pendant la journée,  quand il fait chaud. Il redevient immobile dès que le soleil se couche.'),
    (193, 1, 'Its frail wings are so thin that one can see clear through them. However,  during flight these wings exhibit the power to churn air with force enough to launch a house skyward.'),
    (193, 2, 'Yanma a un champ de vision de 360 degrés sans avoir besoin de bouger les yeux. Il vole incroyablement bien et peut faire des figures acrobatiques. Ce Pokémon descend en piqué sur ses proies.'),
    (194, 1, 'When walking on land,  it covers its body with a poisonous film that keeps its skin from dehydrating.'),
    (194, 2, 'Lorsqu’il est sur la terre ferme,  il couvre son corps d’un voile toxique qui le protège de la déshydratation.'),
    (195, 1, 'Its body is always slimy. It often bangs its head on the river bottom as it swims but seems not to care.'),
    (195, 2, 'Il est toujours gluant. Quand il nage,  il se cogne souvent la tête au fond des rivières,  mais semble s’en moquer.'),
    (196, 1, 'Wields an arcane power with which it can predict the weather and even people\'s thoughts. When bathed in sunshine,  the scarlet orb on its brow glows and builds energy.'),
    (196, 2, 'Le joyau sur le front de Mentali projette des ondes psychiques en combat,  et s’obscurcit quand il est à bout de force.'),
    (197, 1, 'It is most active in the wee hours of the night,  when moonlight bathes the land. Its large eyes can pierce the darkness and perceive prey with absolute clarity.'),
    (197, 2, 'Les nuits de pleine lune,  ou s’il est agité,  les anneaux sur sa peau se mettent à briller.'),
    (198, 1, 'Widely shunned as a bearer of ill fortune. Upon crossing paths with this creature,  I\'ve been told one must chant ”Workrum,  Workrum—bad luck,  don\'t come” as a protective incantation.'),
    (198, 2, 'Il cherche des objets brillants pour son chef. Sa réputation d’oiseau de mauvais augure lui vaut la haine de nombreuses personnes.'),
    (199, 1, 'Slowking can solve any problem presented to it,  but no one can understand a thing Slowking says.'),
    (199, 2, 'Il est capable de résoudre tous les problèmes qu’on lui présente,  mais personne ne parvient à comprendre ce qu’il dit.'),
    (200, 1, 'It conceals itself in darkness,  sending chills up travelers\' spines with its childlike weeping. As it observes the frightened travelers with glee,  the red orbs upon its chest let off an eerie light.'),
    (200, 2, 'Il adore faire peur aux humains en imitant leurs pleurs,  et n’apprécie guère ceux qui ne se laissent pas intimider.'),
    (201, 1, 'It is hard to believe these strangely shaped Pokémon are truly living creatures. I\'ve pointed out that the species\' many forms resemble writing from other lands; no one will take me seriously.'),
    (201, 2, 'Ce Pokémon a la forme d’un caractère d’écriture antique. Personne ne sait si ces écritures antiques sont apparues avant les Zarbi ou le contraire. Des études sont en cours,  mais aucun résultat n’a été annoncé.'),
    (202, 1, 'To keep its pitch-black tail hidden,  it lives quietly in the darkness. It is never first to attack.'),
    (202, 2, 'Il vit discrètement dans l’obscurité pour cacher sa queue noire. Il n’attaque jamais en premier.'),
    (203, 1, 'Girafarig’s rear head contains a tiny brain that is too small for thinking. However,  the rear head doesn’t need to sleep,  so it can keep watch over its surroundings 24 hours a day.'),
    (203, 2, 'La tête à l’arrière de Girafarig abrite un cerveau trop petit pour penser. En revanche,  cette tête arrière n’a pas besoin de dormir,  ce qui lui permet de monter la garde tout le temps.'),
    (204, 1, 'It sticks tree bark to itself with its saliva,  making itself thicker and larger. Elderly Pineco are ridiculously huge.'),
    (204, 2, 'Il grandit en utilisant sa salive pour coller l’écorce des arbres sur son corps. Un Pomdepik âgé peut prendre des proportions démesurées.'),
    (205, 1, 'In the moment that it gulps down its prey,  the inside of its shell is exposed,  but to this day,  no one has ever seen that sight.'),
    (205, 2, 'On ne peut voir l’intérieur de sa carapace que lorsqu’il engloutit sa nourriture,  mais il est si rapide que personne n’a encore jamais réussi.'),
    (206, 1, 'The nests Dunsparce live in are mazes of tunnels. They never get lost in their own nests—they can tell where they are by the scent of the dirt.'),
    (206, 2, 'Bien que son nid ressemble à un labyrinthe,  il ne s’y perd jamais,  car il se repère grâce à l’odeur de la terre.'),
    (207, 1, 'Its tail is tipped by a thick,  horrible stinger. To bring down prey,  it will first obscure their vision by covering their faces with its body,  and then it will use the stinger to inject them with venom.'),
    (207, 2, 'Scorplane plane dans les airs sans un bruit,  comme s’il glissait. Ce Pokémon s’accroche au visage de son ennemi grâce aux serres de ses pattes arrière et aux pinces de ses pattes avant,  et pique avec son dard empoisonné.'),
    (208, 1, 'This Pokémon evolved through use of a strange item. Its body is coated with steel powder and notably hard—not even diamond can leave so much as a scratch.'),
    (208, 2, 'On pense que son corps s’est transformé à force d’avaler le fer contenu dans la terre en creusant.'),
    (209, 1, 'In contrast to its appearance,  it’s quite timid. When playing with other puppy Pokémon,  it sometimes gets bullied.'),
    (209, 2, 'Malgré les apparences,  c’est un grand timide qui fait souvent l’objet de railleries quand il se trouve au milieu d’un groupe de Pokémon Chiot.'),
    (210, 1, 'Although it’s popular with young people,  Granbull is timid and sensitive,  so it’s totally incompetent as a watchdog.'),
    (210, 2, 'Les jeunes gens en sont fous,  mais sa timidité et sa grande délicatesse en font un piètre Pokémon de garde.'),
    (211, 1, 'Fishers detest this troublesome Pokémon because it sprays poison from its spines,  getting it everywhere. A different form of Qwilfish lives in other regions.'),
    (211, 2, 'Ses petites épines étaient autrefois des écailles. Elles sécrètent des toxines pouvant faire perdre connaissance.'),
    (212, 1, 'Evolved by way of a curious item. The shell covering its body has been shown to be stronger than forged steel.'),
    (212, 2, 'Malgré son corps fin,  sa puissance de frappe est prodigieuse,  car même ses muscles sont composés de métal.'),
    (213, 1, 'The berries stored in its vaselike shell eventually become a thick,  pulpy juice.'),
    (213, 2, 'Les Baies qu’il conserve dans sa carapace en forme d’urne se changent en jus onctueux après un certain temps.'),
    (214, 1, 'This Pokémon has an unparalleled horn. Heracross itself demonstrates tremendous power—it\'s capable of throwing several people trained in the traditional arts of war at once.'),
    (214, 2, 'Ce Pokémon est fier de sa force colossale qui lui permet de soulever cent fois son propre poids avec facilité.'),
    (215, 1, 'Its sturdy,  curved claws are ideal for traversing precipitous cliffs. From the tips of these claws drips a venom that infiltrates the nerves of any prey caught in Sneasel\'s grasp.'),
    (215, 2, 'Un Pokémon aussi cruel que fourbe. Il se glisse dans le nid des autres Pokémon en leur absence pour dérober leurs Œufs.'),
    (216, 1, 'It licks its paws because of the sweet honey that has soaked into them. It is cunning,  stealing into the nests of Combee and taking for itself the honey that the Combee have amassed.'),
    (216, 2, 'Ce Pokémon aime se lécher les paumes quand elles sont encore pleines de miel. Teddiursa concocte son propre miel en mélangeant les fruits et le pollen récolté par Dardargnan.'),
    (217, 1, 'When the cold season arrives in Hisui,  this Pokémon will wander fields and mountains alike in search of its favorite berries. Ursaring\'s hunger during this time makes it a ferocious danger.'),
    (217, 2, 'On dit que les Ursaring trouvent leur nourriture dans les cours d’eau et les grands arbres des forêts où ils habitent. Ce Pokémon erre dans la forêt toute la journée pour chercher de la nourriture.'),
    (218, 1, 'Slugma does not have any blood in its body. Instead,  intensely hot magma circulates throughout this Pokémon’s body,  carrying essential nutrients and oxygen to its organs.'),
    (218, 2, 'Les veines de Limagma ne contiennent pas de sang. Au lieu de ça,  du magma en fusion circule dans le corps de ce Pokémon,  apportant les nutriments et l’oxygène nécessaires à ses organes.'),
    (219, 1, 'Magcargo’s body temperature is approximately 18, 000 degrees Fahrenheit. Water is vaporized on contact. If this Pokémon is caught in the rain,  the raindrops instantly turn into steam,  cloaking the area in a thick fog.'),
    (219, 2, 'La température de Volcaropod est d’environ 10 000 °C. L’eau s’évapore à son contact. Si ce Pokémon se retrouve sous la pluie,  les gouttes d’eau forment de la vapeur et couvrent la zone de brouillard.'),
    (220, 1, 'Swinub excels at sniffing out mushrooms buried beneath grass or snow. Since ancient times,  the people of Hisui have often relied upon this skill.'),
    (220, 2, 'S’il sent une odeur attrayante,  il fonce la tête la première pour trouver d’où elle vient.'),
    (221, 1, 'The long fur of this Pokémon covers its eyes,  ears,  and even limbs,  allowing Piloswine to resist harshly frigid conditions. The Pokémon\'s white tusks can be used to defeat its enemies.'),
    (221, 2, 'Bien qu’il soit pourvu de pattes courtes,  ses sabots larges et pointus l’empêchent de glisser sur la glace.'),
    (222, 1, 'These Pokémon live in warm seas. In prehistoric times,  many lived in the oceans around the Galar region as well.'),
    (222, 2, 'Ces Pokémon habitués des mers chaudes se trouvaient autrefois en masse sur les côtes de Galar.'),
    (223, 1, 'Spits water from its mouth with incredible accuracy. It captures Burmy by shooting them down off the branches from which they dangle.'),
    (223, 2, 'À l’aide de sa nageoire dorsale en forme de ventouse,  il s’accroche sous un Démanta pour récupérer ses restes.'),
    (224, 1, 'While Octillery still shoots water from its mouth,  the drastic anatomical difference between it and Remoraid meant that for a long time,  no one believed the former evolved from the latter.'),
    (224, 2, 'Il capture ses ennemis avec ses tentacules et les écrase ensuite avec sa tête dure comme la pierre.'),
    (225, 1, 'It has a generous habit of sharing its food with people and Pokémon,  so it’s always scrounging around for more food.'),
    (225, 2, 'Ce Pokémon partage facilement son repas avec d’autres Pokémon et avec des humains,  ce qui l’oblige à constamment courir après la nourriture.'),
    (226, 1, 'This calm and gentle Pokémon swims gracefully through the sea. After building speed,  it can leap out of the water. It is often misidentified as a bird Pokémon due to this behavior.'),
    (226, 2, 'Il nage paisiblement,  sans se soucier des Rémoraid qui s’agrippent à lui pour lui voler ses restes.'),
    (227, 1, 'People fashion swords from Skarmory’s shed feathers,  so this Pokémon is a popular element in heraldic designs.'),
    (227, 2, 'Ce Pokémon orne souvent les blasons,  car les plumes qu’il perd sont utilisées pour forger des épées.'),
    (228, 1, 'They make repeated eerie howls before dawn to call attention to their pack.'),
    (228, 2, 'Si ses congénères et lui poussent de sinistres hurlements avant l’aube,  c’est pour signaler leur présence à tout le monde.'),
    (229, 1, 'Identifiable by its eerie howls,  people a long time ago thought it was the grim reaper and feared it.'),
    (229, 2, 'Ceux qui le craignaient jadis lui ont donné le surnom de « messager de la Faucheuse » à cause de son hurlement sinistre si particulier.'),
    (230, 1, 'Scales shed by this Pokémon have such a splendorous gleam to them that they’ve been given to royalty as gifts.'),
    (230, 2, 'Les écailles qui se détachent de son corps brillent d’un éclat si élégant et si intense qu’on les offre aux familles royales.'),
    (231, 1, 'Phanpy uses its long nose to shower itself. When others gather around,  they thoroughly douse each other with water. These Pokémon can be seen drying their soaking-wet bodies at the edge of water.'),
    (231, 2, 'Phanpy utilise sa petite trompe pour se doucher. Quand plusieurs d’entre eux se réunissent,  ils s’arrosent joyeusement. On peut souvent voir ces Pokémon se sécher au bord de l’eau.'),
    (232, 1, 'If Donphan were to tackle with its hard body,  even a house could be destroyed. Using its massive strength,  the Pokémon helps clear rock and mud slides that block mountain trails.'),
    (232, 2, 'Si Donphan décidait de charger,  il pourrait détruire une maison. Grâce à sa force étonnante,  ce Pokémon peut aider à déplacer les rochers et les coulées de boue qui bloquent les chemins de montagne.'),
    (233, 1, 'A bizarre item caused this Pokémon to evolve. While it now exhibits many new gestures and expressions,  its biology remains inscrutable.'),
    (233, 2, 'Depuis qu’on l’a doté d’une intelligence artificielle,  il parle un langage mystérieux que seuls ses congénères comprennent.'),
    (234, 1, 'Its strangely shaped antlers have the power to bewitch those who see them. Medicine made by grinding up the black orbs from fallen antlers is an effective treatment for insomnia.'),
    (234, 2, 'Les superbes bois de Cerfrousse étaient vendus très cher comme œuvres d’art. Ce Pokémon fut chassé et l’espèce proche de l’extinction à cause des gens qui recherchaient leurs précieux bois.'),
    (235, 1, 'It draws symbols with the fluid that oozes from the tip of its tail. Depending on the symbol,  Smeargle fanatics will pay big money for them.'),
    (235, 2, 'Il se sert du liquide qui sort de sa queue pour dessiner sa marque. Ses fans s’arrachent ses plus beaux tracés à prix d’or.'),
    (236, 1, 'Even though it is small,  it can’t be ignored because it will slug any handy target without warning.'),
    (236, 2, 'Même s’il est petit,  il vaut mieux ne pas l’ignorer : quand il trouve un adversaire à sa hauteur,  il frappe fort et souvent sans prévenir.'),
    (237, 1, 'After doing a handstand to throw off the opponent’s timing,  it presents its fancy kick moves.'),
    (237, 2, 'Après avoir effectué un poirier visant à désorienter son adversaire,  il lui assène des coups de pied furieux.'),
    (238, 1, 'This is a very curious Pokémon. Smoochum decides what it likes and dislikes by touching things with its lips.'),
    (238, 2, 'Ce Pokémon très curieux touche tout et n’importe quoi avec ses lèvres pour déterminer ce qu’il aime et ce qu’il déteste.'),
    (239, 1, 'They generate electricity by spinning their arms. During a thunderstorm,  if one hears the lively voices of children out in the wilderness,  what one is actually hearing are the voices of Elekid.'),
    (239, 2, 'Il a encore du mal à emmagasiner l’électricité. Pour s’en nourrir,  il se faufile dans les maisons à la recherche de prises électriques.'),
    (240, 1, 'This Pokémon lives in volcanic areas. With each breath,  sparks spurt from its mouth and nose. When Magby is in good health,  its flames gain a yellow tint.'),
    (240, 2, 'Il vit près des volcans. À la fin de la journée,  il se détend dans un bon bain de magma.'),
    (241, 1, 'This Pokémon needs to be milked every day,  or else it will fall ill. The flavor of Miltank milk changes with the seasons.'),
    (241, 2, 'Sa santé décline si on ne le trait pas tous les jours. Le goût de son lait varie selon la saison.'),
    (242, 1, 'A kindhearted Pokémon that will care for any sick person or Pokémon until their health improves. The eggs it lays are delicious and bring good fortune to those who eat them.'),
    (242, 2, 'Il pond d’étranges œufs remplis de bonheur. On raconte que quiconque en mange un devient aimable envers tout le monde.'),
    (243, 1, 'Raikou embodies the speed of lightning. The roars of this Pokémon send shock waves shuddering through the air and shake the ground as if lightning bolts had come crashing down.'),
    (243, 2, 'Raikou incarne la vitesse de l’éclair. Les rugissements de ce Pokémon libèrent des ondes de choc provenant du ciel et frappant le sol avec la puissance de la foudre.'),
    (244, 1, 'Entei embodies the passion of magma. This Pokémon is thought to have been born in the eruption of a volcano. It sends up massive bursts of fire that utterly consume all that they touch.'),
    (244, 2, 'Entei incarne la colère du magma. On pense que ce Pokémon est né suite à l’éruption d’un volcan. Il peut envoyer d’énormes jets de flammes qui calcinent tout ce qu’ils touchent.'),
    (245, 1, 'Suicune embodies the compassion of a pure spring of water. It runs across the land with gracefulness. This Pokémon has the power to purify dirty water.'),
    (245, 2, 'Suicune incarne la tranquillité d’une source d’eau pure. Il parcourt les plaines avec grâce. Ce Pokémon a le pouvoir de purifier l’eau.'),
    (246, 1, 'It feeds on soil. After it has eaten a large mountain,  it will fall asleep so it can grow.'),
    (246, 2, 'Il vit en se nourrissant de terre. Après avoir dévoré une montagne,  il s’endort et entame sa croissance.'),
    (247, 1, 'It will not stay still,  even while it’s a pupa. It already has arms and legs under its solid shell.'),
    (247, 2, 'Malgré son état de chrysalide,  il ne reste pas immobile. Sous sa solide carapace,  ses pattes sortent déjà.'),
    (248, 1, 'The quakes caused when it walks make even great mountains crumble and change the surrounding terrain.'),
    (248, 2, 'Son pas est si lourd qu’il fait trembler le sol et s’écrouler même les plus grandes montagnes,  ce qui altère la topographie de la zone.'),
    (249, 1, 'Lugia’s wings pack devastating power—a light fluttering of its wings can blow apart regular houses. As a result,  this Pokémon chooses to live out of sight deep under the sea.'),
    (249, 2, 'Les ailes de Lugia renferment une puissance dévastatrice. Un simple battement de ses ailes peut détruire de petites maisons. Du coup,  ce Pokémon a choisi de vivre loin de tout,  dans les profondeurs océaniques.'),
    (250, 1, 'Ho-Oh’s feathers glow in seven colors depending on the angle at which they are struck by light. These feathers are said to bring happiness to the bearers. This Pokémon is said to live at the foot of a rainbow.'),
    (250, 2, 'Les plumes de Ho-Oh brillent de sept couleurs selon l’orientation de son corps par rapport à la lumière. On raconte que ces plumes portent bonheur. On dit aussi que ce Pokémon vit au pied d’un arc-en-ciel.'),
    (251, 1, 'This Pokémon traveled through time to come from the future. It bolsters grass and trees with its own strength,  and it can heal wounds,  too.'),
    (251, 2, 'Ce Pokémon venu du futur soigne les blessures et donne de la force aux plantes.'),
    (252, 1, 'Treecko is cool,  calm,  and collected—it never panics under any situation. If a bigger foe were to glare at this Pokémon,  it would glare right back without conceding an inch of ground.'),
    (252, 2, 'Arcko est cool,  calme et serein. Il ne panique jamais,  quelle que soit la situation. Quand un ennemi plus gros que lui lui lance un regard de défi,  ce Pokémon reste stoïque et ne cède pas un centimètre de terrain.'),
    (253, 1, 'This Pokémon adeptly flies from branch to branch in trees. In a forest,  no Pokémon can ever hope to catch a fleeing Grovyle however fast they may be.'),
    (253, 2, 'Ce Pokémon vole de branche en branche avec brio. En forêt,  aucun Pokémon,  même le plus rapide,  ne peut espérer attraper un Massko qui s’enfuit.'),
    (254, 1, 'Sceptile has seeds growing on its back. They are said to be bursting with nutrients that revitalize trees. This Pokémon raises the trees in a forest with loving care.'),
    (254, 2, 'Jungko a des graines qui lui poussent sur le dos. On dit qu’elles regorgent de nutriments qui revitalisent les arbres. Ce Pokémon s’occupe des forêts avec amour.'),
    (255, 1, 'Torchic has a place inside its body where it keeps its flame. Give it a hug—it will be glowing with warmth. This Pokémon is covered all over by a fluffy coat of down.'),
    (255, 2, 'Poussifeu dispose d’un endroit dans son corps pour stocker sa flamme. Si on lui fait un gros câlin,  sa flamme s’illumine chaleureusement. Ce Pokémon est couvert d’un duvet très doux.'),
    (256, 1, 'Combusken battles with the intensely hot flames it spews from its beak and with outstandingly destructive kicks. This Pokémon’s cry is very loud and distracting.'),
    (256, 2, 'Galifeu combat grâce aux flammes ardentes qu’il crache de son bec et à ses coups de pied destructeurs. Le cri de ce Pokémon est très puissant et très gênant pour l’adversaire.'),
    (257, 1, 'Blaziken has incredibly strong legs—it can easily clear a 30-story building in one leap. This Pokémon’s blazing punches leave its foes scorched and blackened.'),
    (257, 2, 'Braségali a des jambes incroyablement puissantes. Il peut sauter par-dessus un immeuble de trente étages. Les coups de poing enflammés de ce Pokémon peuvent carboniser ses ennemis.'),
    (258, 1, 'In water,  Mudkip breathes using the gills on its cheeks. If it is faced with a tight situation in battle,  this Pokémon will unleash its amazing power—it can crush rocks bigger than itself.'),
    (258, 2, 'Sous l’eau,  Gobou peut respirer grâce aux branchies sur ses joues. S’il se retrouve en difficulté pendant un combat,  ce Pokémon déchaîne ses pouvoirs incroyables. Il peut détruire des rochers plus gros que lui.'),
    (259, 1, 'Marshtomp is much faster at traveling through mud than it is at swimming. This Pokémon’s hindquarters exhibit obvious development,  giving it the ability to walk on just its hind legs.'),
    (259, 2, 'Flobio est bien plus rapide dans la boue que dans l’eau. L’arrière-train de ce Pokémon est particulièrement développé,  ce qui lui donne la capacité de marcher sur ses pattes arrière.'),
    (260, 1, 'Swampert predicts storms by sensing subtle differences in the sounds of waves and tidal winds with its fins. If a storm is approaching,  it piles up boulders to protect itself.'),
    (260, 2, 'Laggron peut prédire l’arrivée des tempêtes en utilisant ses nageoires pour sentir les variations dans les vagues et les marées. Si une tempête s’approche,  il empile des rochers pour protéger son habitat.'),
    (261, 1, 'Poochyena is an omnivore—it will eat anything. A distinguishing feature is how large its fangs are compared to its body. This Pokémon tries to intimidate its foes by making the hair on its tail bristle out.'),
    (261, 2, 'Medhyèna est omnivore. Il mange de tout. Ses crocs sont très gros,  comparés à son corps. Ce Pokémon essaie d’intimider ses ennemis en hérissant les poils de sa queue.'),
    (262, 1, 'Mightyena travel and act as a pack in the wild. The memory of its life in the wild compels the Pokémon to obey only those Trainers that it recognizes to possess superior skill.'),
    (262, 2, 'Les Grahyèna vivent et se déplacent en meute. Leurs réminiscences de la vie sauvage les poussent à n’obéir qu’aux Dresseurs qu’ils considèrent comme réellement talentueux.'),
    (263, 1, 'Zigzagoon that adapted to regions outside Galar acquired this appearance. If you’ve lost something,  this Pokémon can likely find it.'),
    (263, 2, 'Le Zigzaton de Galar a adopté cette forme dans les autres régions. Il est très doué pour dénicher des choses.'),
    (264, 1, 'It uses its explosive speed and razor-sharp claws to bring down prey. Running along winding paths is not its strong suit.'),
    (264, 2, 'Il se sert de sa force de propulsion et de ses griffes aiguisées pour achever ses proies. Il a du mal à courir sur les routes sinueuses.'),
    (265, 1, 'Likes sap and is abundant in the wild. Why it evolves into various different forms is unknown. One cannot tell from a Wurmple\'s appearance which form it will take when it evolves.'),
    (265, 2, 'Chenipotte est la proie de Hélédelle. Ce Pokémon essaie de résister en dirigeant les pointes de son dos vers le prédateur. Il affaiblit son ennemi en lui injectant du poison.'),
    (266, 1, 'Wraps itself in thin strings of silk while it stores energy for evolution. It can\'t extend its limbs and its movement is slow,  but its eyes keep a sharp lookout—Silcoon is always on guard.'),
    (266, 2, 'On pensait qu’Armulys pouvait résister à la faim et ne consommait rien avant son évolution. On sait maintenant que ce Pokémon étanche sa soif en récupérant l’eau de pluie déposée sur sa soie.'),
    (267, 1, 'A colorful and incredibly beautiful but also greedy Pokémon. In an effort to keep its favorite food all to itself,  it will chase away Combee as they try to gather nectar.'),
    (267, 2, 'Charmillon a une longue trompe en spirale,  particulièrement pratique pour récupérer le pollen des fleurs. Ce Pokémon se laisse porter par les vents printaniers pendant qu’il butine.'),
    (268, 1, 'The silk coating its body is thin but sufficiently strong. Cascoon\'s silk has a luster and texture superior to that of Silcoon\'s,  and clothes made using Cascoon silk are regarded as top-notch.'),
    (268, 2, 'Lorsqu’il est attaqué,  Blindalys reste immobile,  même s’il a très mal. En effet,  s’il bougeait,  son corps serait affaibli lors de son évolution. En revanche,  ce Pokémon n’oubliera pas la douleur endurée.'),
    (269, 1, 'Tends to be drawn to bonfires on dark nights. Difficult to chase away from settlements because of the way it scatters highly toxic scales.'),
    (269, 2, 'Lorsque Papinox bat des ailes,  une légère poussière se répand. Cette poussière est en fait un puissant poison capable de mettre au tapis un boxeur professionnel. Ce Pokémon cherche sa nourriture avec ses antennes,  comme un radar.'),
    (270, 1, 'Its leaf grew too large for it to live on land. That is how it began to live floating in the water.'),
    (270, 2, 'Sa feuille est devenue si grande et si lourde qu’il doit vivre en flottant sur l’eau.'),
    (271, 1, 'It lives at the water’s edge where it is sunny. It sleeps on a bed of water grass by day and becomes active at night.'),
    (271, 2, 'Il vit au bord de l’eau dans les endroits ensoleillés. Il s’endort sur un tas d’algues dans la journée et ne se lève qu’à la nuit tombée.'),
    (272, 1, 'If it hears festive music,  it begins moving in rhythm in order to amplify its power.'),
    (272, 2, 'Il bouge son corps sur un rythme entraînant pour décupler ses forces.'),
    (273, 1, 'It attaches itself to a tree branch using the top of its head. Strong winds can sometimes make it fall.'),
    (273, 2, 'Il se suspend aux branches par l’extrémité de sa tête. Il arrive qu’une bourrasque le fasse tomber.'),
    (274, 1, 'They live in holes bored in large trees. The sound of Nuzleaf’s grass flute fills listeners with dread.'),
    (274, 2, 'Il vit dans les trous des grands arbres. Le sifflement qu’il produit avec sa feuille suffit à remplir ses adversaires d’effroi.'),
    (275, 1, 'It lives quietly in the deep forest. It is said to create chilly winter winds with the fans it holds.'),
    (275, 2, 'Il vit caché au fond des forêts. On raconte qu’il fait souffler la bise lorsqu’il agite ses grands éventails.'),
    (276, 1, 'Taillow is young—it has only just left its nest. As a result,  it sometimes becomes lonesome and cries at night. This Pokémon feeds on Wurmple that live in forests.'),
    (276, 2, 'Nirondelle est jeune. Il vient de quitter son nid. Du coup,  il se sent parfois un peu seul et pleure la nuit. Ce Pokémon se nourrit des Chenipotte qu’il trouve dans les forêts.'),
    (277, 1, 'Swellow is very conscientious about the upkeep of its glossy wings. Once two Swellow are gathered,  they diligently take care of cleaning each other’s wings.'),
    (277, 2, 'Hélédelle fait attention à bien entretenir ses ailes brillantes. Lorsque deux Hélédelle se rencontrent,  ils se nettoient mutuellement les ailes avec attention.'),
    (278, 1, 'It soars on updrafts without flapping its wings. It makes a nest on sheer cliffs at the sea’s edge.'),
    (278, 2, 'Il niche dans les falaises. En utilisant les courants d’air,  il peut voler sans battre des ailes.'),
    (279, 1, 'Skimming the water’s surface,  it dips its large bill in the sea,  scoops up food and water,  and carries it.'),
    (279, 2, 'Avec son grand bec,  il transporte de la nourriture qu’il a récoltée en volant la bouche ouverte au ras de la mer,  gobant de l’eau au passage.'),
    (280, 1, 'Tends to prefer people with a chipper disposition to those who are gloomy,  but it has shown no discrimination with regard to age or gender. Needs more research.'),
    (280, 2, 'Quand ses cornes rouges captent les ondes positives d’un Pokémon ou d’un humain,  tout son corps se réchauffe.'),
    (281, 1, 'It resembles a maiden in appearance,  but it wields strange powers to project visions of paradise. I suspect the crimson ornaments on its head are the key to its abilities.'),
    (281, 2, 'Il peut distordre l’espace-temps grâce à ses pouvoirs psychiques et ainsi voir l’avenir.'),
    (282, 1, 'It will dedicate itself to defending a master it has come to adore. Its pure white dress,  reminiscent of those worn by ladies of nobility,  is the dress of one who is willing to risk their life.'),
    (282, 2, 'Prêt à tout pour protéger son Dresseur,  il peut aller jusqu’à épuiser sa force mentale pour créer un mini trou noir.'),
    (283, 1, 'It lives in ponds and marshes that feature lots of plant life. It often fights with Dewpider,  whose habitat and diet are similar.'),
    (283, 2, 'Il vit dans les lacs ou les marais où prospèrent les plantes hydrophiles. Il se dispute souvent proies et territoire avec son voisin,  Araqua.'),
    (284, 1, 'Its thin,  winglike antennae are highly absorbent. It waits out rainy days in tree hollows.'),
    (284, 2, 'Ses antennes en forme d’ailes absorbent facilement l’humidité. Par temps de pluie,  il attend patiemment au creux d’un arbre.'),
    (285, 1, 'If Shroomish senses danger,  it shakes its body and scatters spores from the top of its head. This Pokémon’s spores are so toxic,  they make trees and weeds wilt.'),
    (285, 2, 'Lorsque Balignon sent un danger,  il secoue son corps et répand ses spores du haut de sa tête. Les spores de ce Pokémon sont si toxiques qu’elles font dépérir les arbres et les herbes.'),
    (286, 1, 'The seeds ringing Breloom’s tail are made of hardened toxic spores. It is horrible to eat the seeds. Just taking a bite of this Pokémon’s seed will cause your stomach to rumble.'),
    (286, 2, 'Les graines autour de la queue de Chapignon sont des spores toxiques. Elles sont totalement immangeables. Une simple bouchée d’une graine de ce Pokémon peut causer de grandes douleurs à l’estomac.'),
    (287, 1, 'Slakoth’s heart beats just once a minute. Whatever happens,  it is content to loaf around motionless. It is rare to see this Pokémon in motion.'),
    (287, 2, 'Le cœur de Parecool ne bat qu’une fois par minute. Quoi qu’il arrive,  il se contente de s’avachir,  immobile. Il est très rare de voir ce Pokémon se déplacer.'),
    (288, 1, 'Vigoroth is simply incapable of remaining still. Even when it tries to sleep,  the blood in its veins grows agitated,  compelling this Pokémon to run wild throughout the jungle before it can settle down.'),
    (288, 2, 'Vigoroth ne tient pas en place. Même quand il essaie de dormir,  le sang dans ses veines s’agite,  obligeant ce Pokémon à courir comme un fou dans la forêt pour s’épuiser afin de pouvoir se reposer.'),
    (289, 1, 'Wherever Slaking live,  rings of over a yard in diameter appear in grassy fields. They are made by the Pokémon as it eats all the grass within reach while lying prone on the ground.'),
    (289, 2, 'On trouve parfois des cercles de plus de 1 m de rayon totalement désherbés dans les plaines. Ils sont faits par les Monaflèmit qui passent leurs journées allongés à manger toute l’herbe à portée de main.'),
    (290, 1, 'It can sometimes live underground for more than 10 years. It absorbs nutrients from the roots of trees.'),
    (290, 2, 'Il peut passer plus de dix ans sous terre. Les racines des arbres constituent son régime alimentaire.'),
    (291, 1, 'This Pokémon is so quick,  it is said to be able to avoid any attack. It loves to feed on tree sap.'),
    (291, 2, 'Ce Pokémon est tellement rapide qu’on le dit capable d’éviter toutes les attaques. Il adore se nourrir de la sève sucrée des arbres.'),
    (292, 1, 'A strange Pokémon—it flies without moving its wings,  has a hollow shell for a body,  and does not breathe.'),
    (292, 2, 'Cet étrange Pokémon,  dont le corps est comme une coquille vide,  ne respire pas et peut voler sans battre des ailes.'),
    (293, 1, 'When Whismur cries,  the sound of its own voice startles it,  making the Pokémon cry even louder. It cries until it’s exhausted,  then it falls asleep.'),
    (293, 2, 'Quand il se met à crier,  il se surprend lui-même et hurle de plus belle. Il continue ainsi jusqu’à ce qu’il se fatigue et tombe de sommeil.'),
    (294, 1, 'The force of this Pokémon’s loud voice isn’t just the sound—it’s also the wave of air pressure that blows opponents away and damages them.'),
    (294, 2, 'Ses hurlements n’affectent pas seulement l’ouïe ; ils provoquent aussi une onde de choc qui balaie les ennemis et leur inflige des dégâts.'),
    (295, 1, 'This Pokémon can do more than just shout. To communicate with others of its kind,  it’ll emit all sorts of sounds from the holes in its body.'),
    (295, 2, 'Pour communiquer avec ses semblables,  il n’utilise pas que son cri puissant ; il émet aussi des sons par les trous de son corps.'),
    (296, 1, 'There’s a rumor of a traditional recipe for stew that Trainers can use to raise strong Makuhita.'),
    (296, 2, 'Il existerait un plat mijoté traditionnel que les Dresseurs cuisinent pour rendre leur Makuhita encore plus fort.'),
    (297, 1, 'Hariyama that are big and fat aren’t necessarily strong. There are some small ones that move nimbly and use moves skillfully.'),
    (297, 2, 'Les Hariyama les plus forts ne sont pas forcément les plus grands. Les petits gabarits aussi ont plus d’un tour dans leur sac.'),
    (298, 1, 'Although Azurill are normally docile,  an angry one will swing around the big ball on its tail and try to smash its opponents.'),
    (298, 2, 'C’est un Pokémon docile,  mais si on l’énerve,  il n’hésite pas à frapper en faisant tournoyer la grosse boule au bout de sa queue.'),
    (299, 1, 'Once the people of Hisui discovered that its red nose always points north,  they grew to rely on it greatly when traveling afar. The nose seems to work in a similar way to ancient compasses.'),
    (299, 2, 'Grâce à sa force magnétique,  il peut chasser ses proies sans se déplacer,  mais il attire parfois ses pires ennemis.'),
    (300, 1, 'Skitty is known to chase around playfully after its own tail. In the wild,  this Pokémon lives in holes in the trees of forests. It is very popular as a pet because of its adorable looks.'),
    (300, 2, 'On sait que Skitty court souvent après sa queue. À l’état sauvage,  ce Pokémon vit dans les cavités des arbres de la forêt. Il est tellement adorable qu’il a un grand succès comme animal de compagnie.'),
    (301, 1, 'Delcatty sleeps anywhere it wants without keeping a permanent nest. If other Pokémon approach it as it sleeps,  this Pokémon will never fight—it will just move away somewhere else.'),
    (301, 2, 'Delcatty peut dormir n’importe où. Il n’a pas de nid permanent. Lorsque d’autres Pokémon lui cherchent des noises pendant son sommeil,  il ne répond pas et se contente de partir dormir ailleurs.'),
    (302, 1, 'It feeds on gemstone crystals. In darkness,  its eyes sparkle with the glitter of jewels.'),
    (302, 2, 'Ce Pokémon se nourrit de pierres précieuses. Dans les ténèbres,  ses yeux brillent du reflet des joyaux.'),
    (303, 1, 'It chomps with its gaping mouth. Its huge jaws are actually steel horns that have been transformed.'),
    (303, 2, 'Ses cornes d’acier forment une grande mâchoire avec laquelle il mord férocement ses adversaires.'),
    (304, 1, 'When Aron evolves,  its steel armor peels off. In ancient times,  people would collect Aron’s shed armor and make good use of it in their daily lives.'),
    (304, 2, 'Quand il évolue,  il perd son armure d’acier. Autrefois,  les gens la ramassaient pour en faire usage dans leur vie quotidienne.'),
    (305, 1, 'During territorial disputes,  Lairon fight by slamming into each other. Close inspection of their steel armor reveals scratches and dents.'),
    (305, 2, 'Les Galegon se disputent les territoires en luttant au corps à corps,  comme le montrent les éraflures sur leur armure d’acier.'),
    (306, 1, 'Long ago,  there was a king who wore a helmet meant to resemble the head of an Aggron. He was trying to channel the Pokémon’s strength.'),
    (306, 2, 'Il y a fort longtemps,  un roi portait un casque à l’effigie de Galeking,  pensant qu’il pourrait ainsi s’approprier sa force.'),
    (307, 1, 'Meditite heightens its inner energy through meditation. It survives on just one berry a day. Minimal eating is another aspect of this Pokémon’s training.'),
    (307, 2, 'Méditikka intensifie son énergie intérieure grâce à la méditation. Il lui suffit d’une Baie par jour pour survivre. La diète fait partie de l’entraînement de ce Pokémon.'),
    (308, 1, 'Through the power of meditation,  Medicham developed its sixth sense. It gained the ability to use psychokinetic powers. This Pokémon is known to meditate for a whole month without eating.'),
    (308, 2, 'Grâce au pouvoir de la méditation,  Charmina a développé son sixième sens. Il peut utiliser des pouvoirs télékinétiques. On sait que ce Pokémon peut méditer pendant un mois sans manger.'),
    (309, 1, 'It stores electricity in its fur. It gives off sparks from all over its body in seasons when the air is dry.'),
    (309, 2, 'L’électricité statique s’accumule dans sa fourrure. Par temps sec,  elle dégage des étincelles.'),
    (310, 1, 'It rarely appears before people. It is said to nest where lightning has fallen.'),
    (310, 2, 'Ce Pokémon évite de se montrer aux humains. On raconte qu’il fait son nid aux endroits où la foudre s’est abattue.'),
    (311, 1, 'When Plusle is cheering on its partner,  it flashes with electric sparks from all over its body. If its partner loses,  this Pokémon cries loudly.'),
    (311, 2, 'Quand Posipi veut encourager son partenaire,  des étincelles jaillissent un peu partout de son corps. Si son partenaire perd,  ce Pokémon pleure à chaudes larmes.'),
    (312, 1, 'Minun loves to cheer on its partner in battle. It gives off sparks from its body while it is doing so. If its partner is in trouble,  this Pokémon gives off increasing amounts of sparks.'),
    (312, 2, 'Négapi adore encourager son partenaire pendant les combats. Des étincelles jaillissent alors de son corps. Lorsque son partenaire est en difficulté,  le corps de ce Pokémon libère encore plus d’étincelles.'),
    (313, 1, 'Volbeat’s tail glows like a lightbulb. With other Volbeat,  it uses its tail to draw geometric shapes in the night sky. This Pokémon loves the sweet aroma given off by Illumise.'),
    (313, 2, 'La queue de Muciole éclaire comme une ampoule. Ensemble,  les Muciole dessinent des figures géométriques dans la nuit étoilée. Ce Pokémon adore le parfum dégagé par Lumivole.'),
    (314, 1, 'Illumise leads a flight of illuminated Volbeat to draw signs in the night sky. This Pokémon is said to earn greater respect from its peers by composing more complex designs in the sky.'),
    (314, 2, 'Lumivole dirige un vol de Muciole lumineux pour dessiner des figures dans la nuit étoilée. On raconte que ce Pokémon gagne le respect de ses pairs en composant des figures complexes dans le ciel.'),
    (315, 1, 'Though beautiful,  it has highly poisonous thorns. There is an old tradition in my homeland wherein one would send these thorns to an opponent to challenge them to a duel.'),
    (315, 2, 'Ses mains sécrètent chacune un poison différent dont il se sert pour attaquer. Plus le parfum de Rosélia est intense,  plus sa santé est bonne.'),
    (316, 1, 'Most of Gulpin’s body is made up of its stomach—its heart and brain are very small in comparison. This Pokémon’s stomach contains special enzymes that dissolve anything.'),
    (316, 2, 'Le corps de Gloupti n’est pratiquement qu’un gros estomac. En comparaison,  son cœur et son cerveau sont tout petits. L’estomac de ce Pokémon contient des enzymes spéciales capables de tout dissoudre.'),
    (317, 1, 'Swalot has no teeth,  so what it eats,  it swallows whole,  no matter what. Its cavernous mouth yawns widely. An automobile tire could easily fit inside this Pokémon’s mouth.'),
    (317, 2, 'Avaltout n’a pas de dents,  ce qui le force à tout avaler en une bouchée. Quand il bâille,  sa bouche prend une taille impressionnante,  et on pourrait y placer une roue de voiture.'),
    (318, 1, 'These Pokémon have sharp fangs and powerful jaws. Sailors avoid Carvanha dens at all costs.'),
    (318, 2, 'Il possède une mâchoire puissante garnie de dents acérées. Les marins ne s’approchent jamais des eaux habitées par les Carvanha.'),
    (319, 1, 'This Pokémon is known as the Bully of the Sea. Any ship entering the waters Sharpedo calls home will be attacked—no exceptions.'),
    (319, 2, 'Surnommé le « tyran des mers »,  ce Pokémon attaque sans exception tous les navires qui osent s’aventurer sur son territoire.'),
    (320, 1, 'When it sucks in a large volume of seawater,  it becomes like a big,  bouncy ball. It eats a ton of food daily.'),
    (320, 2, 'Il ressemble à un énorme ballon quand il avale de très grandes quantités d’eau de mer. Il dévore une tonne de nourriture par jour.'),
    (321, 1, 'Its immense size is the reason for its popularity. Wailord watching is a favorite sightseeing activity in various parts of the world.'),
    (321, 2, 'Sa taille fait de lui un Pokémon fascinant. Les sites touristiques proposant d’observer les Wailord ont toujours beaucoup de succès.'),
    (322, 1, 'Numel stores magma of almost 2, 200 degrees Fahrenheit within its body. If it gets wet,  the magma cools and hardens. In that event,  the Pokémon’s body grows heavy and its movements become sluggish.'),
    (322, 2, 'Chamallot stocke du magma à 1 200 °C dans son corps. Lorsqu’il est mouillé,  le magma se refroidit et durcit. Le corps du Pokémon devient alors très lourd et ses mouvements très lents.'),
    (323, 1, 'The humps on Camerupt’s back are formed by a transformation of its bones. They sometimes blast out molten magma. This Pokémon apparently erupts often when it is enraged.'),
    (323, 2, 'Les bosses sur le dos de Camérupt sont apparues après une déformation de ses os. Elles crachent parfois du magma en fusion. Ce Pokémon entre apparemment en éruption lorsqu’il est énervé.'),
    (324, 1, 'You find abandoned coal mines full of them. They dig tirelessly in search of coal.'),
    (324, 2, 'Les Chartor vivent en grand nombre dans les mines abandonnées,  où ils extraient le charbon avec ardeur.'),
    (325, 1, 'Spoink keeps a pearl on top of its head. The pearl functions to amplify this Pokémon’s psychokinetic powers. It is therefore on a constant search for a bigger pearl.'),
    (325, 2, 'Spoink garde une perle sur sa tête. Elle lui sert à amplifier ses pouvoirs télékinétiques. Il est constamment en quête d’une perle plus grosse.'),
    (326, 1, 'Grumpig uses the black pearls on its body to wield its fantastic powers. When it is doing so,  it dances bizarrely. This Pokémon’s black pearls are valuable as works of art.'),
    (326, 2, 'Groret utilise les perles noires sur son corps pour exercer ses formidables pouvoirs. Quand il est en action,  il entame une étrange danse. Les perles noires de ce Pokémon ont une valeur inestimable.'),
    (327, 1, 'Each Spinda’s spot pattern is different. With its stumbling movements,  it evades opponents’ attacks brilliantly!'),
    (327, 2, 'Chaque Spinda possède un pelage unique. Ce Pokémon esquive les attaques de son adversaire grâce à d’imprévisibles oscillations.'),
    (328, 1, 'It makes an inescapable conical pit and lies in wait at the bottom for prey to come tumbling down.'),
    (328, 2, 'Il creuse,  puis attend ses proies dans son antre en forme de cône,  dont il est impossible de s’échapper.'),
    (329, 1, 'To help make its wings grow,  it dissolves quantities of prey in its digestive juices and guzzles them down every day.'),
    (329, 2, 'Pour aider ses ailes à pousser,  il se nourrit chaque jour d’un grand nombre de proies qu’il dissout en projetant de l’acide.'),
    (330, 1, 'It is nicknamed the Desert Spirit because the flapping of its wings sounds like a woman singing.'),
    (330, 2, 'On l’appelle « l’esprit du désert »,  car ses battements d’ailes résonnent comme une mélodie entonnée par une voix douce.'),
    (331, 1, 'The more arid and harsh the environment,  the more pretty and fragrant a flower Cacnea grows. This Pokémon battles by wildly swinging its thorny arms.'),
    (331, 2, 'Si son environnement est aride et difficile,  la fleur de Cacnea devient plus jolie et dégage un parfum délicat. Ce Pokémon se bat en agitant ses bras épineux.'),
    (332, 1, 'If a traveler is going through a desert in the thick of night,  Cacturne will follow in a ragtag group. The Pokémon are biding their time,  waiting for the traveler to tire and become incapable of moving.'),
    (332, 2, 'Lorsqu’un voyageur traverse le désert au milieu de la nuit,  les Cacturne le suivent en groupe. Ces Pokémon attendent le bon moment,  quand le voyageur est fatigué et qu’il n’est plus capable de bouger.'),
    (333, 1, 'Since Swablu looks like a cumulus cloud,  foes can have a hard time finding it. Apparently its wings turned white over many generations.'),
    (333, 2, 'Ses ailes en forme de nuage le dissimulent aux yeux des ennemis. On raconte qu’elles sont devenues blanches après plusieurs générations.'),
    (334, 1, 'This Pokémon has a kind disposition,  but if it’s provoked,  it will threaten opponents with shrill cries before attacking them without mercy.'),
    (334, 2, 'Il est de nature aimable,  mais si on le met en colère,  il intimide son adversaire en poussant un cri strident et l’attaque sans pitié.'),
    (335, 1, 'Zangoose usually stays on all fours,  but when angered,  it gets up on its hind legs and extends its claws. This Pokémon shares a bitter rivalry with Seviper that dates back over generations.'),
    (335, 2, 'Mangriff est généralement à quatre pattes,  mais lorsqu’il est en colère,  il se lève sur ses pattes arrière et montre ses griffes. Ce Pokémon est l’ennemi juré de Séviper depuis plusieurs générations.'),
    (336, 1, 'Seviper’s swordlike tail serves two purposes—it slashes foes and douses them with secreted poison. This Pokémon will not give up its long-running blood feud with Zangoose.'),
    (336, 2, 'La queue tranchante comme un sabre de Séviper a deux fonctions : elle peut frapper l’ennemi et lui injecter un poison qu’il sécrète. Ce Pokémon n’oublie jamais sa vieille rancune envers Mangriff.'),
    (337, 1, 'It was discovered at the site of a meteor strike 40 years ago. Its stare can lull its foes to sleep.'),
    (337, 2, 'Il a été découvert dans le cratère d’une météorite il y a 40 ans. Un simple regard de sa part endort ses ennemis.'),
    (338, 1, 'Solar energy is the source of its power,  so it is strong during the daytime. When it spins,  its body shines.'),
    (338, 2, 'Tirant sa force de l’énergie solaire,  il est particulièrement puissant pendant la journée. Il s’illumine quand il tourne.'),
    (339, 1, 'Makes its home in swamps with murky water. The poor visibility hides this Pokémon from predators,  and the slime on its body makes grasping it difficult.'),
    (339, 2, 'Il sonde les bords boueux des rivières avec ses barbillons. Un film fin et visqueux protège tout son corps.'),
    (340, 1, 'Strikes its caudal fin against the swamp bed to shake the ground and startle its prey. It will then swallow the fleeing prey whole. People mistook this behavior as the cause of earthquakes.'),
    (340, 2, 'Il a besoin d’un marais entier pour vivre. Si un ennemi s’approche,  il s’énerve et déclenche un séisme.'),
    (341, 1, 'It was originally a Pokémon from afar that escaped to the wild. It can adapt to the dirtiest river.'),
    (341, 2, 'Un Pokémon importé,  retourné à l’état sauvage. Il s’adapte même aux rivières les plus polluées.'),
    (342, 1, 'A brutish Pokémon that loves to battle. It will crash itself into any foe that approaches its nest.'),
    (342, 2, 'Il adore se battre et frappe comme une brute tous ceux qui approchent de sa mare.'),
    (343, 1, 'It was discovered in ancient ruins. While moving,  it constantly spins. It stands on one foot even when asleep.'),
    (343, 2, 'Ce Pokémon découvert dans des ruines anciennes tourne sur lui-même pour se déplacer. Il se tient toujours sur un pied,  même quand il dort.'),
    (344, 1, 'It appears to have been born from clay dolls made by ancient people. It uses telekinesis to float and move.'),
    (344, 2, 'Ce Pokémon aurait été créé à partir d’une poupée d’argile confectionnée par une ancienne civilisation. Il se déplace en lévitant.'),
    (345, 1, 'Lileep clings to rocks on the seabed. When prey comes close,  this Pokémon entangles it with petallike tentacles.'),
    (345, 2, 'Accroché aux rochers des profondeurs,  il attend qu’une proie s’approche de lui pour l’attraper avec ses tentacules en forme de pétales.'),
    (346, 1, 'Once Cradily catches prey in its tentacles,  it digests them whole and absorbs their nutrients.'),
    (346, 2, 'Il attrape ses proies à l’aide de ses tentacules,  puis les dissout immédiatement avec ses sucs digestifs pour en absorber les nutriments.'),
    (347, 1, 'Anorith can swim swiftly by pulling its eight wings through the water like oars on a boat. This Pokémon is an ancestor of modern bug Pokémon.'),
    (347, 2, 'Ce Pokémon peut nager très vite en agitant ses huit ailes comme des rames de bateau. Il fait partie des ancêtres des Pokémon Insecte.'),
    (348, 1, 'Though it lives on land,  it’s also a good swimmer. It dives into the ocean in search of prey,  using its sharp claws to take down its quarry.'),
    (348, 2, 'Bien que vivant sur la terre ferme,  il est très bon nageur. Il plonge dans la mer à la recherche de proies et les abat avec ses pinces acérées.'),
    (349, 1, 'It is a shabby and ugly Pokémon. However,  it is very hardy and can survive on little water.'),
    (349, 2, 'Ce Pokémon a peut-être un physique disgracieux,  mais il est robuste et peut survivre dans très peu d’eau.'),
    (350, 1, 'It’s said that a glimpse of a Milotic and its beauty will calm any hostile emotions you’re feeling.'),
    (350, 2, 'On dit que la beauté de ce Pokémon est telle qu’elle apaise l’esprit de ceux qui le voient.'),
    (351, 1, 'Its form changes depending on the weather. The rougher conditions get,  the rougher Castform’s disposition!'),
    (351, 2, 'Il n’y a pas que son apparence qui change en fonction de la météo : son tempérament aussi ! Plus il y a de vent,  plus il se montre agressif.'),
    (352, 1, 'Its color changes for concealment and also when its mood or health changes. The darker the color,  the healthier it is.'),
    (352, 2, 'Sa couleur change quand il se cache,  mais varie aussi selon son humeur et son état de santé : plus il est en forme,  plus sa couleur est vive.'),
    (353, 1, 'There’s a proverb that says,  “Shun the house where Shuppet gather in the growing dusk.”'),
    (353, 2, 'Il existe un proverbe ancien qui dit : « Fuis la demeure où les Polichombr se rassemblent en nombre à la pénombre. »'),
    (354, 1, 'Resentment at being cast off made it spring into being. Some say that treating it well will satisfy it,  and it will once more become a stuffed toy.'),
    (354, 2, 'Il est né de la rancune qu’il a ressentie quand il a été abandonné. Il redevient apparemment une poupée si l’on en prend grand soin.'),
    (355, 1, 'I\'ve heard that the children of Hisui all begin to behave once they\'ve been told the story of how this Pokémon roams about before the witching hour to spirit away misbehaving children.'),
    (355, 2, 'Ce Pokémon devient invisible pour se rapprocher furtivement de ses proies. Il a le pouvoir de traverser les murs.'),
    (356, 1, 'There are rumors that peeking inside its bandage-wrapped body will cause one to get pulled in through the gaps between the bandages,  never to return. I\'ve been too scared to verify.'),
    (356, 2, 'Il cherche des feux follets pour les avaler. Ce qu’il se passe alors à l’intérieur de son corps vide est un mystère.'),
    (357, 1, 'Bunches of delicious fruit grow around its neck. In warm areas,  many ranches raise Tropius.'),
    (357, 2, 'Dans les régions où il fait chaud,  on trouve des fermes dédiées à l’élevage de ce Pokémon,  très apprécié pour les fruits poussant sur son cou.'),
    (358, 1, 'Can emit waves of air powerful enough to knock out prey taller than itself. I hypothesize that it amplifies the faint sound of wind within its body.'),
    (358, 2, 'Lorsqu’il y a beaucoup de vent,  Éoko pousse des cris,  accroché à une branche ou à un auvent par une ventouse placée sur sa tête. Ce Pokémon attrape des Baies avec sa longue queue pour les manger.'),
    (359, 1, 'Because of this Pokémon’s ability to detect danger,  people mistook Absol as a bringer of doom.'),
    (359, 2, 'Sa capacité à pressentir le danger lui a autrefois valu la réputation de porter malheur.'),
    (360, 1, 'It tends to move in a pack with others. They cluster in a tight group to sleep in a cave.'),
    (360, 2, 'Ces Pokémon adorent se déplacer en groupe. Ils se blottissent les uns contre les autres dans des cavernes pour dormir.'),
    (361, 1, 'Arrives alongside the first snow. It\'s thought that homes Snorunt visit will prosper for many generations. By tradition,  one might offer a lump of ice made from pure water at one\'s front door.'),
    (361, 2, 'Il ne peut vivre que dans les plus froides contrées. Il s’accommode parfaitement de températures atteignant les - 100 °C.'),
    (362, 1, 'It covers its body with an armor of ice harder than steel. Uses its breath to freeze prey,  which it then devours as if they were frozen desserts.'),
    (362, 2, 'Il a le pouvoir de geler l’humidité ambiante en un instant et peut ainsi immobiliser ses proies.'),
    (363, 1, 'During the season when drift ice approaches the shore,  Spheal prefers living on the ice—where fewer predators lurk—rather than the land. Its fur retains heat superbly and resists harsh cold.'),
    (363, 2, 'Il scrute la mer en se laissant porter par les vagues. Lorsqu’il repère des proies,  il avertit les Kaimorse du groupe.'),
    (364, 1, 'Its white whiskers are very sensitive. Sealeo will balance Spheal on the tip of its nose,  checking its scent and its feel to be sure the Spheal is healthy.'),
    (364, 2, 'Il ne peut pas s’empêcher de faire tourner sur son museau tout ce qui a une forme sphérique,  comme les Obalie ou les Poké Balls.'),
    (365, 1, 'Its thick tusks are strong enough to shatter drift ice. They have been known to break,  but they will grow back by the next year. The Hisui region is well known for these broken tusks.'),
    (365, 2, 'Ses défenses poussent tout au long de sa vie. Si l’une d’elles se brise au cours d’un combat,  au bout d’un an,  elle aura repoussé entièrement.'),
    (366, 1, 'Clamperl’s pearls are exceedingly precious. They can be more than 10 times as costly as Shellder’s pearls.'),
    (366, 2, 'La perle de Coquiperl est tellement précieuse qu’elle peut valoir plus de dix fois la valeur de celle de Kokiyas.'),
    (367, 1, 'Deep seas are their habitat. According to tradition,  when Huntail wash up onshore,  something unfortunate will happen.'),
    (367, 2, 'Il habite dans les profondeurs de l’océan. Un Serpang trouvé sur la plage serait un mauvais présage.'),
    (368, 1, 'It sucks bodily fluids out of its prey. The leftover meat sinks to the seafloor,  where it becomes food for other Pokémon.'),
    (368, 2, 'Il se nourrit en aspirant les fluides corporels de ses proies. Le reste tombe au fond de la mer,  nourrissant ainsi d’autres Pokémon.'),
    (369, 1, 'This Pokémon was discovered during deep-sea exploration. Its appearance hasn’t changed in 100, 000, 000 years,  so it’s called a living fossil.'),
    (369, 2, 'Découvert lors d’une expédition dans les abysses,  son apparence inchangée depuis 100 millions d’années lui a valu le surnom de « fossile vivant ».'),
    (370, 1, 'Luvdisc makes its home in coral reefs in warm seas. It especially likes sleeping in the space between Corsola’s branches.'),
    (370, 2, 'Il vit dans les récifs coralliens des mers chaudes,  et aime particulièrement dormir entre les cornes des Corayon.'),
    (371, 1, 'Bagon is a solitary Pokémon that doesn’t form groups with others of its kind. It also has a head hard enough to cleave a boulder in one strike.'),
    (371, 2, 'La tête de ce Pokémon solitaire est si solide qu’il est capable de fendre en deux un rocher d’un seul coup.'),
    (372, 1, 'Shelgon ignores its hunger entirely,  never eating any food. Apparently,  Shelgon will evolve once all its energy stores are used up.'),
    (372, 2, 'Il se prive de nourriture,  résistant à la faim. On dit que son évolution commence lorsque ses réserves d’énergie sont épuisées.'),
    (373, 1, 'While basking in the joy of flight generally keeps this Pokémon in high spirits,  Salamence turns into an uncontrollable menace if something angers it.'),
    (373, 2, 'Heureux de pouvoir voler dans le ciel,  il est souvent de bonne humeur,  mais il devient incontrôlable lorsqu’on le met en colère.'),
    (374, 1, 'The cells in this Pokémon’s body are composed of magnetic material. Instead of blood,  magnetic forces flow through Beldum’s body.'),
    (374, 2, 'Les cellules de son corps sont composées d’aimants. Une force magnétique coule dans ses veines à la place du sang.'),
    (375, 1, 'Using magnetic forces to stay aloft,  this Pokémon flies at high speeds,  weaving through harsh mountain terrain in pursuit of prey.'),
    (375, 2, 'Ce Pokémon vole par magnétisme. Il poursuit ses proies en slalomant à toute allure entre les pics escarpés.'),
    (376, 1, 'Metagross is the result of the fusion of two Metang. This Pokémon defeats its opponents through use of its supercomputer-level brain.'),
    (376, 2, 'Né de la fusion de deux Métang,  il vient à bout de ses ennemis grâce à son cerveau qui est aussi performant qu’un superordinateur.'),
    (377, 1, 'Cutting-edge technology was used to study the internals of this Pokémon’s rock body,  but nothing was found—not even a brain or a heart.'),
    (377, 2, 'Bien que son corps de pierre ait été examiné avec les technologies les plus modernes,  nulle trace de cerveau ou de cœur n’a été trouvée.'),
    (378, 1, 'This Pokémon’s body is made of solid ice. It’s said that Regice was born beneath thick ice in the ice age.'),
    (378, 2, 'Ce Pokémon de l’ère glaciaire dont le corps est entièrement composé d’eau gelée serait né sous une épaisse couche de glace.'),
    (379, 1, 'It’s rumored that this Pokémon was born deep underground in the planet’s mantle and that it emerged onto the surface 10, 000 years ago.'),
    (379, 2, 'Il paraît qu’il est né dans le manteau terrestre et qu’il en a émergé il y a environ 10 000 ans.'),
    (380, 1, 'Latias is highly intelligent and capable of understanding human speech. It is covered with a glass-like down. The Pokémon enfolds its body with its down and refracts light to alter its appearance.'),
    (380, 2, 'Latias est très intelligent et comprend le langage des hommes. Il est recouvert d’une espèce de duvet ressemblant à du verre. Ce Pokémon s’enveloppe dans ce duvet et reflète la lumière pour changer son apparence.'),
    (381, 1, 'Latios will only open its heart to a Trainer with a compassionate spirit. This Pokémon can fly faster than a jet plane by folding its forelegs to minimize air resistance.'),
    (381, 2, 'Latios n’ouvrira son cœur qu’à un Dresseur doté d’un esprit compatissant. Ce Pokémon peut voler plus vite qu’un avion à réaction en repliant ses pattes avant pour améliorer son aérodynamisme.'),
    (382, 1, 'Kyogre is said to be the personification of the sea itself. Legends tell of its many clashes against Groudon,  as each sought to gain the power of nature.'),
    (382, 2, 'Un Pokémon considéré comme l’avatar des océans. Selon les légendes,  il a disputé de nombreux combats avec Groudon pour contrôler l’énergie de la nature.'),
    (383, 1, 'Through Primal Reversion and with nature’s full power,  it will take back its true form. It can cause magma to erupt and expand the landmass of the world.'),
    (383, 2, 'Grâce à l’énergie de la nature,  il peut accomplir sa Primo-Résurgence pour retrouver son apparence originelle. Ce pouvoir lui permet de créer du magma pour étendre les continents.'),
    (384, 1, 'It flies forever through the ozone layer,  consuming meteoroids for sustenance. The many meteoroids in its body provide the energy it needs to Mega Evolve.'),
    (384, 2, 'Un Pokémon qui vit dans la couche d’ozone et se nourrit des météorites qu’il intercepte. Leur énergie s’accumule dans son corps,  ce qui lui permet de méga-évoluer.'),
    (385, 1, 'It’s believed that when this Pokémon wakes from its 1, 000-year slumber,  it will grant any wishes written on the notes attached to its head.'),
    (385, 2, 'On raconte que lorsqu’il se réveille de son sommeil millénaire,  il exauce les vœux écrits sur les rubans de papier de sa tête.'),
    (386, 1, 'Deoxys emerged from a virus that came from space. It is highly intelligent and wields psychokinetic powers. This Pokémon shoots lasers from the crystalline organ on its chest.'),
    (386, 2, 'Deoxys était à l’origine un virus provenant de l’espace. Il est extrêmement intelligent et dispose de pouvoirs télékinétiques. Ce Pokémon envoie des lasers avec l’organe cristallin situé sur sa poitrine.'),
    (387, 1, 'This Pokémon becomes more energetic the more sunlight there is. The part resembling a shell is similar to silt and is slightly damp and warm to the touch.'),
    (387, 2, 'Son corps produit de l’oxygène par photosynthèse. La feuille sur sa tête flétrit quand il a soif.'),
    (388, 1, 'Appears where there is clean spring water. The fruit that grows on the shrubs on its shell is sweet,  nutritious,  and truly delicious.'),
    (388, 2, 'Il sait d’instinct où trouver une source d’eau pure. Il y transporte d’autres Pokémon sur son dos.'),
    (389, 1, 'This remarkable,  large-bodied Pokémon would serve beautifully as borrowed scenery for a garden,  and its strength is peerless. Torterra roams the wilderness in search of clean water.'),
    (389, 2, 'Il arrive que de petits Pokémon se rassemblent sur son dos immobile pour y faire leur nid.'),
    (390, 1, 'Full of vigor and always in high spirits. It was once known by the name ”Lantern-Tail” and feared as some kind of apparition.'),
    (390, 2, 'La flamme de son postérieur brûle grâce à un gaz de son estomac. Elle faiblit quand il ne va pas bien.'),
    (391, 1, 'The deeper the blue on its face,  the more powerful it will grow to become. It leaps about every which way and lands powerful blows against its opponents with the flame on its tail.'),
    (391, 2, 'Il attaque en prenant appui sur les murs et les plafonds. Sa queue ardente n’est pas son seul atout.'),
    (392, 1, 'A tall,  hardy Pokémon with a dazzling appearance. It shrouds itself in flame and battles as if engaged in dance—truly a sight to behold.'),
    (392, 2, 'Il fait voltiger ses ennemis grâce à sa vitesse et son style de combat spécial qui utilise ses quatre membres.'),
    (393, 1, 'Prefers cold climes and appears along coasts. It\'s an adorable little thing—as cute as any child—but it\'s also prideful,  unwilling to accept handouts from people.'),
    (393, 2, 'Il est fier et déteste accepter la nourriture qu’on lui offre. Son pelage épais le protège du froid.'),
    (394, 1, 'It swims gracefully through the frigid sea and sings with a voice like the roaring tide. It has powerful,  sturdy wings and dignity to match.'),
    (394, 2, 'C’est un Pokémon solitaire. Un seul coup de ses puissantes ailes peut briser un arbre en deux.'),
    (395, 1, 'Since ancient times,  it has been revered by the people of Hisui,  who call it the Master of the Waves. Its wings are a match for even master-crafted blades.'),
    (395, 2, 'Les trois cornes de son bec sont le symbole de sa force. Celles du chef sont plus grosses que les autres.'),
    (396, 1, 'They live in the fields and mountains,  gathering in large flocks. Their cries are quite obnoxious. Though small,  their wings are strong—a strike from them leaves pain that persists for a week.'),
    (396, 2, 'Ce Pokémon très bruyant parcourt champs et forêts en nuées pour chasser les Pokémon Insecte.'),
    (397, 1, 'They form remarkably large flocks and are constantly fighting amongst themselves. I suspect that those with magnificent plumes on their heads are the strong ones.'),
    (397, 2, 'Il peuple les champs et les forêts. Lorsque deux volées se croisent,  elles luttent pour le territoire.'),
    (398, 1, 'It has left the flock,  having gained strength enough to survive on its own. The astounding force with which Staraptor flies through the air allows it to carry away large,  burly targets.'),
    (398, 2, 'Lorsque Étourvol évolue en Étouraptor,  il quitte son groupe pour vivre seul. Ses ailes sont très développées.'),
    (399, 1, 'Bidoof has an unsophisticated face and is rarely flustered by anything. There have been incidents involving Bidoof sauntering into villages and gnawing on the houses without a single care.'),
    (399, 2, 'Il ronge constamment des troncs et des pierres pour se faire les incisives. Il niche le long de l’eau.'),
    (400, 1, 'Bibarel fur repels water and is also a fantastic material for heat retention. These Pokémon create dams on rivers to live in.'),
    (400, 2, 'Il construit des barrages de boue et d’écorce le long des fleuves. C’est un ouvrier de renom.'),
    (401, 1, 'When the trees take on new hues,  more of these Pokémon appear. The tone they create by striking their antennae together resembles that of the marimba,  an instrument of foreign lands.'),
    (401, 2, 'Quand ses antennes s’entrechoquent,  elles laissent échapper un bruit de xylophone.'),
    (402, 1, 'It uses its cutlass-like arms to produce sound,  the melody of which varies from individual to individual. It is a worthwhile endeavor to seek out one\'s favorite tunes.'),
    (402, 2, 'Il exprime ses émotions par des mélodies. Les scientifiques étudient actuellement leur structure.'),
    (403, 1, 'Shakes its body to generate electricity. Its stature belies its aggression—one must be patient to tame this Pokémon.'),
    (403, 2, 'Sa fourrure s’illumine grâce à l’électricité. Il agite l’extrémité lumineuse de sa queue pour envoyer des signes à ses congénères.'),
    (404, 1, 'Proudly uses its electrified claws as weapons. It seems to be a gracious Pokémon,  evenly sharing the spoils of the hunt with others of its kind.'),
    (404, 2, 'Quand il croise un ennemi,  il se prépare au combat en sortant ses griffes dont les coups ont une puissance qui atteint un million de volts.'),
    (405, 1, 'They form packs,  each having one male as leader. Legends say that when Luxray\'s two eyes shimmer with gold,  the Pokémon can see through anything.'),
    (405, 2, 'Il dort beaucoup pour récupérer la quantité d’énergie électrique énorme qu’il consomme afin de voir à travers la matière.'),
    (406, 1, 'When the sun\'s light strengthens,  the bud atop this Pokémon\'s head opens. This is a sign to the people that the harsh winter is over,  and the season of budding has begun.'),
    (406, 2, 'Il est sensible aux variations de température. Quand son bourgeon commence à s’ouvrir,  l’arrivée du printemps est imminente.'),
    (407, 1, 'Hidden within the bouquet on each hand are thorned whips loaded with virulent poison. Roserade moves gracefully as it corners its prey and mercilessly lashes them with its whips.'),
    (407, 2, 'Sa main gauche administre un poison lent,  et la droite,  un poison foudroyant. Les deux peuvent être fatals.'),
    (408, 1, 'An incredibly rare sight. They duel each other by ramming their heads together,  and the resulting sound echoes throughout the area like the pealing of a bell.'),
    (408, 2, 'Son crâne extrêmement solide est sa principale caractéristique. Il s’en servait pour faire tomber des arbres les Baies dont il se nourrissait.'),
    (409, 1, 'Very little is known about its biology. Can knock down massive trees by smashing its beautiful,  pearl-like crown against them.'),
    (409, 2, 'Pokémon préhistorique célèbre pour ses coups de tête puissants et son petit cerveau,  son extinction serait due à son extrême bêtise.'),
    (410, 1, 'Much remains unknown about this Pokémon,  as few have ever seen it. However,  we know that it is calm and dislikes conflict,  and it enjoys polishing its face against trees and rocks.'),
    (410, 2, 'On retrouve des fossiles de Dinoclier dans les couches sédimentaires préhistoriques,  mais seule sa tête a résisté à l’épreuve du temps.'),
    (411, 1, 'Its face is sturdy—as strong as diamond—and this hardness offers a very stable defense. Much about this species is still unknown,  such as its natural habitat.'),
    (411, 2, 'Un Pokémon éteint depuis environ 100 millions d’années. Sa tête incroyablement solide était plus dure que l’acier.'),
    (412, 1, 'If its cloak is even slightly damaged,  Burmy will immediately repair it with whatever is close at hand. The Pokémon within the cloak is scrawny and vulnerable to the cold.'),
    (412, 2, 'S’il perd sa cape au combat,  il en tisse rapidement une nouvelle avec ce qui lui tombe sous la main.'),
    (413, 1, 'When Burmy evolved,  its cloak became a part of this Pokémon’s body. The cloak is never shed.'),
    (413, 2, 'Quand Cheniti a évolué,  sa cape a fusionné avec son corps. Cheniselle ne s’en sépare jamais.'),
    (414, 1, 'Scatters steel-colored scales as it flaps its wings. Despite being observed feeding primarily on the nectar of flowers,  Mothim is not often seen around flower gardens.'),
    (414, 2, 'Ce Pokémon s’active à la nuit tombée pour voler le miel des Apitrini pendant leur sommeil.'),
    (415, 1, 'They swear fealty to a queen Pokémon and work diligently to gather nectar. Each swarm produces a different flavor of honey.'),
    (415, 2, 'Du lever du soleil à la tombée de la nuit,  il récolte du nectar pour Apireine et sa colonie.'),
    (416, 1, 'Commands its subjects to build its hive. It will dispatch any interlopers who dare sneak into its nest and use them as nourishment for itself.'),
    (416, 2, 'Plus la quantité de phéromones qu’il libère est élevée,  plus le nombre d’Apitrini qu’il peut diriger est grand.'),
    (417, 1, 'A species related to the Pikachu line. Though Pachirisu is a calm Pokémon,  it still presents a danger should one touch its electrified tail or cheeks.'),
    (417, 2, 'Il arrive que deux Pachirisu se frottent les joues pour partager l’électricité qu’ils ont accumulée.'),
    (418, 1, 'It moves freely in the water by spinning its forked tail for propulsion. The resemblance to the screw of a steamboat is coincidental.'),
    (418, 2, 'Il utilise la bouée autour de son cou pour passer sa tête hors de l’eau et observer les alentours.'),
    (419, 1, 'Has a long,  rather splendid flotation sac,  which prevents Floatzel from drowning even in stormy seas. One might glimpse this species around fishing hamlets from time to time.'),
    (419, 2, 'Il a développé une bouée pour poursuivre ses proies aquatiques. Elle fait office de canot gonflable.'),
    (420, 1, 'Once the fruit growing alongside the main body is large and plump,  Cherubi will use the nutrients within to evolve. The fruit then detaches,  becoming nourishment for other creatures.'),
    (420, 2, 'Plus son corps est rouge,  plus la saveur de sa petite boule gorgée de nutriments est sucrée et délicieuse.'),
    (421, 1, 'Motionless,  save for the occasional quiver. A rich array of Pokémon can be found gathered around it,  drawn by the scent exuded from Cherrim\'s folded petals.'),
    (421, 2, 'Lorsqu’il se ferme,  ses pétales sont si durs qu’il ne craint plus les attaques des Pokémon oiseaux.'),
    (422, 1, 'Found in abundance on seashores bordering warm waters. Shellos are unexpectedly friendly and will crawl toward any person they see. Take care not to get coated in mucus!'),
    (422, 2, 'Si on le caresse trop fort,  il sécrète un étrange liquide mauve qui est inoffensif,  mais dont la texture est très gluante.'),
    (423, 1, 'Eats beach sand for nourishment. Should one Gastrodon encounter another of a different color,  a fierce battle will inevitably ensue.'),
    (423, 2, 'Son corps est caoutchouteux,  mais très résistant,  car la puissance des chocs qu’il subit se répand sur toute sa surface.'),
    (424, 1, 'To affirm their kinship,  members of this species will form a ring by linking their newly doubled tails together. On rare occasions,  humans have been accepted into such rings.'),
    (424, 2, 'Il utilise toujours ses deux queues pour faire la moindre tâche. Il s’en sert aussi pour enlacer les gens qu’il affectionne tout particulièrement.'),
    (425, 1, 'Said to lure away young children and carry them off to the afterlife. Some whisper that Drifloon are formed of reincarnated human souls,  but these rumors are as yet unconfirmed.'),
    (425, 2, 'Nés d’une concentration d’âmes,  ces Pokémon peuvent apparaître en grand nombre les jours où le taux d’humidité est élevé.'),
    (426, 1, 'It drifts along at dusk,  perfectly silent. Its transient,  melancholy aspect touches some people deeply—every so often,  one will come upon a song or poem devoted to Drifblim.'),
    (426, 2, 'Il attrape des personnes et des Pokémon pour les transporter vers une destination inconnue.'),
    (427, 1, 'My hypothesis as to why Buneary rolls up its ears is that its hearing is far too keen. I surmise that the Pokémon protects its hearing by limiting the sound that may enter its ears.'),
    (427, 2, 'Plus il s’entraîne,  plus les coups qu’il assène en déroulant vigoureusement ses oreilles gagnent en puissance.'),
    (428, 1, 'Its fur is warm and yet remarkably light. This Pokémon kicks as though it were a master of karate,  driving back its opponents with ease.'),
    (428, 2, 'À la fin de la saison chaude,  il mue et se recouvre d’une fourrure épaisse et légère pour se préparer à affronter le froid hivernal.'),
    (429, 1, 'The incantations Mismagius chants can ward against misfortune,  so a custom exists of inviting it into one\'s home. Incur the Pokémon\'s displeasure,  however,  and disaster will surely ensue.'),
    (429, 2, 'Il susurre des malédictions pour tourmenter ses ennemis et leur infliger de terribles migraines ou des hallucinations terrifiantes.'),
    (430, 1, 'One cry from this Pokémon,  and a murder of Murkrow come flying. At such times,  one would think the curtain of night had fallen,  plunging the world into jet-black darkness.'),
    (430, 2, 'Ses sous-fifres font le sale boulot pour lui. Il n’intervient en combat que pour donner le coup de grâce à son ennemi.'),
    (431, 1, 'Bewitches humans with its helical tail and piercing gaze. Its hidden claws are quite sharp as well,  making this Pokémon an exceedingly tricky opponent if antagonized.'),
    (431, 2, 'Lorsqu’il est heureux,  sa queue décrit des arabesques comme un ruban de gymnastique rythmique.'),
    (432, 1, 'Though impudent and difficult to tame,  Purugly enjoys great popularity due to its fur,  the beauty of which surpasses even velveteen.'),
    (432, 2, 'Il ceinture sa taille de sa queue bifide pour paraître plus imposant.'),
    (433, 1, 'This Pokémon gave me an excruciating headache when it seemingly cried out without making a sound. Perhaps there are some sounds that the human ear is simply incapable of hearing.'),
    (433, 2, 'Quand il sautille,  l’orbe qu’il a dans la bouche s’agite et tinte comme une cloche.'),
    (434, 1, 'The poison that gushes from its aft end is accompanied by an utterly evil-smelling odor with such potency that one whiff can induce memory loss.'),
    (434, 2, 'S’il lève la queue,  c’est qu’il s’apprête à projeter un liquide tellement nauséabond qu’il peut faire perdre connaissance.'),
    (435, 1, 'Sprays a poisonous fluid to take down prey. Sometimes,  unable to stomach the stench of its own fluid,  it leaves the bested prey uneaten.'),
    (435, 2, 'Ce Pokémon,  qui creuse son terrier dans le sol,  peut projeter un liquide à l’odeur infecte avec le bout de sa queue.'),
    (436, 1, 'Floats using a mysterious energy. The pattern engraved upon its back is held as sacred and can sometimes be found in imagery from ancient cemeteries and other such timeworn places.'),
    (436, 2, 'On raconte qu’il se met à briller et à refléter la vérité quand on le polit,  mais il a horreur de cela.'),
    (437, 1, 'Some believe that its bell-like cry opens holes to another world. It has been revered as a deity since ancient times.'),
    (437, 2, 'De nombreux savants pensent que ce Pokémon n’est pas originaire de Galar à cause des motifs qui ornent son corps.'),
    (438, 1, 'Its tears elicit sympathy from those who see them,  but do not be deceived! This expulsion of body water is merely a physiological mechanism for keeping itself in good health.'),
    (438, 2, 'Il vit dans les zones rocheuses arides. Quand ses boules vertes sont sèches,  elles se mettent à briller légèrement.'),
    (439, 1, 'Known to turn up in bustling marketplaces now and again. It mimics people much as a child would,  then watches how they react,  eyes sparkling.'),
    (439, 2, 'Il considère les meilleurs danseurs parmi les M. Glaquette comme ses maîtres et s’évertue à mimer leurs mouvements.'),
    (440, 1, 'In imitation of Chansey,  it keeps a round stone tucked into its belly pouch and cherishes it dearly. It gets along well with children and will sometimes play house with them for fun.'),
    (440, 2, 'Il prête volontiers son caillou rond à ceux qu’il apprécie,  mais éclate en sanglots et se met en colère si on ne le lui rend pas.'),
    (441, 1, 'A versatile performer skilled in the imitation of human speech. It is said that older,  more experienced Chatot can even understand the meaning of the words they mimic.'),
    (441, 2, 'On peut lui enseigner quelques mots. S’il s’agit d’un groupe,  ils retiendront les mêmes phrases.'),
    (442, 1, 'It lays curses by thinking wicked thoughts. Writings tell that this Pokémon was born out of the assembly of five score and eight malevolent spirits.'),
    (442, 2, 'Pour punir son comportement déplorable,  un voyageur a utilisé un mystérieux sortilège pour l’enchaîner à une Clé de Voûte.'),
    (443, 1, 'It nests in caves untouched by sunlight. Its sharp teeth may fall out when worn away or after an impact,  but they regrow within a few days.'),
    (443, 2, 'Il attaque et entraîne dans son antre tout ce qui bouge,  sans distinction. Sa gueule est immense,  mais son estomac est relativement petit.'),
    (444, 1, 'Though Gabite are usually of a violent disposition,  when I gave one a glass bead it had been eyeing covetously,  it suddenly became quite docile.'),
    (444, 2, 'Il cache des pierres précieuses dans le sol de sa grotte,  et accueille à coups de griffes et de crocs quiconque ose y pénétrer.'),
    (445, 1, 'Soars across the heavens at blinding speed—a magnificent sight! It has a feral disposition. Utmost caution is required if one meets a Garchomp out in the wilds.'),
    (445, 2, 'Ce Pokémon très rapide même au sol capture ses proies sur les monts enneigés et rentre vite dans son antre avant que son corps ne gèle.'),
    (446, 1, 'Its robust stomach allows it to nonchalantly devour even rotted matter. It pays frequent visits to villages,  seeking out food scraps intended for compost.'),
    (446, 2, 'Il conserve sa nourriture sous son épaisse fourrure. Il lui arrive d’en offrir un peu à ceux en qui il a confiance.'),
    (447, 1, 'Though infantile in appearance,  it has the mysterious ability to read the minds of humans. The pure of heart are met with Riolu\'s approval,  while those of ill nature earn only its loathing.'),
    (447, 2, 'Il perçoit sous forme d’aura non seulement les sentiments des autres,  mais aussi l’état de la nature.'),
    (448, 1, 'A most gallant-looking creature. It emits energy waves and controls them with precision,  using them to sense even faraway beings. I have given the name ”aura” to this power.'),
    (448, 2, 'Étant capable de lire ce que pensent les humains,  ce Pokémon ne s’attache qu’aux Dresseurs dotés d’un cœur pur.'),
    (449, 1, 'Though large and languid,  Hippopotas is difficult to detect due to its tendency to burrow into and lurk beneath the soil. When agitated or excited,  it expels sand from its nostrils.'),
    (449, 2, 'Il est principalement actif pendant la journée. Il s’enfouit profondément dans le sable pour dormir,  car les nuits désertiques sont très froides.'),
    (450, 1, 'Short-tempered and easily moved to violence. It whips up whirlwinds of sand to crush its foes\' spirits,  then goes in for the attack.'),
    (450, 2, 'Il entre dans une violente colère quand on l’énerve : il expulse le sable qu’il a accumulé pour provoquer de véritables tempêtes.'),
    (451, 1, 'Its claws are not only razor-sharp but poisonous,  making Skorupi a highly dangerous Pokémon. It seems to be weakened by cold temperatures,  however.'),
    (451, 2, 'Il attaque avec les pinces empoisonnées de sa queue. Le venin se répand alors dans le corps de la victime et la paralyse.'),
    (452, 1, 'Has a brutish,  ferocious temperament. With immense strength and a sturdy shell off which swords will bounce,  it rampages about and wreaks havoc.'),
    (452, 2, 'Sa férocité lui a valu le surnom de « démon du désert »,  mais face à un Hippodocus,  il est parfaitement docile et évite de le provoquer.'),
    (453, 1, 'A poison wielder with a dastardly personality. Despite such qualities,  this species is afforded a measure of popularity due to its peculiar cry and comical features.'),
    (453, 2, 'Dilué,  son poison sert de remède. Cela lui a valu de devenir la mascotte populaire d’une entreprise de produits pharmaceutiques.'),
    (454, 1, 'Its crimson claws contain a virulent toxin. This toxin can be made into a tonic by diluting it,  mixing it with several types of wild grass,  and boiling it down over two days.'),
    (454, 2, 'Il lance un coassement viril de victoire quand il parvient à terrasser sa proie. Il s’apparente aux Crapustule.'),
    (455, 1, 'Though this is a plant Pokémon,  it has a gluttonous and unruly temperament. Carnivine attacks its prey with its cavernous maw wide open.'),
    (455, 2, 'Il s’accroche aux arbres des marais et attire ses proies avec sa salive à l’odeur enivrante.'),
    (456, 1, 'What a gorgeous sight this Pokémon is as it swims with its long,  pink-painted caudal fins fluttering behind it. Finneon\'s beautiful appearance has led to its nickname: ”finery fish.”'),
    (456, 2, 'Il attire ses proies avec ses nageoires caudales lumineuses. Il passe la journée à la surface et se retire dans les abysses la nuit venue.'),
    (457, 1, 'Uses its gleaming fins to hunt its prey. The view of Lumineon schooling near the surface of the sea at night is breathtaking— it\'s as though there were shining stars right there.'),
    (457, 2, 'Il se déplace en rampant dans les profondeurs de l’océan. Ses nageoires brillent telles des étoiles dans le ciel nocturne.'),
    (458, 1, 'Though ball-like in shape,  this Pokémon is a proficient swimmer. I have discovered that if a Mantyke spends much time with schools of Remoraid,  it will eventually achieve evolution.'),
    (458, 2, 'Il nage au sein des bancs de Rémoraid. Lorsqu’un prédateur les attaque,  il se bat à leurs côtés.'),
    (459, 1, 'One is likely to encounter this Pokémon while out in the snow. There are stories of Snover appearing in human settlements but doing no harm—rather,  they bond with the children.'),
    (459, 2, 'Les Baies en forme de crèmes glacées qui poussent sur son ventre sont le mets favori des Darumarond vivant à Galar.'),
    (460, 1, 'A powerful Pokémon that can split huge boulders with ease. Dislikes associating with others and chooses to live quietly deep within the mountains,  playing with the snow.'),
    (460, 2, 'Ce grand Pokémon déclenche des blizzards. Lorsqu’il agite son corps,  tout ce qui l’entoure se retrouve couvert de neige.'),
    (461, 1, 'This species corners prey as a pack,  under the guidance of a leader. Weavile displays increased cunning,  leading me to speculate that its evolution caused further brain development.'),
    (461, 2, 'Il communique avec ses semblables en gravant des motifs avec ses griffes. Il existerait près de 500 signes différents.'),
    (462, 1, 'I theorize that a special magnetic field influenced this Pokémon,  changing its molecular structure and causing it to evolve. It emits strange radio waves toward space from its antenna.'),
    (462, 2, 'On pense qu’il a évolué après avoir été exposé à un champ magnétique particulier qui a modifié la structure moléculaire de son corps.'),
    (463, 1, 'Its tongue can extend and contract freely,  and it is capable of reaching lengths over 10 times Lickilicky\'s height. Beware of the saliva,  as it contains corrosive elements.'),
    (463, 2, 'Il est aussi habile avec sa langue que les êtres humains le sont avec leurs mains. En revanche,  il est maladroit quand il utilise ses doigts.'),
    (464, 1, 'This Pokémon evolved through use of a curious item. Its rocklike hide is composed of a mysterious substance and can withstand a blow from a masterwork sword with nary a scratch.'),
    (464, 2, 'Il repousse les attaques avec ses Protecteurs et profite du moment où l’adversaire est déstabilisé pour le transpercer avec sa vrille,  dont il est fier.'),
    (465, 1, 'Draped with long vines,  it resembles a shrub in appearance. It swings bundles of vines as though they were arms,  wrapping them around prey to ensnare them.'),
    (465, 2, 'Ses lianes poussent plus rapidement s’il vit sous un climat chaud. Quand elles deviennent trop longues,  il se les coupe.'),
    (466, 1, 'Its evolution was induced by an unusual item,  and its electrical output rises along with its heart rate. From its tails,  it can unleash an electric current measuring 20, 000 volts.'),
    (466, 2, 'La quantité d’électricité qu’il génère est énorme,  même pour un Pokémon Électrik. Il inflige de fortes décharges du bout de ses queues.'),
    (467, 1, 'Use of a strange item caused this Pokémon to evolve. Fireballs launched from the ends of its tubelike arms are hot enough to melt an iron pot in an instant.'),
    (467, 2, 'Au fil du temps,  son corps est devenu similaire à un volcan,  et un de ses organes ressemble désormais à une chambre magmatique.'),
    (468, 1, 'Scant few have ever sighted this Pokémon. After studying what literature remains,  I am certain Togekiss will reveal itself when peace reigns in the land.'),
    (468, 2, 'On dit que ce Pokémon dispense ses bienfaits,  ce qui explique pourquoi il est représenté sur les porte-bonheurs depuis fort longtemps.'),
    (469, 1, 'Extremely violent. When hunting,  it wastes none of its energy,  aiming only for prey\'s most vulnerable spots. Any who manage to tame this Pokémon must be of incredible bravery.'),
    (469, 2, 'Il peut voler avec aise tout en portant un adulte dans ses six pattes. Les ailes de sa queue lui servent de balancier.'),
    (470, 1, 'Cells similar to those of plants have been found in its fur. Its hard tail can fell a large tree with one stroke,  and the tail\'s sharpness exceeds even that of a sword crafted by a master.'),
    (470, 2, 'Grâce à sa queue aussi effilée qu’une lame,  il est capable de fendre en deux des arbres immenses.'),
    (471, 1, 'Glaceon is able to lower its body temperature very quickly. It freezes the atmosphere,  creating diamond dust that glitters like gems while it flutters and dances around.'),
    (471, 2, 'Ce Pokémon exhale un vent glacial qui crée une neige poudreuse. Sa présence est très appréciée dans les stations de ski.'),
    (472, 1, 'It glides soundlessly on pitch-black wings and sinks sharp fangs into the throat of its prey. It takes on a look of satisfaction once it has entirely drained its prey of blood.'),
    (472, 2, 'Il vole sans un bruit,  et capture ses proies avec sa queue pour leur infliger une morsure critique.'),
    (473, 1, 'This species reached its zenith during the period known as the ice age. I suspect that Hisui\'s frigid climate is in harmony with Mamoswine\'s constitution,  thus awakening hidden potential.'),
    (473, 2, 'Comme son physique le laisse deviner,  il est très fort. La taille de ses défenses de glace augmente à mesure que la température baisse.'),
    (474, 1, 'A curious item induced this evolution. The Pokémon\'s offensive capabilities have greatly increased,  but the strangeness of its behavior has magnified in equal measure. This worries me.'),
    (474, 2, 'On dit qu’un nouveau programme l’a fait évoluer,  mais les avis des scientifiques divergent quant à savoir s’il s’agit réellement d’une évolution.'),
    (475, 1, 'The blades extending from its elbows are sharper than the finest swords. Its swordsmanship,  albeit self-taught,  is astonishingly impressive.'),
    (475, 2, 'Ses sens aiguisés lui indiquent lorsque quelqu’un est en danger. Il accourt alors à la rescousse.'),
    (476, 1, 'It is able to emit powerful magnetism,  allowing it control over the iron sand that forms its luscious mustache. Using this iron sand,  Probopass forms hard stones with which it smites its prey.'),
    (476, 2, 'Il utilise ses trois petites unités pour combattre ses ennemis et capturer ses proies. Le reste de son corps se contente de donner des ordres.'),
    (477, 1, 'Comes to those whose lives have come to an end and escorts their souls to the afterlife. Known to mistakenly take the souls of those who yet have life left in them,  albeit rarely.'),
    (477, 2, 'Il dévore l’âme de ses ennemis en les engloutissant dans sa bouche ventrale. Il recrache ensuite leur enveloppe corporelle.'),
    (478, 1, 'A Pokémon inhabited by the soul of a woman who died bearing a grudge in the snowy mountains. Legends of Froslass placing deathly curses on misbehaving men send shivers down my spine.'),
    (478, 2, 'Il gèle ses proies avec son souffle à - 50 °C,  les amène dans son antre,  puis les y aligne avec soin.'),
    (479, 1, 'This bizarre Pokémon appears to be a will-o\'-the-wisp powered by electricity. Be wary,  as Rotom is both smart and mischievous.'),
    (479, 2, 'Son corps composé de plasma lui permet d’infiltrer diverses machines. Il adore surprendre les gens.'),
    (480, 1, 'A Pokémon feared but also respected for stealing away the memories of evildoers. I have found records that suggest Uxie holds dominion over knowledge.'),
    (480, 2, 'On dit que sa venue a fourni aux humains le bon sens nécessaire pour améliorer leur existence.'),
    (481, 1, 'Known as the Being of Emotion. In legend,  this Pokémon was feared,  as any who showed disrespect would have their emotions thrown into disarray.'),
    (481, 2, 'Il dort au fond d’un lac. On dit que son esprit abandonne son corps pour voler à sa surface.'),
    (482, 1, 'The dreaded Being of Willpower. Legends tell of this Pokémon manipulating the will of its adversaries and turning them into puppets of its own.'),
    (482, 2, 'On raconte que Créhelf,  Créfollet et Créfadet proviennent du même Œuf.'),
    (483, 1, 'This Pokémon is revered as a deity in Hisuian legend. The birth of Dialga was what caused the vast river of time to begin flowing in our world.'),
    (483, 2, 'Il peut contrôler le temps. Les mythes de Sinnoh en parlent comme d’une divinité ancienne.'),
    (484, 1, 'This Pokémon is feared as a deity in Hisuian legend. The birth of Palkia was what caused the walls of our world to disappear,  creating a sky that spans for infinity.'),
    (484, 2, 'Il peut modeler l’espace. Les mythes de Sinnoh en parlent comme d’une divinité ancienne.'),
    (485, 1, 'Stories tell of this Pokémon being birthed from the boiling magma within Mount Coronet. Its molten-steel body holds many mysteries.'),
    (485, 2, 'Le sang de ce Pokémon des cratères bouillonne dans son corps comme du magma.'),
    (486, 1, 'According to legend,  Regigigas pulled landmasses together and bound them with rope to create the continent of Hisui. Though I have my doubts,  the story could well contain a shred of truth.'),
    (486, 2, 'On raconte qu’après avoir créé des Pokémon avec différentes matières,  il aurait placé les continents à leur position actuelle.'),
    (487, 1, 'There is one Hisuian verse that tells of a powerful light creating a deep shadow. I imagine that this deep shadow is Giratina.'),
    (487, 2, 'Sa grande violence lui a valu d’être banni. Il observe les hommes en silence depuis le Monde Distorsion.'),
    (488, 1, 'Cresselia is reminiscent of the crescent moon. It leaves a brilliant line of light in its wake as it flies across the night sky. I daresay it resembles the heavenly maiden who created the Milky Way.'),
    (488, 2, 'Dormir avec une de ses plumes à la main permet de faire de beaux rêves. On le surnomme « avatar du croissant de lune ».'),
    (489, 1, 'Can be seen floating offshore during seasons when the seas are warm. Its azure body blends in with the ocean waters—logic suggests this is a defense mechanism against natural predators.'),
    (489, 2, 'Ce Pokémon des mers chaudes revient toujours à son lieu de naissance,  peu importe la distance.'),
    (490, 1, 'Rumored to migrate across the oceans and visit Hisui\'s coastal waters only rarely. Although Manaphy resembles Phione,  it is also quite different. The relation between the two is unclear.'),
    (490, 2, 'Il possède l’étrange pouvoir de s’entendre avec n’importe quel Pokémon.'),
    (491, 1, 'On a moonless night,  a strange incident occurred in which every one of a village\'s inhabitants suffered nightmares. The villagers attested that Darkrai appeared before them in these nightmares.'),
    (491, 2, 'Il a la capacité de bercer les gens pour les faire rêver. Il se montre durant les nuits de nouvelle lune.'),
    (492, 1, 'When the turning of seasons brings the cruel winter to its end and the joyous people give thanks to the heavens,  Shaymin appears and covers the withered land with flowers.'),
    (492, 2, 'Il prend son essor pour répandre la gratitude lorsque les Gracidées fleurissent.'),
    (493, 1, 'It is the heavenly fount from which pours the light that shines across Hisui. Its luminance guides and protects all Pokémon. Hisuian mythology states that Arceus is the creator of all things.'),
    (493, 2, 'Dans la mythologie,  ce Pokémon existait déjà avant la formation de l’univers.'),
    (494, 1, 'When it shares the infinite energy it creates,  that being’s entire body will be overflowing with power.'),
    (494, 2, 'L’énergie sans limites qu’il produit donne une force incroyable à ceux qui entrent en contact avec elle.'),
    (495, 1, 'They photosynthesize by bathing their tails in sunlight. When they are not feeling well,  their tails droop.'),
    (495, 2, 'Il laisse sa queue prendre le soleil pour sa photosynthèse. Quand il est malade,  sa queue pend tristement.'),
    (496, 1, 'When it gets dirty,  its leaves can’t be used in photosynthesis,  so it always keeps itself clean.'),
    (496, 2, 'La saleté l’empêchant d’utiliser la photosynthèse,  il prend grand soin d’être toujours propre.'),
    (497, 1, 'It can stop its opponents’ movements with just a glare. It takes in solar energy and boosts it internally.'),
    (497, 2, 'Il peut paralyser l’ennemi d’un regard. Il amplifie l’énergie du soleil dans son corps.'),
    (498, 1, 'It loves to eat roasted berries,  but sometimes it gets too excited and burns them to a crisp.'),
    (498, 2, 'Il adore se goinfrer de Baies grillées,  mais il lui arrive de les réduire en cendres dans son excitation.'),
    (499, 1, 'When its internal fire flares up,  its movements grow sharper and faster. When in trouble,  it emits smoke.'),
    (499, 2, 'Quand le feu dans son corps s’embrase,  sa vitesse et son agilité augmentent. En cas d’urgence,  il crache de la fumée.'),
    (500, 1, 'It has mastered fast and powerful fighting moves. It grows a beard of fire.'),
    (500, 2, 'Il a une barbe enflammée. Il maîtrise des techniques de combat au corps à corps rapides et puissantes.'),
    (501, 1, 'This Pokémon from the Unova region uses the shell on its belly as a weapon to cut down its foes. Thus,  I\'ve conferred upon this shell the name ”scalchop”.'),
    (501, 2, 'Il combat avec le coupillage de son ventre. Il peut parer un assaut et immédiatement contre-attaquer.'),
    (502, 1, 'Its exquisite double-scalchop technique is likely the result of daily training,  and it can send even masters of the blade fleeing in defeat.'),
    (502, 2, 'Chaque Mateloutre a sa propre technique d’escrime au coupillage,  acquise grâce à un entraînement drastique.'),
    (503, 1, 'Hard of heart and deft of blade,  this rare form of Samurott is a product of the Pokémon\'s evolution in the region of Hisui. Its turbulent blows crash into foes like ceaseless pounding waves.'),
    (503, 2, 'Il peut terrasser ses ennemis d’un coup de la lame enchâssée dans son armure,  et les faire taire d’un seul regard.'),
    (504, 1, 'Extremely cautious,  one of them will always be on the lookout,  but it won’t notice a foe coming from behind.'),
    (504, 2, 'Très prudent,  il surveille attentivement son territoire,  mais oublie souvent de regarder derrière lui.'),
    (505, 1, 'When they see an enemy,  their tails stand high,  and they spit the seeds of berries stored in their cheek pouches.'),
    (505, 2, 'Il attaque en crachant les graines des Baies qu’il accumule dans ses bajoues. S’il voit un ennemi,  il dresse la queue.'),
    (506, 1, 'This Pokémon is far brighter than the average child,  and Lillipup won’t forget the love it receives or any abuse it suffers.'),
    (506, 2, 'Ce Pokémon est plus intelligent que la plupart des enfants. Il n’oublie ni l’affection qu’il a reçue ni les mauvais traitements qu’il a pu subir.'),
    (507, 1, 'The black fur that covers this Pokémon’s body is dense and springy. Even sharp fangs bounce right off.'),
    (507, 2, 'Les poils sombres qui recouvrent son dos sont si épais et si souples qu’ils peuvent même repousser des crocs acérés.'),
    (508, 1, 'Stoutland is immensely proud of its impressive moustache. It’s said that moustache length is what determines social standing among this species.'),
    (508, 2, 'Sa moustache remarquable fait sa fierté,  car sa longueur permettrait de déterminer la hiérarchie au sein de l’espèce.'),
    (509, 1, 'Opponents that get drawn in by its adorable behavior come away with stinging scratches from its claws and stinging pride from its laughter.'),
    (509, 2, 'Malheur à qui se laisse berner par ses gestes adorables : une fois les gens à sa portée,  il les griffe sans crier gare,  en ricanant.'),
    (510, 1, 'This stealthy Pokémon sneaks up behind prey without making any sound at all. It competes with Thievul for territory.'),
    (510, 2, 'Sans un bruit,  il approche ses victimes par-derrière pour les frapper. Il dispute son territoire avec les Roublenard.'),
    (511, 1, 'It’s good at finding berries and gathers them from all over. It’s kind enough to share them with friends.'),
    (511, 2, 'Il est très doué pour trouver des Baies et aime les partager avec ses amis sans rien demander en échange.'),
    (512, 1, 'Ill tempered,  it fights by swinging its barbed tail around wildly. The leaf growing on its head is very bitter.'),
    (512, 2, 'Il a un tempérament violent et se bat avec sa queue pleine d’épines. La feuille sur sa tête est très amère.'),
    (513, 1, 'This Pokémon lives in caves in volcanoes. The fire within the tuft on its head can reach 600 degrees Fahrenheit.'),
    (513, 2, 'Il vit dans les cratères des volcans. L’intérieur de la mèche qu’il a sur la tête peut atteindre 300 °C.'),
    (514, 1, 'When it gets excited,  embers rise from its head and tail and it gets hot. For some reason,  it loves sweets.'),
    (514, 2, 'Quand il est excité,  des flammèches brûlantes dansent sur sa tête et sa queue. Il raffole des choses sucrées.'),
    (515, 1, 'The water stored inside the tuft on its head is full of nutrients. Plants that receive its water grow large.'),
    (515, 2, 'L’eau contenue dans la mèche sur sa tête est pleine de nutriments. Elle fait pousser les plantes avec vigueur.'),
    (516, 1, 'It prefers places with clean water. When its tuft runs low,  it replenishes it by siphoning up water with its tail.'),
    (516, 2, 'Il aime les endroits où l’eau est pure. Il se ravitaille en eau en l’aspirant avec sa queue.'),
    (517, 1, 'It eats dreams and releases mist. The mist is pink when it’s eating a good dream,  and black when it’s eating a nightmare.'),
    (517, 2, 'Il se nourrit de songes et expire de la fumée qui prend la couleur rose si le rêve est joyeux,  ou noire s’il s’agit d’un cauchemar.'),
    (518, 1, 'It drowses and dreams all the time. It’s best to leave it be if it’s just woken up,  as it’s a terrible grump when freshly roused from sleep.'),
    (518, 2, 'Il est sans cesse assoupi,  plongé dans ses rêves. Il vaut mieux éviter de le déranger,  car il est toujours mal luné au réveil.'),
    (519, 1, 'It’s forgetful and not very bright,  but many Trainers love it anyway for its friendliness and sincerity.'),
    (519, 2, 'Il n’est pas très malin et un peu distrait,  mais beaucoup de Dresseurs l’apprécient pour son caractère affectueux et sa bonne volonté.'),
    (520, 1, 'These bright Pokémon have acute memories. Apparently delivery workers often choose them as their partners.'),
    (520, 2, 'Il est intelligent et possède une bonne mémoire. On raconte que les livreurs le choisissent souvent comme partenaire.'),
    (521, 1, 'This Pokémon is intelligent and intensely proud. People will sit up and take notice if you become the Trainer of one.'),
    (521, 2, 'Ce Pokémon est aussi intelligent qu’il est arrogant. Les Dresseurs de Déflaisan sont tenus en haute estime.'),
    (522, 1, 'Its mane shines when it discharges electricity. They use the frequency and rhythm of these flashes to communicate.'),
    (522, 2, 'Sa crinière luit quand il lâche des décharges. Il module leur rythme et leur nombre pour communiquer avec ses pairs.'),
    (523, 1, 'They have lightning-like movements. When Zebstrika run at full speed,  the sound of thunder reverberates.'),
    (523, 2, 'Il réagit à la vitesse de l’éclair. Lorsqu’il est en plein galop,  on peut entendre le grondement du tonnerre.'),
    (524, 1, 'When it detects a noise,  it starts to move. The energy core inside it makes this Pokémon slightly warm to the touch.'),
    (524, 2, 'Il se déplace en réagissant aux sons environnants. Son noyau d’énergie rend son corps légèrement chaud au toucher.'),
    (525, 1, 'It relies on sound in order to monitor what’s in its vicinity. When angered,  it will attack without ever changing the direction it’s facing.'),
    (525, 2, 'Il sonde les environs grâce au son. Lorsqu’un importun le met en colère,  il se lance à sa poursuite sans changer l’orientation de son corps.'),
    (526, 1, 'Although its energy blasts can blow away a dump truck,  they have a limitation— they can only be fired when the sun is out.'),
    (526, 2, 'Il est capable d’envoyer des boules d’énergie assez puissantes pour balayer un camion-benne,  mais il ne peut tirer que les jours ensoleillés.'),
    (527, 1, 'It emits ultrasonic waves as it flutters about,  searching for its prey—bug Pokémon.'),
    (527, 2, 'Il virevolte gaiement et émet des ultrasons pour trouver des Pokémon Insecte à grignoter.'),
    (528, 1, 'The auspicious shape of this Pokémon’s nose apparently led some regions to consider Swoobat a symbol of good luck.'),
    (528, 2, 'Certaines contrées le vénèrent et pensent que la forme de son nez est un symbole de chance et de bonheur.'),
    (529, 1, 'It’s a digger,  using its claws to burrow through the ground. It causes damage to vegetable crops,  so many farmers have little love for it.'),
    (529, 2, 'Les cultivateurs le détestent,  car il abîme leurs légumes en creusant la terre avec ses griffes.'),
    (530, 1, 'Known as the Drill King,  this Pokémon can tunnel through the terrain at speeds of over 90 mph.'),
    (530, 2, 'On l’appelle le « roi de la vrille ». Il creuse la terre à une vitesse pouvant atteindre 150 km/h.'),
    (531, 1, 'This Pokémon has a kind heart. By touching with its feelers,  Audino can gauge other creatures’ feelings and physical conditions.'),
    (531, 2, 'Ce Pokémon gentil est capable de deviner les émotions et l’état de santé des autres rien qu’en les touchant avec ses antennes.'),
    (532, 1, 'Timburr that have started carrying logs that are about three times their size are nearly ready to evolve.'),
    (532, 2, 'Lorsque Charpenti est capable de soulever une poutre faisant trois fois son poids,  le jour de son évolution est proche.'),
    (533, 1, 'Gurdurr excels at demolition—construction is not its forte. In any case,  there’s skill in the way this Pokémon wields its metal beam.'),
    (533, 2, 'Il manie la poutre métallique avec habileté. Il est doué pour démanteler une bâtisse,  mais peu adroit lorsqu’il s’agit d’en construire une.'),
    (534, 1, 'When going all out,  this Pokémon throws aside its concrete pillars and leaps at opponents to pummel them with its fists.'),
    (534, 2, 'Quand il décide de passer aux choses sérieuses,  il jette ses piliers de béton et saute sur son adversaire pour le frapper du poing.'),
    (535, 1, 'It uses sound waves to communicate with others of its kind. People and other Pokémon species can’t hear its cries of warning.'),
    (535, 2, 'Il communique avec ses compagnons en émettant des ondes. Son cri d’alerte est inaudible pour les humains et les autres Pokémon.'),
    (536, 1, 'On occasion,  their cries are sublimely pleasing to the ear. Palpitoad with larger lumps on their bodies can sing with a wider range of sounds.'),
    (536, 2, 'Il lui arrive de pousser des cris ravissants. Plus ses protubérances sont grosses,  plus le son porte loin.'),
    (537, 1, 'This Pokémon is popular among the elderly,  who say the vibrations of its lumps are great for massages.'),
    (537, 2, 'Ce Pokémon est un excellent masseur grâce aux vibrations de ses pustules. Les personnes âgées l’apprécient particulièrement.'),
    (538, 1, 'They train in groups of five. Any member that can’t keep up will discard its belt and leave the group.'),
    (538, 2, 'Ils s’entraînent intensément par groupes de cinq. Ceux qui ne peuvent pas suivre le rythme abandonnent leur ceinture et se retirent.'),
    (539, 1, 'The karate chops of a Sawk that’s trained itself to the limit can cleave the ocean itself.'),
    (539, 2, 'Après avoir suivi un entraînement intensif,  la puissance du tranchant de sa main est telle qu’il peut fendre la mer en deux.'),
    (540, 1, 'Since this Pokémon makes its own clothes out of leaves,  it is a popular mascot for fashion designers.'),
    (540, 2, 'La mascotte des créateurs de mode. Il découpe ses vêtements dans les feuilles qu’il trouve.'),
    (541, 1, 'It protects itself from the cold by wrapping up in leaves. It stays on the move,  eating leaves in forests.'),
    (541, 2, 'Il se protège du froid en s’emmitouflant dans une feuille. Il se déplace en forêt et mange les feuilles tombées par terre.'),
    (542, 1, 'It keeps its eggs warm with heat from fermenting leaves. It also uses leaves to make warm wrappings for Sewaddle.'),
    (542, 2, 'Il réchauffe les Œufs avec la chaleur de l’humus. Il fabrique des langes pour les Larveyette avec des feuilles.'),
    (543, 1, 'Its fangs are highly venomous. If this Pokémon finds prey it thinks it can eat,  it leaps for them without any thought of how things might turn out.'),
    (543, 2, 'Ses crocs sont extrêmement venimeux. Dès qu’il voit une proie à son goût,  il bondit sur elle sans penser aux conséquences.'),
    (544, 1, 'Whirlipede protects itself with a sturdy shell and poisonous spikes while it stores up the energy it’ll need for evolution.'),
    (544, 2, 'Il se protège avec sa solide carapace et ses épines empoisonnées tandis qu’il rassemble l’énergie nécessaire à son évolution.'),
    (545, 1, 'Scolipede engage in fierce territorial battles with Centiskorch. At the end of one of these battles,  the victor makes a meal of the loser.'),
    (545, 2, 'Il défend son territoire avec acharnement contre son ennemi Scolocendre. Le perdant sert de dîner au vainqueur.'),
    (546, 1, 'Weaving together the cotton of both Cottonee and Eldegoss produces exquisite cloth that’s highly prized by many luxury brands.'),
    (546, 2, 'Les marques de luxe utilisent les étoffes splendides issues du mélange des cotons de Doudouvet et de Blancoton.'),
    (547, 1, 'As long as this Pokémon bathes in sunlight,  its cotton keeps growing. If too much cotton fluff builds up,  Whimsicott tears it off and scatters it.'),
    (547, 2, 'Son coton se met à gonfler sous les rayons du soleil. Quand il est trop volumineux,  il s’effiloche et se répand aux alentours.'),
    (548, 1, 'The leaves on its head are highly valued for medicinal purposes. Dry the leaves in the sun,  boil them,  and then drink the bitter decoction for remarkably effective relief from fatigue.'),
    (548, 2, 'Plus ses feuilles sont foncées,  plus il est en bonne santé. Il s’installe parfois dans les champs ou les parterres de fleurs bien entretenus.'),
    (549, 1, 'I suspect that its well-developed legs are the result of a life spent on mountains covered in deep snow. The scent it exudes from its flower crown heartens those in proximity.'),
    (549, 2, 'L’huile essentielle extraite de sa fleur dégage un parfum exceptionnel,  mais elle coûte extrêmement cher.'),
    (550, 1, 'Though it differs from other Basculin in several respects,  including demeanor—this one is gentle—I have categorized it as a regional form given the vast array of shared qualities.'),
    (550, 2, 'On l’utilisait autrefois en cuisine. La chair grasse des Bargantua à motif rouge était plutôt destinée aux jeunes.'),
    (551, 1, 'Sandile is small,  but its legs and lower body are powerful. Pushing sand aside as it goes,  Sandile moves through the desert as if it’s swimming.'),
    (551, 2, 'Malgré son petit gabarit,  il a beaucoup de force dans les pattes arrière. Il parcourt le désert comme s’il nageait dans le sable.'),
    (552, 1, 'Although this Pokémon has specialized eyes that allow it to see in the dark,  Krokorok won’t move much at night—the desert gets cold after sunset.'),
    (552, 2, 'Bien que ses yeux particuliers lui permettent de voir dans l’obscurité,  les nuits sont si froides dans le désert qu’il ne se déplace presque pas.'),
    (553, 1, 'While terribly aggressive,  Krookodile also has the patience to stay hidden under sand for days,  lying in wait for prey.'),
    (553, 2, 'Il aime la violence,  mais sait aussi se montrer patient lorsqu’il doit passer plusieurs jours dans le sable à attendre une proie.'),
    (554, 1, 'This popular symbol of good fortune will never fall over in its sleep,  no matter how it’s pushed or pulled.'),
    (554, 2, 'On a beau le pousser ou le tirer,  quand il dort,  rien ne le fait vaciller. Cette qualité lui a valu de devenir un emblème pour les porte-bonheurs.'),
    (555, 1, 'This Pokémon’s power level rises along with the temperature of its fire,  which can reach 2, 500 degrees Fahrenheit.'),
    (555, 2, 'Sa puissance augmente à mesure que la flamme de son corps s’intensifie. La température de celle-ci peut parfois dépasser les 1 400 °C.'),
    (556, 1, 'Once each year,  this Pokémon scatters its seeds. They’re jam-packed with nutrients,  making them a precious food source out in the desert.'),
    (556, 2, 'Il sème les graines de ses fleurs une fois par an. Celles-ci abondent en nutriments et représentent une denrée précieuse dans le désert.'),
    (557, 1, 'It first tries to find a rock to live in,  but if there are no suitable rocks to be found,  Dwebble may move in to the ports of a Hippowdon.'),
    (557, 2, 'S’il ne trouve pas de bon caillou à creuser pour s’y loger,  il élit domicile dans un des trous du corps d’Hippodocus.'),
    (558, 1, 'Its thick claws are its greatest weapons. They’re mighty enough to crack Rhyperior’s carapace.'),
    (558, 2, 'Ses meilleures armes sont ses pinces. Elles sont si dures qu’elles peuvent ébrécher les Protecteurs de Rhinastoc.'),
    (559, 1, 'It protects itself with its durable skin. It’s thought that this Pokémon will evolve once its skin has completely stretched out.'),
    (559, 2, 'Il se protège grâce à sa peau robuste. On dit que quand celle-ci ne peut plus s’étirer davantage,  c’est qu’il est sur le point d’évoluer.'),
    (560, 1, 'While mostly known for having the temperament of an aggressive ruffian,  this Pokémon takes very good care of its family,  friends,  and territory.'),
    (560, 2, 'Il est de nature violente,  mais au fond de lui,  il tient à sa famille,  à ses amis et à son territoire.'),
    (561, 1, 'A discovery was made in the desert where Sigilyph fly. The ruins of what may have been an ancient city were found beneath the sands.'),
    (561, 2, 'En fouillant sous le sable du désert survolé par Cryptéro,  on a retrouvé les vestiges de ce que l’on croit être une ville antique.'),
    (562, 1, 'The spirit of a person from a bygone age became this Pokémon. It rambles through ruins,  searching for someone who knows its face.'),
    (562, 2, 'Il est né de l’âme d’un être humain d’un peuple antique. Il erre dans les ruines à la recherche de quiconque reconnaîtra son visage.'),
    (563, 1, 'There are many depictions of Cofagrigus decorating ancient tombs. They’re symbols of the wealth that kings of bygone eras had.'),
    (563, 2, 'On le voit souvent représenté sur les murs des vieilles sépultures des rois en tant que symbole de leur richesse.'),
    (564, 1, 'Tirtouga is considered to be the ancestor of many turtle Pokémon. It was restored to life from a fossil.'),
    (564, 2, 'Ancêtre présumé de nombreuses espèces de Pokémon tortues,  il a été restauré à partir d’un fossile.'),
    (565, 1, 'This Pokémon emerges from the water in search of prey despite the fact that it moves more slowly on land.'),
    (565, 2, 'Bien qu’il soit moins à l’aise sur terre que dans l’eau,  il s’aventure sur le rivage pour se nourrir.'),
    (566, 1, 'Archen is said to be the ancestor of bird Pokémon. It lived in treetops,  eating berries and bug Pokémon.'),
    (566, 2, 'On dit que c’est l’ancêtre des Pokémon oiseaux. Il vivait à la cime des arbres et se nourrissait de Baies et de Pokémon Insecte.'),
    (567, 1, 'Though capable of flight,  Archeops was apparently better at hunting on the ground.'),
    (567, 2, 'Il savait voler,  mais il semble qu’il était beaucoup plus doué pour chasser ses proies sur la terre ferme.'),
    (568, 1, 'This Pokémon was born from a bag stuffed with trash. Galarian Weezing relish the fumes belched by Trubbish.'),
    (568, 2, 'Il est né d’un sac poubelle rempli d’ordures. Le gaz empoisonné qu’il exhale est très apprécié des Smogogo de Galar.'),
    (569, 1, 'The toxic liquid it launches from its right arm is so virulent that it can kill a weakened creature instantly.'),
    (569, 2, 'Le liquide qu’il projette de son bras droit est si toxique que si une créature fragile en est aspergée,  elle succombe sur-le-champ.'),
    (570, 1, 'A once-departed soul,  returned to life in Hisui. Derives power from resentment,  which rises as energy atop its head and takes on the forms of foes. In this way,  Zorua vents lingering malice.'),
    (570, 2, 'Il lui arrive de se changer en être humain,  surtout en enfant,  pour venir chercher de la nourriture en ville.'),
    (571, 1, 'With its disheveled white fur,  it looks like an embodiment of death. Heedless of its own safety,  Zoroark attacks its nemeses with a bitter energy so intense,  it lacerates Zoroark\'s own body.'),
    (571, 2, 'Les Dresseurs en manque de compagnie ordonnent à Zoroark de leur montrer une illusion pour tromper leur solitude.'),
    (572, 1, 'They pet each other with their tails as a form of greeting. Of the two,  the one whose tail is fluffier is a bit more boastful.'),
    (572, 2, 'Les Chinchidou se saluent en se frottant la queue. Celui qui a la plus volumineuse en tire une certaine fierté.'),
    (573, 1, 'A special oil that seeps through their fur helps them avoid attacks. The oil fetches a high price at market.'),
    (573, 2, 'La sécrétion huileuse de ses poils lui permet de dévier les attaques. Elle s’arrache à prix d’or sur les marchés.'),
    (574, 1, 'Even when nobody seems to be around,  Gothita can still be heard making a muted cry. Many believe it’s speaking to something only it can see.'),
    (574, 2, 'Parfois,  ce Pokémon chuchote alors qu’il n’y a personne aux alentours. On raconte qu’il parle à une entité que personne ne peut voir.'),
    (575, 1, 'On nights when the stars shine,  this Pokémon’s psychic power is at its strongest. It’s unknown just what link Gothorita has to the greater universe.'),
    (575, 2, 'Ses pouvoirs psychiques semblent atteindre leur paroxysme pendant les nuits étoilées,  mais nul ne sait s’il a un rapport avec l’espace.'),
    (576, 1, 'A criminal who was shown his fate by a Gothitelle went missing that same day and was never seen again.'),
    (576, 2, 'Les criminels à qui Sidérella a révélé les derniers instants de leur vie ont tous été portés disparus le jour même.'),
    (577, 1, 'Many say that the special liquid covering this Pokémon’s body would allow it to survive in the vacuum of space.'),
    (577, 2, 'On raconte que le curieux fluide qui entoure le corps de ce Pokémon lui permet de survivre dans l’espace.'),
    (578, 1, 'Its brain has split into two,  and the two halves rarely think alike. Its actions are utterly unpredictable.'),
    (578, 2, 'Étant donné que ses deux cerveaux sont rarement sur la même longueur d’onde,  il est impossible de prédire son comportement.'),
    (579, 1, 'It’s said that drinking the liquid surrounding Reuniclus grants wisdom. Problem is,  the liquid is highly toxic to anything besides Reuniclus itself.'),
    (579, 2, 'S’il ne s’agissait pas d’un poison violent que seul Symbios peut boire,  son curieux fluide pourrait,  selon les dires,  rendre plus intelligent.'),
    (580, 1, 'They are better at swimming than flying,  and they happily eat their favorite food,  peat moss,  as they dive underwater.'),
    (580, 2, 'Un Pokémon doué pour la plongée qui passe son temps sous l’eau à chercher des sphaignes,  son plat préféré.'),
    (581, 1, 'Swanna start to dance at dusk. The one dancing in the middle is the leader of the flock.'),
    (581, 2, 'Ils se mettent à danser à la tombée de la nuit. Le Lakmécygne qui danse au centre est le chef de la troupe.'),
    (582, 1, 'Supposedly,  this Pokémon was born from an icicle. It spews out freezing air at −58 degrees Fahrenheit to make itself more comfortable.'),
    (582, 2, 'On raconte qu’il est né de stalactites. Il gèle les alentours en soufflant de l’air à - 50 °C pour améliorer son confort.'),
    (583, 1, 'It blasts enemies with cold air reaching −148 degrees Fahrenheit,  freezing them solid. But it spares their lives afterward—it’s a kind Pokémon.'),
    (583, 2, 'Bien qu’il gèle ses ennemis en soufflant de l’air à - 100 °C,  sa gentillesse l’empêche de leur ôter la vie.'),
    (584, 1, 'People believe this Pokémon formed when two Vanillish stuck together. Its body temperature is roughly 21 degrees Fahrenheit.'),
    (584, 2, 'La température de son corps est d’environ - 6 °C. On raconte que ce Pokémon naît lorsque deux Sorboul se collent l’un à l’autre.'),
    (585, 1, 'The turning of the seasons changes the color and scent of this Pokémon’s fur. People use it to mark the seasons.'),
    (585, 2, 'Quand la saison change,  il change de pelage et d’odeur. Un Pokémon qui annonce le passage des saisons.'),
    (586, 1, 'They migrate according to the seasons,  so some people call Sawsbuck the harbingers of spring.'),
    (586, 2, 'Il change d’habitat selon les saisons. Certains disent même qu’il est celui qui apporte le printemps.'),
    (587, 1, 'This Pokémon absolutely loves sweet berries. Sometimes it stuffs its cheeks full of so much food that it can’t fly properly.'),
    (587, 2, 'Les Baies sucrées sont son péché mignon. Il lui arrive d’en conserver beaucoup trop dans ses bajoues,  ce qui l’empêche de bien planer.'),
    (588, 1, 'It spits a liquid from its mouth to melt through Shelmet’s shell. Karrablast doesn’t eat the shell— it eats only the contents.'),
    (588, 2, 'Il crache un liquide qui dissout les coquilles des Escargaume pour se régaler de leur contenu.'),
    (589, 1, 'It charges its enemies,  lances at the ready. An image of one of its duels is captured in a famous painting of Escavalier clashing with Sirfetch’d.'),
    (589, 2, 'Il charge ses ennemis en brandissant ses lances. Il existe un célèbre tableau représentant la joute entre un Lançargot et un Palarticho.'),
    (590, 1, 'The spores released from this Pokémon’s hands are highly poisonous,  but when thoroughly dried,  the spores can be used as stomach medicine.'),
    (590, 2, 'Les spores qu’il libère de ses mains sont très toxiques,  mais si on les sèche bien,  elles peuvent soulager les maux de ventre.'),
    (591, 1, 'Amoonguss generally doesn’t move much. It tends to stand still near Poké Balls that have been dropped on the ground.'),
    (591, 2, 'Ce Pokémon a tendance à très peu se déplacer. Quand il voit une Poké Ball abandonnée au sol,  il reste immobile à côté.'),
    (592, 1, 'Legend has it that the residents of a sunken ancient city changed into these Pokémon.'),
    (592, 2, 'Certaines légendes racontent que les Viskuse sont les habitants d’une ancienne cité engloutie qui ont été changés en Pokémon.'),
    (593, 1, 'Whenever a full moon hangs in the night sky,  schools of Jellicent gather near the surface of the sea,  waiting for their prey to appear.'),
    (593, 2, 'Les nuits de pleine lune,  ils se réunissent à la surface de la mer pour attendre leurs proies.'),
    (594, 1, 'The reason it helps Pokémon in a weakened condition is that any Pokémon coming after them may also attack Alomomola.'),
    (594, 2, 'On pense qu’il protège les Pokémon affaiblis parce qu’il partage avec eux les mêmes prédateurs.'),
    (595, 1, 'Joltik latch on to other Pokémon and suck out static electricity. They’re often found sticking to Yamper’s hindquarters.'),
    (595, 2, 'Il s’accroche aux autres Pokémon pour aspirer leur électricité statique. On en trouve souvent collés au postérieur de Voltoutou.'),
    (596, 1, 'It lays traps of electrified threads near the nests of bird Pokémon,  aiming to snare chicks that are not yet good at flying.'),
    (596, 2, 'Il piège les oisillons qui ne savent pas encore voler en tissant une toile électrique près des nids des Pokémon oiseaux.'),
    (597, 1, 'Mossy caves are their preferred dwellings. Enzymes contained in mosses help Ferroseed’s spikes grow big and strong.'),
    (597, 2, 'Il aime les grottes pleines de mousse. Les enzymes contenues dans ces plantes l’aident à obtenir des épines grandes et solides.'),
    (598, 1, 'Its spikes are harder than steel. This Pokémon crawls across rock walls by stabbing the spikes on its feelers into the stone.'),
    (598, 2, 'Ses épines sont plus solides que l’acier. Il plante celles de ses tentacules dans les parois rocheuses pour se déplacer.'),
    (599, 1, 'It’s suspected that Klink were the inspiration behind ancient people’s invention of the first gears.'),
    (599, 2, 'Les humains auraient inventé les mécanismes à engrenages il y a fort longtemps,  en observant ce Pokémon.'),
    (600, 1, 'Many companies in the Galar region choose Klang as their logo. This Pokémon is considered the symbol of industrial technology.'),
    (600, 2, 'Ce Pokémon symbolisant la technologie industrielle est souvent utilisé dans le logo des entreprises de Galar.'),
    (601, 1, 'The three gears that compose this Pokémon spin at high speed. Its new spiked gear isn’t a living creature.'),
    (601, 2, 'Bien que son nouveau rouage à pointes ne soit pas doué de vie,  il parvient à le faire tourner à grande vitesse avec les deux autres.'),
    (602, 1, 'One alone can emit only a trickle of electricity,  so a group of them gathers to unleash a powerful electric shock.'),
    (602, 2, 'Tout seul,  il ne dégage pas beaucoup d’électricité. Mais un banc d’Anchwatt produit des décharges surpuissantes.'),
    (603, 1, 'These Pokémon have a big appetite. When they spot their prey,  they attack it and paralyze it with electricity.'),
    (603, 2, 'Un Pokémon doté d’un gros appétit. Il paralyse ses proies avec des décharges électriques avant de les manger.'),
    (604, 1, 'They crawl out of the ocean using their arms. They will attack prey on shore and immediately drag it into the ocean.'),
    (604, 2, 'Il peut sortir de l’eau à la force de ses bras pour attraper des proies sur la rive. Il retourne à l’eau en un instant.'),
    (605, 1, 'This Pokémon was discovered about 50 years ago. Its highly developed brain enables it to exert its psychic powers.'),
    (605, 2, 'Ce Pokémon a été découvert il y a environ 50 ans. Son cerveau surdéveloppé lui permet d’utiliser ses pouvoirs psychiques avec aisance.'),
    (606, 1, 'Sometimes found drifting above wheat fields,  this Pokémon can control the memories of its opponents.'),
    (606, 2, 'Il peut manipuler les souvenirs de son adversaire à loisir. Parfois,  on l’aperçoit en train de vagabonder au-dessus des champs de blé.'),
    (607, 1, 'The younger the life this Pokémon absorbs,  the brighter and eerier the flame on its head burns.'),
    (607, 2, 'Plus les victimes dont il aspire l’énergie vitale sont jeunes,  plus sa flamme grandit et luit lugubrement.'),
    (608, 1, 'It lurks in cities,  pretending to be a lamp. Once it finds someone whose death is near,  it will trail quietly after them.'),
    (608, 2, 'Il se cache en ville en se faisant passer pour un lampadaire. Lorsqu’il repère une personne dont l’heure est proche,  il la suit en catimini.'),
    (609, 1, 'In homes illuminated by Chandelure instead of lights,  funerals were a constant occurrence— or so it’s said.'),
    (609, 2, 'On raconte que dans les manoirs éclairés par des Lugulabre,  les funérailles s’enchaînent sans discontinuer.'),
    (610, 1, 'They play with each other by knocking their large tusks together. Their tusks break sometimes,  but they grow back so quickly that it isn’t a concern.'),
    (610, 2, 'Il joue avec ses congénères à se donner de grands coups de crocs. Peu importe s’ils se cassent : ils repousseront aussitôt.'),
    (611, 1, 'Its skin is as hard as a suit of armor. Fraxure’s favorite strategy is to tackle its opponents,  stabbing them with its tusks at the same time.'),
    (611, 2, 'Son épiderme est dur comme une armure. Il est passé maître dans l’art de charger l’ennemi tout en le transperçant de ses crocs.'),
    (612, 1, 'While usually kindhearted,  it can be terrifying if angered. Tusks that can slice through steel beams are how Haxorus deals with its adversaries.'),
    (612, 2, 'D’un naturel doux,  il est cependant redoutable lorsqu’il se fâche. Il est très fier de ses crocs qui peuvent même découper des poutres d’acier.'),
    (613, 1, 'It sniffles before performing a move,  using its frosty snot to provide an icy element to any move that needs it.'),
    (613, 2, 'Il renifle avant d’utiliser une capacité. Le froid intense contenu dans sa morve lui permet de lancer les capacités de type Glace.'),
    (614, 1, 'It swims energetically through frigid seas. When it gets tired,  it freezes the seawater with its breath so it can rest on the ice.'),
    (614, 2, 'Il sillonne les mers glaciales avec aisance. Quand il est fatigué,  il gèle l’eau de mer d’un souffle et se repose sur l’iceberg improvisé.'),
    (615, 1, 'When the weather gets hot,  these Pokémon turn into water vapor. Cryogonal are almost never seen during summer.'),
    (615, 2, 'Lorsqu’il fait trop chaud,  il s’évapore,  ce qui explique pourquoi on ne le voit presque pas en été.'),
    (616, 1, 'It has a strange physiology that responds to electricity. When together with Karrablast,  Shelmet evolves for some reason.'),
    (616, 2, 'Il a l’étrange faculté de réagir à l’énergie électrique. On ne sait trop pourquoi,  mais quand il se trouve aux côtés de Carabing,  il évolue.'),
    (617, 1, 'Discarding its shell made it nimble. To keep itself from dehydrating,  it wraps its body in bands of membrane.'),
    (617, 2, 'Il est bien plus agile sans sa coquille. La membrane en forme de bandelettes qui l’entoure l’empêche de se dessécher.'),
    (618, 1, 'For some reason,  this Pokémon smiles slightly when it emits a strong electric current from the yellow markings on its body.'),
    (618, 2, 'Lorsque les parties jaunes de son corps envoient une puissante décharge électrique,  il ébauche un sourire. Personne ne sait pourquoi.'),
    (619, 1, 'Though small,  Mienfoo’s temperament is fierce. Any creature that approaches Mienfoo carelessly will be greeted with a flurry of graceful attacks.'),
    (619, 2, 'De nature brutale malgré sa petite taille,  il inflige une série de coups majestueux aux inconscients qui s’approchent trop près de lui.'),
    (620, 1, 'Delivered at blinding speeds,  kicks from this Pokémon can shatter massive boulders into tiny pieces.'),
    (620, 2, 'Ses coups de pied ultrarapides et invisibles à l’œil nu peuvent réduire un énorme rocher en poussière.'),
    (621, 1, 'Druddigon are vicious and cunning. They take up residence in nests dug out by other Pokémon,  treating the stolen nests as their own lairs.'),
    (621, 2, 'Féroce et perfide,  Drakkarmin s’approprie les terriers creusés par d’autres Pokémon pour en faire son antre.'),
    (622, 1, 'This Pokémon was created from clay. It received orders from its master many thousands of years ago,  and it still follows those orders to this day.'),
    (622, 2, 'Ce Pokémon fait d’argile continue de respecter les ordres que son maître lui a donnés il y a quelques millénaires.'),
    (623, 1, 'There’s a theory that inside Golurk is a perpetual motion machine that produces limitless energy,  but this belief hasn’t been proven.'),
    (623, 2, 'Son énergie viendrait d’un mécanisme à mouvement perpétuel interne,  mais jusqu’à présent,  personne n’en a la preuve.'),
    (624, 1, 'A pack of these Pokémon forms to serve a Bisharp boss. Each Pawniard trains diligently,  dreaming of one day taking the lead.'),
    (624, 2, 'Il vit en meute,  sous les ordres d’un Scalproie. Il s’entraîne sans relâche en rêvant du jour où il sera chef de meute à son tour.'),
    (625, 1, 'Violent conflicts erupt between Bisharp and Fraxure over places where sharpening stones can be found.'),
    (625, 2, 'Sa recherche des meilleurs endroits où trouver des pierres pour affûter ses lames le conduit souvent à affronter des Incisache.'),
    (626, 1, 'These Pokémon live in herds of about 20 individuals. Bouffalant that betray the herd will lose the hair on their heads for some reason.'),
    (626, 2, 'Les Frison vivent en troupeau d’une vingtaine d’individus. Pour une raison inconnue,  si l’un d’eux trahit le groupe,  il perd sa crinière.'),
    (627, 1, 'Its chick-like looks belie its hotheadedness. It challenges its parents at every opportunity,  desperate to prove its strength.'),
    (627, 2, 'Sa poigne est telle qu’il peut réduire en miettes les plus dures des Baies. Belliqueux de nature,  il n’hésite pas à défier tout le monde.'),
    (628, 1, 'Screaming a bloodcurdling battle cry,  this huge and ferocious bird Pokémon goes out on the hunt. It blasts lakes with shock waves,  then scoops up any prey that float to the water\'s surface.'),
    (628, 2, 'Son caractère agressif et violent lui a valu de perdre son rôle de transporteur à Galar au profit de Corvaillus.'),
    (629, 1, 'Vullaby grow quickly. Bones that have gotten too small for older Vullaby to wear often get passed down to younger ones in the nest.'),
    (629, 2, 'Il grandit vite. Au sein du nid,  les petits Vostourno héritent des couches en crâne de leurs aînés.'),
    (630, 1, 'They adorn themselves with bones. There seem to be fashion trends among them,  as different bones come into and fall out of popularity.'),
    (630, 2, 'Il se pare d’ossements qu’il a ramassés. Il semblerait qu’il choisisse la forme des os qu’il porte selon les dernières tendances.'),
    (631, 1, 'A flame serves as its tongue,  melting through the hard shell of Durant so that Heatmor can devour their insides.'),
    (631, 2, 'Il se sert de sa flamme comme d’une langue. Il fait fondre peu à peu l’exosquelette des Fermite pour se délecter de leur chair.'),
    (632, 1, 'With their large mandibles,  these Pokémon can crunch their way through rock. They work together to protect their eggs from Sandaconda.'),
    (632, 2, 'Sa grande mâchoire réduit même les rochers en miettes. Il se bat avec sa colonie pour protéger ses Œufs des attaques des Dunaconda.'),
    (633, 1, 'Because it can’t see,  this Pokémon is constantly biting at everything it touches,  trying to keep track of its surroundings.'),
    (633, 2, 'Comme il ne voit rien,  il se repère en mâchouillant tout ce qui se trouve autour de lui.'),
    (634, 1, 'Their two heads will fight each other over a single piece of food. Zweilous are covered in scars even without battling others.'),
    (634, 2, 'Ses deux têtes se disputent la même proie. Il est toujours couvert de blessures,  même s’il n’a affronté personne.'),
    (635, 1, 'The three heads take turns sinking their teeth into the opponent. Their attacks won’t slow until their target goes down.'),
    (635, 2, 'Chacune de ses trois têtes mord à tour de rôle. Il attaque ses adversaires sans relâche,  jusqu’à ce qu’ils s’écroulent.'),
    (636, 1, 'Larvesta’s body is warm all over. It spouts fire from the tips of its horns to intimidate predators and scare prey.'),
    (636, 2, 'La température de son corps est très élevée. Il projette des flammes du bout de ses cornes pour intimider ses ennemis et ses proies.'),
    (637, 1, 'This Pokémon emerges from a cocoon formed of raging flames. Ancient murals depict Volcarona as a deity of fire.'),
    (637, 2, 'Né d’un cocon enflammé,  ce Pokémon apparaît sur d’anciennes fresques représenté comme une divinité du feu.'),
    (638, 1, 'From the moment it’s born,  this Pokémon radiates the air of a leader. Its presence will calm even vicious foes.'),
    (638, 2, 'Dès la naissance,  il a un air de chef. Même le plus terrible des adversaires file doux face à lui.'),
    (639, 1, 'In Unovan legend,  Terrakion battled against humans in an effort to protect other Pokémon.'),
    (639, 2, 'Selon une légende d’Unys,  Terrakium se serait jadis dressé contre les humains pour protéger les Pokémon.'),
    (640, 1, 'It darts around opponents with a flurry of quick movements,  slicing them up with its horns.'),
    (640, 2, 'Rapide comme le vent,  il s’abat tel un tourbillon sur ses ennemis avant de les transpercer sans pitié de ses cornes acérées.'),
    (641, 1, 'This storm-stirring Pokémon is said to cause the seasons to turn by whipping up the air. I suspect its humanlike form to be a false one.'),
    (641, 2, 'L’énergie dégagée par sa queue provoque d’énormes tempêtes dont la force peut renverser des maisons.'),
    (642, 1, 'They say this wielder of electricity has waged war with its nemesis,  Tornadus,  since time immemorial. The lightning bolts it hurls pierce the very earth and enrich the soil.'),
    (642, 2, 'Il vole dans le ciel d’Unys et fait tomber des éclairs,  provoquant des incendies qui font sa mauvaise réputation.'),
    (643, 1, 'According to myth,  if people ignore truth and let themselves become consumed by greed,  Reshiram will arrive to burn their kingdoms down.'),
    (643, 2, 'Selon un mythe,  lorsque les gens ne font aucun cas de la Réalité et s’abandonnent à la cupidité,  Reshiram rase le pays entier avec ses flammes.'),
    (644, 1, 'Mythology tells us that if people lose the righteousness in their hearts,  their kingdoms will be razed by Zekrom’s lightning.'),
    (644, 2, 'Selon la légende,  lorsque les gens perdent tout sens de ce qui est juste,  Zekrom réduit le pays entier en cendres avec de terribles éclairs.'),
    (645, 1, 'When the incarnations of wind and of lightning clash,  Landorus arrives to quell the conflict. After the tempests and thunderbolts abate,  the land is sure to be blessed with bountiful harvests.'),
    (645, 2, 'Il utilise l’énergie qu’il tire du vent et de la foudre pour enrichir les sols en nutriments pour les cultures.'),
    (646, 1, 'It appears that this Pokémon uses its powers over ice to freeze its own body in order to stabilize its cellular structure.'),
    (646, 2, 'Il se serait congelé lui-même avec son souffle glacé pour stabiliser sa structure cellulaire.'),
    (647, 1, 'They say that Keldeo must survive harsh battles and fully develop the horn on its forehead before this Pokémon’s true power will awaken.'),
    (647, 2, 'Lorsqu’il livre un combat difficile,  la corne sur son front se renforce et se développe,  ce qui éveillerait sa véritable puissance.'),
    (648, 1, 'Its melodies are sung with a special vocalization method that can control the feelings of those who hear it.'),
    (648, 2, 'Sa voix si particulière lui permet de chanter des mélodies qui ensorcellent les gens et modifient leurs émotions.'),
    (649, 1, 'This Pokémon existed 300 million years ago. Team Plasma altered it and attached a cannon to its back.'),
    (649, 2, 'Un Pokémon existant depuis 300 millions d’années,  et modifié par la Team Plasma. Il a maintenant un canon dans le dos.'),
    (650, 1, 'Such a thick shell of wood covers its head and back that even a direct hit from a truck wouldn’t faze it.'),
    (650, 2, 'Sa tête et son dos sont recouverts d’une carapace tellement dure que même une collision avec un camion ne lui ferait rien.'),
    (651, 1, 'They strengthen their lower bodies by running into one another. They are very kind and won’t start fights.'),
    (651, 2, 'Il renforce ses membres inférieurs en se ruant violemment sur ses congénères. Naturellement paisible,  il ne provoque jamais un combat.'),
    (652, 1, 'When it takes a defensive posture with its fists guarding its face,  it could withstand a bomb blast.'),
    (652, 2, 'Il se défend en joignant ses poings devant son visage. Dans cette posture,  il peut même résister à l’onde de choc d’une explosion.'),
    (653, 1, 'As it walks,  it munches on a twig in place of a snack. It intimidates opponents by puffing hot air out of its ears.'),
    (653, 2, 'Il a toujours une brindille avec lui en cas de petit creux. Il projette de l’air chaud par ses oreilles pour intimider ses ennemis.'),
    (654, 1, 'When the twig is plucked from its tail,  friction sets the twig alight. The flame is used to send signals to its allies.'),
    (654, 2, 'Quand il saisit la branche plantée dans sa queue,  elle prend feu par friction. Il peut communiquer avec ses congénères en agitant ce bâton enflammé.'),
    (655, 1, 'Using psychic power,  it generates a fiery vortex of 5, 400 degrees Fahrenheit,  incinerating foes swept into this whirl of flame.'),
    (655, 2, 'Ses pouvoirs psychiques lui permettent de créer des tourbillons de flammes à 3 000 °C qui enveloppent et consument ses ennemis.'),
    (656, 1, 'It protects its skin by covering its body in delicate bubbles. Beneath its happy-go-lucky air,  it keeps a watchful eye on its surroundings.'),
    (656, 2, 'Il protège son corps en l’entourant d’une mousse délicate. Malgré son apparence insouciante,  ce Pokémon est en fait constamment à l’affût.'),
    (657, 1, 'Its swiftness is unparalleled. It can scale a tower of more than 2, 000 feet in a minute’s time.'),
    (657, 2, 'Son agilité est incomparable. Il peut gravir une tour de 600 m de haut en moins d’une minute.'),
    (658, 1, 'It appears and vanishes with a ninja’s grace. It toys with its enemies using swift movements,  while slicing them with throwing stars of sharpest water.'),
    (658, 2, 'Aussi insaisissable qu’un ninja,  il se joue de ses ennemis grâce à sa célérité,  et les tranche de ses Sheauriken.'),
    (659, 1, 'It’s very sensitive to danger. The sound of Corviknight’s flapping will have Bunnelby digging a hole to hide underground in moments.'),
    (659, 2, 'Il est sensible au danger. Lorsqu’il entend le battement d’ailes de Corvaillus,  il creuse prestement un terrier et s’y cache.'),
    (660, 1, 'The fur on its belly retains heat exceptionally well. People used to make heavy winter clothing from fur shed by this Pokémon.'),
    (660, 2, 'La fourrure de son ventre est un excellent isolant thermique. Jadis,  on fabriquait des vêtements chauds en se servant de sa mue.'),
    (661, 1, 'When this Pokémon gets excited,  its body temperature increases sharply. If you touch a Fletchling with bare hands,  you might get burned.'),
    (661, 2, 'Quand il est surexcité,  sa température corporelle augmente d’un coup,  à tel point qu’il est possible de se brûler en le touchant à mains nues.'),
    (662, 1, 'Fletchinder are exceedingly territorial and aggressive. These Pokémon fight among themselves over feeding grounds.'),
    (662, 2, 'De nature belliqueuse,  il dispose d’un fort instinct territorial. Quand il chasse,  il se dispute régulièrement les proies avec ses congénères.'),
    (663, 1, 'Talonflame dives toward prey at speeds of up to 310 mph and assaults them with powerful kicks,  giving the prey no chance to escape.'),
    (663, 2, 'Flambusard attaque à une vitesse de 500 km/h. Il achève ses proies d’un puissant coup de patte sans leur laisser la moindre chance de fuir.'),
    (664, 1, 'The powder that covers its body regulates its temperature,  so it can live in any region or climate.'),
    (664, 2, 'La poudre qui recouvre son corps l’aide à réguler sa température. Il peut s’adapter à tous les climats.'),
    (665, 1, 'The beaks of bird Pokémon can’t begin to scratch its stalwart body. To defend itself,  it spews powder.'),
    (665, 2, 'Même les becs acérés des Pokémon Oiseaux ne parviennent pas à meurtrir son corps très dur. Il se défend en crachant de la poudre.'),
    (666, 1, 'The patterns on this Pokémon’s wings depend on the climate and topography of its habitat. It scatters colorful scales.'),
    (666, 2, 'Selon le climat de sa région d’origine,  les motifs de ses ailes sont différents. Il sème des écailles aux couleurs vives.'),
    (667, 1, 'This hot-blooded Pokémon is filled with curiosity. When it gets angry or starts fighting,  its short mane gets hot.'),
    (667, 2, 'Il déborde d’énergie et de curiosité. Quand il se fâche ou qu’il s’apprête à se battre,  sa courte crinière s’échauffe.'),
    (668, 1, 'The temperature of its breath is over 10, 000 degrees Fahrenheit,  but Pyroar doesn’t use it on its prey. This Pokémon prefers to eat raw meat.'),
    (668, 2, 'Son souffle enflammé atteint les 6 000 °C,  mais il ne l’utilise jamais contre ses proies. Il préfère en effet la viande crue.'),
    (669, 1, 'Flabébé wears a crown made from pollen it’s collected from its flower. The crown has hidden healing properties.'),
    (669, 2, 'Bien qu’il soit vulnérable sans le pouvoir de sa fleur,  il voyagera jusqu’à en trouver une de la couleur et de la forme qu’il préfère.'),
    (670, 1, 'It gives its own power to flowers,  pouring its heart into caring for them. Floette never forgives anyone who messes up a flower bed.'),
    (670, 2, 'Il fait profiter ses fleurs de ses pouvoirs et met tout son cœur à leur entretien. Gare à ceux qui ravagent ses plates-bandes !'),
    (671, 1, 'Its life can span several hundred years. It’s said to devote its entire life to protecting gardens.'),
    (671, 2, 'Il peut vivre des centaines d’années,  et consacre sa longue existence à l’entretien des jardins.'),
    (672, 1, 'If it has sunshine and water,  it doesn’t need to eat,  because it can generate energy from the leaves on its back.'),
    (672, 2, 'Tant qu’il a de l’eau et du soleil en abondance,  ce Pokémon n’a pas besoin de nourriture. Les feuilles sur son dos produisent son énergie par photosynthèse.'),
    (673, 1, 'They inhabit mountainous regions. The leader of the herd is decided by a battle of clashing horns.'),
    (673, 2, 'Ce Pokémon vit dans les régions montagneuses. Le chef du troupeau s’impose à l’issue d’un combat de cornes.'),
    (674, 1, 'Wanting to make sure it’s taken seriously,  Pancham’s always giving others a glare. But if it’s not focusing,  it ends up smiling.'),
    (674, 2, 'Il dévisage toujours ses adversaires d’un air renfrogné pour être pris au sérieux,  mais dès que la tension retombe,  son sourire reprend le dessus.'),
    (675, 1, 'Using its leaf,  Pangoro can predict the moves of its opponents. It strikes with punches that can turn a dump truck into scrap with just one hit.'),
    (675, 2, 'Il anticipe les mouvements de son adversaire grâce à sa feuille. Ses coups de poing peuvent réduire un camion-benne en un tas de ferraille.'),
    (676, 1, 'Left alone,  its fur will grow longer and longer,  but it will only allow someone it trusts to cut it.'),
    (676, 2, 'Sa fourrure pousse indéfiniment,  mais il refuse de se faire couper la toison par une personne en qui il n’a pas confiance.'),
    (677, 1, 'There’s enough psychic power in Espurr to send a wrestler flying,  but because this power can’t be controlled,  Espurr finds it troublesome.'),
    (677, 2, 'Il possède des pouvoirs psychiques si puissants qu’il peut faire valser un catcheur. Malheureusement,  il a du mal à les contrôler.'),
    (678, 1, 'The defensive instinct of the males is strong. It’s when they’re protecting themselves or their partners that they unleash their full power.'),
    (678, 2, 'Le mâle a un instinct de défense très développé. Il n’hésite pas à lancer une attaque à pleine puissance pour protéger ses partenaires et lui.'),
    (679, 1, 'The blue eye on the sword’s handguard is the true body of Honedge. With its old cloth,  it drains people’s lives away.'),
    (679, 2, 'L’œil bleu sur la garde de la lame est le véritable corps de Monorpale. Il aspire l’énergie vitale des gens avec son étoffe usée par le temps.'),
    (680, 1, 'The two swords employ a strategy of rapidly alternating between offense and defense to bring down their prey.'),
    (680, 2, 'Ses deux lames abattent leurs proies en enchaînant les attaques et les parades à un rythme effréné.'),
    (681, 1, 'Its potent spectral powers allow it to manipulate others. It once used its powers to force people and Pokémon to build a kingdom to its liking.'),
    (681, 2, 'Grâce à ses puissants pouvoirs spirituels,  il a contrôlé des humains et des Pokémon pour créer un pays conforme à ses idéaux.'),
    (682, 1, 'The scent its body gives off enraptures those who smell it. Noble ladies had no shortage of love for Spritzee.'),
    (682, 2, 'Une douce odeur qui charme les gens émane de son corps. Les dames nobles raffolaient de lui.'),
    (683, 1, 'The scents Aromatisse can produce range from sweet smells that bolster allies to foul smells that sap an opponent’s will to fight.'),
    (683, 2, 'Il peut émettre une puanteur si infâme qu’elle prive ses ennemis de leur combativité,  ou un parfum si réconfortant qu’il encourage ses alliés.'),
    (684, 1, 'The sweet smell of cotton candy perfumes Swirlix’s fluffy fur. This Pokémon spits out sticky string to tangle up its enemies.'),
    (684, 2, 'Sa douce fourrure possède une odeur sucrée comme la barbe à papa. Il produit des filaments gluants pour empêtrer ses adversaires.'),
    (685, 1, 'Slurpuff’s fur contains a lot of air,  making it soft to the touch and lighter than it looks.'),
    (685, 2, 'Sa fourrure est si aérée qu’elle le rend très doux et très agréable au toucher,  et bien plus léger qu’il en a l’air.'),
    (686, 1, 'By exposing foes to the blinking of its luminescent spots,  Inkay demoralizes them,  and then it seizes the chance to flee.'),
    (686, 2, 'Il sape la combativité de son adversaire en faisant clignoter son corps lumineux,  puis profite de cet instant de répit pour s’enfuir.'),
    (687, 1, 'It’s said that Malamar’s hypnotic powers played a role in certain history-changing events.'),
    (687, 2, 'On raconte que ses pouvoirs hypnotiques seraient à l’origine d’évènements qui ont bouleversé le cours de l’Histoire.'),
    (688, 1, 'If the two don’t work well together,  both their offense and defense fall apart. Without good teamwork,  they won’t survive.'),
    (688, 2, 'Il faut que les deux bras travaillent bien ensemble s’ils souhaitent survivre,  sinon leur défense et leur attaque en souffrent grandement.'),
    (689, 1, 'Having an eye on each palm allows it to keep watch in all directions. In a pinch,  its limbs start to act on their own to ensure the enemy’s defeat.'),
    (689, 2, 'Il scrute les environs avec les yeux de ses paumes. En cas d’urgence,  ses membres peuvent prendre des initiatives pour triompher de l’ennemi.'),
    (690, 1, 'Skrelp looks like a piece of rotten seaweed,  so it can blend in with seaweed drifting on the ocean and avoid being detected by enemies.'),
    (690, 2, 'Ressembler à une algue en décomposition lui permet d’échapper à ses ennemis en se cachant au milieu des résidus de plantes aquatiques.'),
    (691, 1, 'Dragalge generates dragon energy by sticking the plume on its head out above the ocean’s surface and bathing it in sunlight.'),
    (691, 2, 'Il sort la crête sur sa tête à la surface de l’eau et l’expose à la lumière du soleil pour produire de l’énergie draconique.'),
    (692, 1, 'By detonating gas that accumulates in its right claw,  this Pokémon launches water like a bullet. This is how Clauncher defeats its enemies.'),
    (692, 2, 'Il concentre du gaz dans sa pince droite et le fait exploser pour tirer une rafale d’eau sur ses ennemis,  comme une balle de pistolet.'),
    (693, 1, 'Clawitzer’s right arm is a cannon that launches projectiles made of seawater. Shots from a Clawitzer’s cannon arm can sink a tanker.'),
    (693, 2, 'Sa pince droite est un canon pouvant projeter des obus d’eau assez puissants pour couler un navire-citerne.'),
    (694, 1, 'The sun powers this Pokémon’s electricity generation. Interruption of that process stresses Helioptile to the point of weakness.'),
    (694, 2, 'Il peut générer de l’électricité grâce au soleil. Si on le dérange en pleine production d’énergie,  cela le stresse et l’affaiblit.'),
    (695, 1, 'One Heliolisk basking in the sun with its frill outspread is all it would take to produce enough electricity to power a city.'),
    (695, 2, 'Lorsqu’il déploie sa collerette pour emmagasiner la lumière du soleil,  il génère à lui seul assez d’électricité pour alimenter une grande ville.'),
    (696, 1, 'This Pokémon is selfish and likes to be pampered. It can also inflict grievous wounds on its Trainer just by playing around.'),
    (696, 2, 'Capricieux,  il veut toujours être le centre de l’attention. Il peut gravement blesser son Dresseur en essayant de jouer avec lui.'),
    (697, 1, 'A single bite of Tyrantrum’s massive jaws will demolish a car. This Pokémon was the king of the ancient world.'),
    (697, 2, 'Ce Pokémon peut réduire une voiture en miettes d’un seul coup de mâchoire. Il était considéré comme le roi du monde préhistorique.'),
    (698, 1, 'Amaura is an ancient Pokémon that has gone extinct. Specimens of this species can sometimes be found frozen in ice.'),
    (698, 2, 'Un Pokémon ancien qui s’est éteint. On trouve parfois des spécimens conservés dans la glace.'),
    (699, 1, 'When gripped by rage,  Aurorus will emanate freezing air,  covering everything around it in ice.'),
    (699, 2, 'Lorsqu’il se laisse emporter par sa rage,  il relâche des bourrasques glacées qui gèlent tout ce qui l’entoure.'),
    (700, 1, 'It emits a soothing aura from its ribbon-shaped organs. It wraps these appendages around quarrelers to instantly restore calm to the situation.'),
    (700, 2, 'Un conte de Galar relate la victoire d’un beau Nymphali sur un terrible Pokémon Dragon.'),
    (701, 1, 'It always strikes a pose before going for its finishing move. Sometimes opponents take advantage of that time to counterattack.'),
    (701, 2, 'Il prend toujours la pose avant de donner le coup de grâce à son adversaire. Certains en profitent pour contre-attaquer.'),
    (702, 1, 'Since Dedenne can’t generate much electricity on its own,  it steals electricity from outlets or other electric Pokémon.'),
    (702, 2, 'Puisqu’il a du mal à générer sa propre électricité,  il en vole aux autres Pokémon Électrik ou via les prises de courant.'),
    (703, 1, 'It’s said that somewhere in the world,  there’s a mineral vein housing a large pack of slumbering Carbink. It’s also said that this pack has a queen.'),
    (703, 2, 'On raconte qu’il existerait quelque part dans le monde un filon regorgeant de Strassie,  qui abriterait également leur reine.'),
    (704, 1, 'Goomy hides away in the shade of trees,  where it\'s nice and humid. If the slime coating its body dries out,  the Pokémon instantly becomes lethargic.'),
    (704, 2, 'Ses cornes sont des organes sensoriels qui lui permettent de se cacher quand il détecte des ennemis. C’est grâce à cela qu’il vit toujours.'),
    (705, 1, 'A creature given to melancholy. I suspect its metallic shell developed as a result of the mucus on its skin reacting with the iron in Hisui\'s water.'),
    (705, 2, 'Son petit cerveau est caché dans la bosse qui est sur son dos. Il ne pense pas à grand-chose,  si ce n’est à se nourrir et à fuir devant ses ennemis.'),
    (706, 1, 'Able to freely control the hardness of its metallic shell. It loathes solitude and is extremely clingy—it will fume and run riot if those dearest to it ever leave its side.'),
    (706, 2, 'Il attaque à l’aide de ses longues cornes. Ses coups sont cent fois plus puissants que ceux d’un champion poids lourds de boxe.'),
    (707, 1, 'Klefki sucks in metal ions with the horn topping its head. It seems this Pokémon loves keys so much that its head needed to look like one,  too.'),
    (707, 2, 'Il absorbe les ions métalliques avec l’appendice sur sa tête. Il paraît qu’il ressemble à une clé car il tient à imiter cet objet qu’il aime tant.'),
    (708, 1, 'With a voice like a human child’s,  it cries out to lure adults deep into the forest,  getting them lost among the trees.'),
    (708, 2, 'Il imite des cris d’enfants pour pousser les adultes à venir se perdre au plus profond de la forêt.'),
    (709, 1, 'Small roots that extend from the tips of this Pokémon’s feet can tie into the trees of the forest and give Trevenant control over them.'),
    (709, 2, 'Il étire les fines racines de ses pieds pour établir une connexion avec les autres arbres de la forêt et ainsi les contrôler.'),
    (710, 1, 'The light that streams out from the holes in the pumpkin can hypnotize and control the people and Pokémon that see it.'),
    (710, 2, 'Il peut manipuler les humains et les Pokémon en les hypnotisant grâce à la lumière qui filtre par les trous de son ventre en forme de citrouille.'),
    (711, 1, 'In the darkness of a new-moon night,  Gourgeist will come knocking. Whoever answers the door will be swept off to the afterlife.'),
    (711, 2, 'Les soirs de nouvelle lune,  il frappe aux portes des maisons. Si quelqu’un a le malheur de lui ouvrir,  il l’emporte aussitôt dans l’au-delà.'),
    (712, 1, 'Lives on mountains blanketed in perennial snow. It freezes water vapor in the air to make the ice helmet that it dons for defense.'),
    (712, 2, 'Il vit dans les régions les plus froides,  agrippé aux Séracrawl. Il gèle ses pattes sur leur dos pour se maintenir en place.'),
    (713, 1, 'The armor of ice covering its lower jaw puts steel to shame and can shatter rocks with ease. This Pokémon barrels along steep mountain paths,  cleaving through the deep snow.'),
    (713, 2, 'Les crevasses sur son dos s’approfondissent au cours de la journée,  mais se comblent de nouveau pendant la nuit.'),
    (714, 1, 'No wavelength of sound is beyond Noibat’s ability to produce. The ultrasonic waves it generates can overcome much larger Pokémon.'),
    (714, 2, 'Il peut contrôler des ondes à n’importe quelle fréquence du spectre. Même les plus grands Pokémon ne peuvent supporter ses ultrasons.'),
    (715, 1, 'Flying through the darkness,  it weakens enemies with ultrasonic waves that could crush stone. Its fangs finish the fight.'),
    (715, 2, 'Il plane dans les ténèbres,  blessant ses ennemis à coups d’ultrasons pouvant briser des rochers avant de les achever de ses crocs acérés.'),
    (716, 1, 'When the horns on its head shine in seven colors,  it is said to be sharing everlasting life.'),
    (716, 2, 'D’après la légende,  quand ses bois brillent de sept couleurs,  cela signifie qu’il prodigue la vie éternelle.'),
    (717, 1, 'When its life comes to an end,  it absorbs the life energy of every living thing and turns into a cocoon once more.'),
    (717, 2, 'Quand il sent que la fin de sa vie est proche,  il aspire la force vitale des êtres vivants et retourne à l’état de cocon.'),
    (718, 1, 'Some say it can change to an even more powerful form when battling those who threaten the ecosystem.'),
    (718, 2, 'Ce Pokémon serait capable de prendre une forme encore plus puissante quand il se bat contre un ennemi qui menace l’écosystème.'),
    (719, 1, 'It can instantly create many diamonds by compressing the carbon in the air between its hands.'),
    (719, 2, 'Il peut créer une multitude de diamants en un instant en serrant ses mains,  simplement en compressant les molécules de carbone contenues dans l’air.'),
    (720, 1, 'It is said to be able to seize anything it desires with its six rings and six huge arms. With its power sealed,  it is transformed into a much smaller form.'),
    (720, 2, 'On raconte que grâce à ses six anneaux et ses six énormes bras,  il est capable de dérober tout ce qui lui plaît. Mais son pouvoir a été scellé,  et il a été réduit à l’état d’un être minuscule.'),
    (721, 1, 'It expels its internal steam from the arms on its back. It has enough power to blow away a mountain.'),
    (721, 2, 'Il évacue la vapeur qui s’accumule à l’intérieur de son corps par les bras situés sur son dos. Ce jet est assez puissant pour raser des montagnes.'),
    (722, 1, 'Flies noiselessly on delicate wings. It has mastered the art of deftly launching dagger-sharp feathers from those same wings.'),
    (722, 2, 'Pendant la journée,  il emmagasine de l’énergie par photosynthèse. La nuit,  il plane silencieusement à la recherche de proies.'),
    (723, 1, 'Regularly basks in sunlight to gather power—presumably due to the frigid climate. Nonetheless,  the edges of the blade quills set into its wings are keen as ever.'),
    (723, 2, 'Il prend grand soin de son plumage,  s’assurant ainsi d’avoir une apparence impeccable et des plumes aiguisées à souhait.'),
    (724, 1, 'The air stored inside the rachises of Decidueye\'s feathers insulates the Pokémon against Hisui\'s extreme cold. This is firm proof that evolution can be influenced by environment.'),
    (724, 2, 'Il décoche ses plumes acérées en un dixième de seconde. Sa victime n’a pas le temps de le voir agir qu’elle est déjà grièvement touchée.'),
    (725, 1, 'Trying to pet Litten before it trusts you will result in a nasty scratch from its sharp claws. Be careful.'),
    (725, 2, 'Quiconque essaie de le caresser avant d’avoir gagné sa confiance s’expose à de sérieuses griffures.'),
    (726, 1, 'When facing a powerful enemy,  Torracat’s fighting spirit gets pumped up,  and its fire bell blazes hotter.'),
    (726, 2, 'Quand il fait face à un adversaire redoutable,  il redouble de combativité et la puissance calorifère de sa clochette augmente.'),
    (727, 1, 'Incineroar’s rough and aggressive behavior is its most notable trait,  but the way it helps out small Pokémon shows that it has a kind side as well.'),
    (727, 2, 'Bien qu’il soit parfois brutal,  il sait aussi se montrer attentionné en venant en aide aux petits Pokémon.'),
    (728, 1, 'If Popplio want to create big,  powerful balloons,  they must be persistent. It takes daily practice for these Pokémon to develop their skills.'),
    (728, 2, 'Il s’entraîne sans relâche tous les jours pour réussir à créer de gros ballons de bonne qualité.'),
    (729, 1, 'On nights when the sea is calm,  Brionne dance with one another to the singing of the Primarina that’s leading them.'),
    (729, 2, 'Les soirs où la mer est calme,  il danse avec ses congénères au son des chants d’Oratoria,  le chef du groupe.'),
    (730, 1, 'For Primarina,  every battle’s a stage. Its singing and the dancing of its balloons will mesmerize the audience.'),
    (730, 2, 'Les combats sont une véritable performance artistique,  pour lui. Les spectateurs sont charmés par son chant et la danse de ses ballons.'),
    (731, 1, 'It may look spindly,  but its neck muscles are heavy-duty. It can peck at a tree 16 times per second!'),
    (731, 2, 'Son cou fin renferme des muscles étonnamment puissants. Il tape contre les arbres à raison de seize coups de bec par seconde.'),
    (732, 1, 'From its mouth,  it fires the seeds of berries it has eaten. The scattered seeds give rise to new plants.'),
    (732, 2, 'Il crache violemment les noyaux des Baies qu’il a mangées. Ils s’éparpillent au sol et donnent naissance à de nouvelles plantes.'),
    (733, 1, 'Known for forming harmonious couples,  this Pokémon is brought to wedding ceremonies as a good luck charm.'),
    (733, 2, 'Les couples de Bazoucan sont réputés pour leur harmonie. On en amène souvent aux mariages pour porter bonheur aux jeunes époux.'),
    (734, 1, 'Although it will eat anything,  it prefers fresh living things,  so it marches down streets in search of prey.'),
    (734, 2, 'Il mange de tout,  mais aime particulièrement les proies fraîches,  voire encore vives. Il erre sur les routes à leur recherche.'),
    (735, 1, 'Patient by nature,  this Pokémon loses control of itself and pounces when it spots its favorite meal—Rattata!'),
    (735, 2, 'D’un naturel très patient,  il ne peut toutefois s’empêcher de bondir sur son plat favori,  Rattata,  s’il en voit un.'),
    (736, 1, 'It uses its big jaws to dig nests into the forest floor,  and it loves to feed on sweet tree sap.'),
    (736, 2, 'Il creuse son terrier dans le sol de la forêt avec ses grandes mandibules. Il raffole de la sève sucrée.'),
    (737, 1, 'Its digestive processes convert the leaves it eats into electricity. An electric sac in its belly stores the electricity for later use.'),
    (737, 2, 'Il possède une poche dans laquelle il emmagasine l’électricité qu’il produit en digérant des feuilles mortes.'),
    (738, 1, 'If it carries a Charjabug to use as a spare battery,  a flying Vikavolt can rapidly fire high-powered beams of electricity.'),
    (738, 2, 'S’il emporte un Chrysapile en tant que batterie de secours,  il peut tirer une salve de rayons électriques extrêmement puissants en plein vol.'),
    (739, 1, 'Crabrawler has been known to mistake Exeggutor for a coconut tree and climb it. The enraged Exeggutor shakes it off and stomps it.'),
    (739, 2, 'Il grimpe parfois sur un Noadkoko qu’il a pris pour un cocotier. Il se fait alors éjecter puis piétiner par le Noadkoko courroucé.'),
    (740, 1, 'Before it stops to think,  it just starts pummeling. There are records of its turning back avalanches with a flurry of punches.'),
    (740, 2, 'Agir ou réfléchir ? Crabominable choisit de frapper ! On raconte qu’il serait déjà parvenu à repousser une avalanche à coups de pince.'),
    (741, 1, 'This Oricorio has drunk red nectar. If its Trainer gives the wrong order,  this passionate Pokémon becomes fiercely angry.'),
    (741, 2, 'Un Plumeline ayant bu du Nectar Rouge. D’un naturel passionné,  il brûle de rage quand son Dresseur se trompe d’ordre.'),
    (742, 1, 'An opponent’s aura can tell Cutiefly what that opponent’s next move will be. Then Cutiefly can glide around the attack and strike back.'),
    (742, 2, 'Il perçoit l’aura de son ennemi et anticipe ses mouvements. Il parvient ainsi à éviter les attaques et à riposter dans la foulée.'),
    (743, 1, 'Ribombee absolutely hate getting wet or rained on. In the cloudy Galar region,  they are very seldom seen.'),
    (743, 2, 'Il a horreur d’être trempé par la pluie. On ne le voit que très rarement à Galar,  région connue pour son temps couvert.'),
    (744, 1, 'This Pokémon intimidates opponents by striking the ground with the rocks on its neck. The moment an opponent flinches,  Rockruff attacks.'),
    (744, 2, 'Il intimide ses ennemis en cognant les rochers autour de son cou contre le sol. Au premier signe de faiblesse,  il passe à l’assaut.'),
    (745, 1, 'With swift movements,  this Pokémon gradually backs its prey into a corner. Lycanroc’s fangs are always aimed toward opponents’ weak spots.'),
    (745, 2, 'Il poursuit ses proies avec rapidité et patience. Une fois la cible acculée,  il attaque toujours son point faible avec ses crocs.'),
    (746, 1, 'When it senses danger,  its eyes tear up. The sparkle of its tears signals other Wishiwashi to gather.'),
    (746, 2, 'Ses yeux se mouillent quand il sent le danger approcher. Le scintillement de ses larmes sert de signal pour que ses congénères se rassemblent.'),
    (747, 1, 'Unlike their Alolan counterparts,  the Mareanie of the Galar region have not yet figured out that the branches of Corsola are delicious.'),
    (747, 2, 'Contrairement aux Vorastérie d’Alola,  ceux de Galar ne font pas grand cas des cornes de Corayon.'),
    (748, 1, 'Within the poison sac in its body is a poison so toxic that Pokémon as large as Wailord will still be suffering three days after it first takes effect.'),
    (748, 2, 'Sa poche à venin interne regorge d’un poison si violent que même un Wailord en souffrirait pendant trois jours entiers.'),
    (749, 1, 'It eats dirt to create mud and smears this mud all over its feet,  giving them the grip needed to walk on rough terrain without slipping.'),
    (749, 2, 'Il mâche de la terre pour créer une boue dont il s’enduit les jambes. Celle-ci lui permet alors d’arpenter même les routes accidentées.'),
    (750, 1, 'Mudsdale has so much stamina that it could carry over 10 tons across the Galar region without rest or sleep.'),
    (750, 2, 'Il a assez d’endurance pour arpenter tout Galar sans relâche en tirant des charges dépassant les dix tonnes.'),
    (751, 1, 'Dewpider normally lives underwater. When it comes onto land in search of food,  it takes water with it in the form of a bubble on its head.'),
    (751, 2, 'Il vit principalement dans l’eau,  mais s’il a besoin de s’aventurer sur la terre ferme pour chasser ses proies,  il protège sa tête avec une bulle d’eau.'),
    (752, 1, 'It acts as a caretaker for Dewpider,  putting them inside its bubble and letting them eat any leftover food.'),
    (752, 2, 'Il prend soin de petits Araqua en les abritant dans sa bulle et en les laissant grignoter les restes de ses repas.'),
    (753, 1, 'During the day,  Fomantis basks in sunlight and sleeps peacefully. It wakes and moves around at night.'),
    (753, 2, 'La journée,  il dort tranquillement au soleil pour en absorber les rayons. La nuit,  il se réveille et vaque à ses occupations.'),
    (754, 1, 'The petals on this Pokémon’s arms are thin and super sharp,  and they can fire laser beams if Lurantis gathers light first.'),
    (754, 2, 'Les pétales sur ses deux bras sont fins,  mais très tranchants. Ils peuvent également absorber la lumière pour la renvoyer sous forme de laser.'),
    (755, 1, 'Morelull live in forests that stay dark even during the day. They scatter flickering spores that put enemies to sleep.'),
    (755, 2, 'Il vit dans les forêts sombres même en plein jour. Il dissémine des spores clignotantes pour endormir ses ennemis.'),
    (756, 1, 'If you see a light deep in a forest at night,  don’t go near. Shiinotic will make you fall fast asleep.'),
    (756, 2, 'Il ne faut pas s’approcher des lumières qui luisent la nuit au fond des bois,  sous peine de se faire endormir par un Lampignon.'),
    (757, 1, 'This sneaky Pokémon will slink behind its prey and immobilize it with poisonous gas before the prey even realizes Salandit is there.'),
    (757, 2, 'Il s’approche de ses proies par-derrière et les asperge d’un gaz empoisonné avant qu’elles n’aient le temps de réagir,  les clouant sur place.'),
    (758, 1, 'The winner of competitions between Salazzle is decided by which one has the most male Salandit with it.'),
    (758, 2, 'Les conflits entre Malamandre seraient réglés par un simple calcul : le spécimen dont la suite comporte le plus de Tritox l’emporte.'),
    (759, 1, 'The way it protects itself by flailing its arms may be an adorable sight,  but stay well away. This is flailing that can snap thick tree trunks.'),
    (759, 2, 'Sa façon de remuer les pattes pour se défendre semble adorable,  mais ce Pokémon est si puissant qu’il pourrait fendre un tronc de la sorte.'),
    (760, 1, 'The moves it uses to take down its prey would make a martial artist jealous. It tucks subdued prey under its arms to carry them to its nest.'),
    (760, 2, 'Il abat ses proies à l’aide de techniques à faire pâlir d’envie des combattants professionnels,  puis les emporte sous les bras dans sa tanière.'),
    (761, 1, 'When under attack,  it secretes a sweet and delicious sweat. The scent only calls more enemies to it.'),
    (761, 2, 'La sueur sucrée qu’il produit lorsqu’on l’attaque est délicieuse. L’odeur de celle-ci lui attire encore plus d’ennemis.'),
    (762, 1, 'Any Corvisquire that pecks at this Pokémon will be greeted with a smack from its sepals followed by a sharp kick.'),
    (762, 2, 'Lorsqu’un Bleuseille le picore,  il commence par se défendre avec son calice,  et lui assène ensuite de violents coups de pied.'),
    (763, 1, 'A kick from the hardened tips of this Pokémon’s legs leaves a wound in the opponent’s body and soul that will never heal.'),
    (763, 2, 'Ce Pokémon frappe violemment ses ennemis de la pointe dure de ses jambes,  ce qui leur inflige des dégâts irréversibles au corps et à l’âme.'),
    (764, 1, 'These Pokémon smell very nice. All Comfey wear different flowers,  so each of these Pokémon has its own individual scent.'),
    (764, 2, 'Ce Pokémon dégage un parfum agréable qui varie d’un spécimen à l’autre,  car chaque Guérilande s’habille de fleurs différentes.'),
    (765, 1, 'It knows the forest inside and out. If it comes across a wounded Pokémon,  Oranguru will gather medicinal herbs to treat it.'),
    (765, 2, 'Il connaît la forêt sur le bout des doigts. Lorsqu’il trouve un Pokémon blessé,  il cherche des plantes médicinales pour le soigner.'),
    (766, 1, 'Passimian live in groups of about 20,  with each member performing an assigned role. Through cooperation,  the group survives.'),
    (766, 2, 'Ils vivent en groupes de vingt individus où chacun a un rôle précis,  ce qui leur a permis de survivre dans un environnement impitoyable.'),
    (767, 1, 'Wimpod gather in swarms,  constantly on the lookout for danger. They scatter the moment they detect an enemy’s presence.'),
    (767, 2, 'Ils se déplacent en groupe,  toujours en alerte. Dès qu’ils détectent une présence ennemie,  ils s’enfuient dans toutes les directions.'),
    (768, 1, 'They live in sunken ships or in holes in the seabed. When Golisopod and Grapploct battle,  the loser becomes the winner’s meal.'),
    (768, 2, 'Il vit dans des trous ou des épaves au fond de l’océan. Il se bat souvent contre Krakos,  et le perdant sert de repas au gagnant.'),
    (769, 1, 'Sandygast mainly inhabits beaches. It takes control of anyone who puts their hand into its mouth,  forcing them to make its body bigger.'),
    (769, 2, 'Il vit principalement sur les plages de sable et peut agrandir son corps en prenant le contrôle des gens qui mettent la main dans sa gueule.'),
    (770, 1, 'This Pokémon lives on beaches,  but it hates water. Palossand can’t maintain its castle-like shape if it gets drenched by a heavy rain.'),
    (770, 2, 'Bien qu’il déteste l’eau,  il vit sur les plages. Quand la pluie s’abat sur lui,  il est incapable de conserver sa forme de château de sable.'),
    (771, 1, 'It lives in warm,  shallow waters. If it encounters a foe,  it will spit out its internal organs as a means to punch them.'),
    (771, 2, 'Le fluide visqueux qui le recouvre garde sa peau bien hydratée,  ce qui lui permet de vivre plusieurs jours sur la terre ferme sans se dessécher.'),
    (772, 1, 'It was modeled after a mighty Pokémon of myth. The mask placed upon it limits its power in order to keep it under control.'),
    (772, 2, 'Il a été créé artificiellement d’après un Pokémon mythique. Il est muni d’un masque afin de contenir sa puissance.'),
    (773, 1, 'The final factor needed to release this Pokémon’s true power was a strong bond with a Trainer it trusts.'),
    (773, 2, 'La relation de confiance qui le lie à son Dresseur est le facteur décisif qui lui permet de libérer tout son potentiel.'),
    (774, 1, 'Although its outer shell is uncommonly durable,  the shock of falling to the ground smashes the shell to smithereens.'),
    (774, 2, 'Sa carapace,  pourtant très solide,  éclate en mille morceaux quand il s’écrase sur la terre en tombant du ciel.'),
    (775, 1, 'It remains asleep from birth to death as a result of the sedative properties of the leaves that form its diet.'),
    (775, 2, 'Ce Pokémon passe sa vie entière à dormir à cause des composants anesthésiants qui se trouvent dans les feuilles qu’il mange.'),
    (776, 1, 'Eating sulfur in its volcanic habitat is what causes explosive compounds to develop in its shell. Its droppings are also dangerously explosive.'),
    (776, 2, 'Il vit dans les volcans. Le soufre dont il se nourrit rend sa carapace explosive. Même ses selles sont dangereuses,  car elles sont instables.'),
    (777, 1, 'When it’s in trouble,  it curls up into a ball,  makes its fur spikes stand on end,  and then discharges electricity indiscriminately.'),
    (777, 2, 'En cas de danger,  il se roule en boule,  dresse ses épines dorsales et lance des décharges électriques au hasard.'),
    (778, 1, 'There was a scientist who peeked under Mimikyu’s old rag in the name of research. The scientist died of a mysterious disease.'),
    (778, 2, 'Les malheureux chercheurs qui ont regardé sous son déguisement en lambeaux ont succombé à une mystérieuse maladie.'),
    (779, 1, 'Its skin is thick enough to fend off Mareanie’s spikes. With its robust teeth,  Bruxish crunches up the spikes and eats them.'),
    (779, 2, 'Sa peau est si épaisse que même les épines de Vorastérie ne peuvent la percer. Il les croque bruyamment grâce à ses dents solides.'),
    (780, 1, 'Drampa is a kind and friendly Pokémon—up until it’s angered. When that happens,  it stirs up a gale and flattens everything around.'),
    (780, 2, 'Il est d’un naturel sociable et aimable,  mais quand il se met en colère,  il déchaîne des bourrasques qui emportent tout sur leur passage.'),
    (781, 1, 'After lowering its anchor,  it waits for its prey. It catches large Wailord and drains their life-force.'),
    (781, 2, 'Il tend des guets-apens à ses proies en larguant son ancre dans la mer. Il peut absorber l’énergie vitale de grosses proies comme Wailord.'),
    (782, 1, 'Jangmo-o strikes its scales to communicate with others of its kind. Its scales are actually fur that’s become as hard as metal.'),
    (782, 2, 'Il communique avec ses congénères en faisant cliqueter ses écailles dures comme du métal.'),
    (783, 1, 'Before attacking its enemies,  it clashes its scales together and roars. Its sharp claws shred the opposition.'),
    (783, 2, 'Après avoir fait tinter ses écailles et poussé un terrible cri de guerre,  il charge ses ennemis et les lacère de ses griffes acérées.'),
    (784, 1, 'Certain ruins have paintings of ancient warriors wearing armor made of Kommo-o scales.'),
    (784, 2, 'Dans les ruines,  on trouve parfois des fresques représentant des guerriers antiques qui portent des armures faites avec ses écailles.'),
    (785, 1, 'The lightning-wielding guardian deity of Melemele,  Tapu Koko is brimming with curiosity and appears before people from time to time.'),
    (785, 2, 'Il est le gardien de Mele-Mele et le maître de la foudre. D’un naturel curieux,  il apparaît devant les humains de temps à autre.'),
    (786, 1, 'Although called a guardian deity,  Tapu Lele is devoid of guilt about its cruel disposition and can be described as nature incarnate.'),
    (786, 2, 'Bien qu’on le considère comme une divinité protectrice,  cette incarnation parfaite de la nature est aussi innocente que cruelle.'),
    (787, 1, 'It makes ringing sounds with its tail to let others know where it is,  avoiding unneeded conflicts. This guardian deity of Ula’ula controls plants.'),
    (787, 2, 'Il est le gardien d’Ula-Ula et le maître des plantes. Il évite les combats inutiles en faisant tinter sa queue pour signaler son arrivée.'),
    (788, 1, 'Although it’s called a guardian deity,  terrible calamities sometimes befall those who recklessly approach Tapu Fini.'),
    (788, 2, 'Il ne faut pas se laisser berner par son statut de divinité protectrice : il lui arrive de mettre en pièces ceux qui osent s’approcher de trop près.'),
    (789, 1, 'Cosmog is very curious but not very cautious,  often placing itself in danger. If things start to look dicey,  it teleports away.'),
    (789, 2, 'De nature curieuse et peu méfiante,  il se retrouve souvent dans des situations dangereuses. Il peut se téléporter en cas de danger.'),
    (790, 1, 'It sucks in dust from the air at an astounding rate,  frantically building up energy within its core as preparation for evolution.'),
    (790, 2, 'Il aspire avec force la poussière de l’atmosphère et travaille sans relâche pour produire dans son noyau l’énergie nécessaire à son évolution.'),
    (791, 1, 'Solgaleo was once known as the Beast That Devours the Sun. Energy in the form of light radiates boundlessly from it.'),
    (791, 2, 'Jadis,  on le surnommait « celui qui dévore le soleil ». Une lumière inextinguible rayonne de son corps.'),
    (792, 1, 'It steals the light from its surroundings and then becomes the full moon,  showering its own light across the night sky.'),
    (792, 2, 'Il capture toute la lumière qui l’entoure pour prendre la forme de la pleine lune et éclairer les ténèbres nocturnes.'),
    (793, 1, 'It appeared in this world from an Ultra Wormhole. Nihilego appears to be a parasite that lives by feeding on people and Pokémon.'),
    (793, 2, 'Il est venu dans ce monde à travers une Ultra-Brèche. Tel un parasite,  il aurait besoin d’un hôte,  Pokémon ou humain,  pour survivre.'),
    (794, 1, 'Buzzwole goes around showing off its abnormally swollen muscles. It is one kind of Ultra Beast.'),
    (794, 2, 'Ce type d’Ultra-Chimère adore exhiber ses muscles gonflés à l’extrême.'),
    (795, 1, 'Although it’s alien to this world and a danger here,  it’s apparently a common organism in the world where it normally lives.'),
    (795, 2, 'Cette créature venue d’ailleurs est dangereuse dans notre monde,  mais il semblerait qu’elle soit très commune dans le sien.'),
    (796, 1, 'They’ve been dubbed Ultra Beasts. Some of them stand unmoving,  like trees,  with their arms and legs stuck into the ground.'),
    (796, 2, 'Certains spécimens de ce type d’Ultra-Chimère plantent leurs membres dans le sol à la manière d’un arbre et restent immobiles.'),
    (797, 1, 'Although it’s alien to this world and a danger here,  it’s apparently a common organism in the world where it normally lives.'),
    (797, 2, 'Cette créature venue d’ailleurs est dangereuse dans notre monde,  mais il semblerait qu’elle soit très commune dans le sien.'),
    (798, 1, 'Although it’s alien to this world and a danger here,  it’s apparently a common organism in the world where it normally lives.'),
    (798, 2, 'Cette créature venue d’ailleurs est dangereuse dans notre monde,  mais il semblerait qu’elle soit très commune dans le sien.'),
    (799, 1, 'An unknown life-form called a UB. It may be constantly hungry—it is certainly always devouring something.'),
    (799, 2, 'Cette créature inconnue appelée « Ultra-Chimère » semble constamment affamée : elle mange en permanence.'),
    (800, 1, 'It needs light to survive,  and it goes on a rampage seeking it out. Its laser beams will cut anything to pieces.'),
    (800, 2, 'Sa quête de lumière,  sa source de vie,  le rend violent. Il détruit tout sur son passage avec ses rayons laser.'),
    (801, 1, 'Built roughly 500 years ago by a scientist,  the part called the Soul-Heart is the actual life-form.'),
    (801, 2, 'Il a été créé par un scientifique il y a environ 500 ans de cela. Sa véritable essence est un organe nommé Animacœur.'),
    (802, 1, 'This Pokémon can conceal itself in any shadow,  so it went undiscovered for a long time.'),
    (802, 2, 'Ce Pokémon ayant la capacité de se dissimuler dans les ombres,  il est resté très longtemps caché aux yeux du monde.'),
    (803, 1, 'An Ultra Beast that lives in a different world,  it cackles wildly as it sprays its opponents with poison from the needles on its head.'),
    (803, 2, 'Cette Ultra-Chimère venue d’un autre monde ricane lorsqu’elle asperge ses proies de venin grâce au dard qu’elle a sur la tête.'),
    (804, 1, 'One kind of Ultra Beast,  it fires a glowing,  venomous liquid from its needles. This liquid is also immensely adhesive.'),
    (804, 2, 'Cette Ultra-Chimère utilise son aiguillon pour sécréter un venin toxique,  luisant et gluant.'),
    (805, 1, 'When stone walls started moving and attacking,  the brute’s true identity was this mysterious life-form,  which brings to mind an Ultra Beast.'),
    (805, 2, 'On suppose que cette mystérieuse forme de vie est une Ultra-Chimère. Si un mur se met en branle et vous attaque sans prévenir,  c’est lui.'),
    (806, 1, 'A UB that appeared from an Ultra Wormhole,  it causes explosions,  then takes advantage of opponents’ surprise to rob them of their vitality.'),
    (806, 2, 'Cette Ultra-Chimère sortie d’une Ultra-Brèche provoque des explosions pour surprendre l’ennemi et en profite pour voler son énergie.'),
    (807, 1, 'Electricity sparks from the pads on its limbs. Wherever Zeraora runs,  lightning flashes and thunder echoes.'),
    (807, 2, 'Il envoie des décharges électriques avec les coussinets de ses pattes. Quand il court,  on peut voir des éclairs et entendre la foudre.'),
    (808, 1, 'They live as a group,  but when the time comes,  one strong Meltan will absorb all the others and evolve.'),
    (808, 2, 'Les Meltan vivent en groupe. Quand l’heure de l’évolution a sonné,  le plus fort d’entre eux absorbe ses camarades pour changer de forme.'),
    (809, 1, 'Centrifugal force is behind the punches of Melmetal’s heavy hex-nut arms. Melmetal is said to deliver the strongest punches of all Pokémon.'),
    (809, 2, 'On dit que,  grâce à la force centrifuge,  les coups de poing qu’il assène avec ses lourds écrous seraient les plus dévastateurs parmi les Pokémon.'),
    (810, 1, 'It attacks with rapid beats of its stick. As it strikes with amazing speed,  it gets more and more pumped.'),
    (810, 2, 'Il attaque en frappant frénétiquement avec son bâton. Son enthousiasme grandit à mesure que le rythme s’accélère.'),
    (811, 1, 'When it’s drumming out rapid beats in battle,  it gets so caught up in the rhythm that it won’t even notice that it’s already knocked out its opponent.'),
    (811, 2, 'Il est tellement concentré à battre à un rythme effréné que même lorsque son adversaire tombe K.O.,  il ne s’en rend pas compte.'),
    (812, 1, 'The one with the best drumming techniques becomes the boss of the troop. It has a gentle disposition and values harmony among its group.'),
    (812, 2, 'Celui qui possède les meilleures techniques de percussion devient le chef. De nature calme,  il privilégie l’harmonie du groupe.'),
    (813, 1, 'It has special pads on the backs of its feet,  and one on its nose. Once it’s raring to fight,  these pads radiate tremendous heat.'),
    (813, 2, 'Quand il est prêt à se battre,  la partie qui surmonte son museau ainsi que les coussinets de ses pattes postérieures émettent de la chaleur.'),
    (814, 1, 'It kicks berries right off the branches of trees and then juggles them with its feet,  practicing its footwork.'),
    (814, 2, 'Pour parfaire son jeu de jambes,  il cueille des Baies puis drible avec,  le tout sans se servir de ses mains.'),
    (815, 1, 'It’s skilled at both offense and defense,  and it gets pumped up when cheered on. But if it starts showboating,  it could put itself in a tough spot.'),
    (815, 2, 'Exceptionnel en attaque comme en défense,  il s’exalte quand on l’encourage,  mais il lui arrive de se mettre en danger en jouant solo.'),
    (816, 1, 'When it gets wet,  its skin changes color,  and this Pokémon becomes invisible as if it were camouflaged.'),
    (816, 2, 'Sa peau change de couleur et le rend invisible quand elle est mouillée,  comme un camouflage.'),
    (817, 1, 'Highly intelligent but also very lazy,  it keeps enemies out of its territory by laying traps everywhere.'),
    (817, 2, 'Paresseux,  mais malin,  il parsème son territoire de pièges pour empêcher ses ennemis d’y pénétrer.'),
    (818, 1, 'Its nictitating membranes let it pick out foes’ weak points so it can precisely blast them with water that shoots from its fingertips at Mach 3.'),
    (818, 2, 'Il repère le point faible de l’ennemi grâce à sa membrane nictitante,  puis il transperce sa cible en tirant des jets d’eau à Mach 3 du bout des doigts.'),
    (819, 1, 'It eats berries nonstop—a habit that has made it more resilient than it looks. It’ll show up on farms,  searching for yet more berries.'),
    (819, 2, 'Comme il mange tout le temps des Baies,  il est plus costaud qu’il n’en a l’air. Il parcourt les champs à la recherche de sa précieuse denrée.'),
    (820, 1, 'Common throughout the Galar region,  this Pokémon has strong teeth and can chew through the toughest of berry shells.'),
    (820, 2, 'On rencontre souvent ce Pokémon à Galar. Aucune coquille de Baie ne résiste à ses incisives,  dont il est très fier.'),
    (821, 1, 'Jumping nimbly about,  this small-bodied Pokémon takes advantage of even the slightest opportunity to disorient larger opponents.'),
    (821, 2, 'Son petit corps lui permet de se jouer d’ennemis bien plus grands que lui en volant à toute vitesse pour les piquer où ils sont vulnérables.'),
    (822, 1, 'The lessons of many harsh battles have taught it how to accurately judge an opponent’s strength.'),
    (822, 2, 'Après avoir surmonté tant de rudes combats,  il a appris à déterminer avec précision la puissance de ses adversaires.'),
    (823, 1, 'With their great intellect and flying skills,  these Pokémon very successfully act as the Galar region’s airborne taxi service.'),
    (823, 2, 'Grâce à son adresse remarquable en vol et sa grande intelligence,  il travaille comme taxi volant de Galar.'),
    (824, 1, 'Often found in gardens,  this Pokémon has hairs on its body that it uses to assess its surroundings.'),
    (824, 2, 'On le voit souvent dans les champs. Les poils de son corps lui servent à capter ce qu’il se passe autour de lui.'),
    (825, 1, 'As it grows inside its shell,  it uses its psychic abilities to monitor the outside world and prepare for evolution.'),
    (825, 2, 'Il se développe dans sa coquille et se prépare à évoluer en sondant les alentours grâce à ses pouvoirs psychiques.'),
    (826, 1, 'It emits psychic energy to observe and study what’s around it—and what’s around it can include things over six miles away.'),
    (826, 2, 'Il déploie ses pouvoirs psychiques pour sonder les alentours,  sur un rayon pouvant atteindre 10 km.'),
    (827, 1, 'Cunning and cautious,  this Pokémon survives by stealing food from others. It erases its tracks with swipes of its tail as it makes off with its plunder.'),
    (827, 2, 'Rusé et vigilant,  il prend la poudre d’escampette après avoir volé de la nourriture en prenant soin d’effacer ses traces de pas avec sa queue.'),
    (828, 1, 'With a lithe body and sharp claws,  it goes around stealing food and eggs. Boltund is its natural enemy.'),
    (828, 2, 'Grâce à son corps leste et ses griffes acérées,  il va et vient en dérobant Œufs et nourriture. Son ennemi juré est Fulgudog.'),
    (829, 1, 'It whirls around in the wind while singing a joyous song. This delightful display has charmed many into raising this Pokémon.'),
    (829, 2, 'Nombreux sont ceux qui ont décidé d’en élever un après avoir été charmés par sa manière de chanter en virevoltant au gré de la brise.'),
    (830, 1, 'The cotton on the head of this Pokémon can be spun into a glossy,  gorgeous yarn—a Galar regional specialty.'),
    (830, 2, 'Les fils tissés à partir du duvet sur sa tête sont satinés et absolument somptueux. Le textile ainsi créé est typique de la région de Galar.'),
    (831, 1, 'If its fleece grows too long,  Wooloo won’t be able to move. Cloth made with the wool of this Pokémon is surprisingly strong.'),
    (831, 2, 'Si ses poils poussent trop,  il ne peut plus bouger. Les étoffes tissées avec son pelage sont étonnamment solides.'),
    (832, 1, 'Its majestic horns are meant only to impress the opposite gender. They never see use in battle.'),
    (832, 2, 'Ses splendides cornes lui servent à attirer les membres de l’autre sexe. Il ne s’en sert jamais pour se battre.'),
    (833, 1, 'It starts off battles by attacking with its rock-hard horn,  but as soon as the opponent flinches,  this Pokémon bites down and never lets go.'),
    (833, 2, 'La corne sur sa tête est aussi dure que la roche. Il s’en sert pour se battre et lorsque l’ennemi flanche,  il le mord et ne le lâche plus.'),
    (834, 1, 'This Pokémon rapidly extends its retractable neck to sink its sharp fangs into distant enemies and take them down.'),
    (834, 2, 'Son cou extensible lui permet d’atteindre des ennemis éloignés en un instant pour leur porter un coup décisif avec ses crocs aiguisés.'),
    (835, 1, 'This gluttonous Pokémon only assists people with their work because it wants treats. As it runs,  it crackles with electricity.'),
    (835, 2, 'Ce glouton assiste les humains dans leur travail en échange de friandises. Il court sans arrêt,  le corps enveloppé d’électricité.'),
    (836, 1, 'It sends electricity through its legs to boost their strength. Running at top speed,  it easily breaks 50 mph.'),
    (836, 2, 'Il se sert de l’énergie électrique pour augmenter la puissance de ses membres. Sa vitesse maximale dépasse de peu les 90 km/h.'),
    (837, 1, 'It can race around like a unicycle,  even on rough,  rocky terrain. Burning coal sustains it.'),
    (837, 2, 'Il parcourt sans difficulté les sentiers rocheux accidentés à la manière d’un monocycle. Il a besoin de brûler du charbon pour vivre.'),
    (838, 1, 'By rapidly rolling its legs,  it can travel at over 18 mph. The temperature of the flames it breathes exceeds 1, 800 degrees Fahrenheit.'),
    (838, 2, 'Il peut faire tourner ses pattes très vite pour se déplacer à une vitesse de 30 km/h. Il peut aussi souffler des flammes à 1 000 °C.'),
    (839, 1, 'While it’s engaged in battle,  its mountain of coal will burn bright red,  sending off sparks that scorch the surrounding area.'),
    (839, 2, 'Lorsqu’il s’engage dans un combat,  son tas de charbon brûle et vire au rouge,  ce qui répand de petites étincelles qui calcinent ce qui l’entoure.'),
    (840, 1, 'As soon as it’s born,  it burrows into an apple. Not only does the apple serve as its food source,  but the flavor of the fruit determines its evolution.'),
    (840, 2, 'À la naissance,  il s’installe dans une pomme et grandit en se nourrissant de sa chair. Son évolution dépend de la saveur du fruit.'),
    (841, 1, 'It flies on wings of apple skin and spits a powerful acid. It can also change its shape into that of an apple.'),
    (841, 2, 'Il vole avec ses ailes faites de pelures de pomme et crache une substance très acide. Il peut aussi prendre la forme de ce fruit.'),
    (842, 1, 'Its body is covered in sweet nectar,  and the skin on its back is especially yummy. Children used to have it as a snack.'),
    (842, 2, 'Son corps est recouvert de nectar. La peau de son dos,  particulièrement sucrée,  constituait jadis le goûter des enfants.'),
    (843, 1, 'It spews sand from its nostrils. While the enemy is blinded,  it burrows into the ground to hide.'),
    (843, 2, 'En expulsant du sable par les narines,  il aveugle son adversaire et en profite pour se cacher sous terre.'),
    (844, 1, 'Its unique style of coiling allows it to blast sand out of its sand sac more efficiently.'),
    (844, 2, 'S’il s’enroule d’une manière aussi particulière,  c’est pour optimiser l’expulsion de sable par ses narines.'),
    (845, 1, 'This hungry Pokémon swallows Arrokuda whole. Occasionally,  it makes a mistake and tries to swallow a Pokémon other than its preferred prey.'),
    (845, 2, 'Très glouton,  il avale les Embrochet d’une seule bouchée,  mais il lui arrive de se tromper et de tenter de gober un autre Pokémon.'),
    (846, 1, 'After it’s eaten its fill,  its movements become extremely sluggish. That’s when Cramorant swallows it up.'),
    (846, 2, 'Lorsqu’il a le ventre plein,  il a beaucoup plus de mal à se déplacer,  et c’est à ce moment précis qu’il se fait gober par les Nigosier.'),
    (847, 1, 'It spins its tail fins to propel itself,  surging forward at speeds of over 100 knots before ramming prey and spearing into them.'),
    (847, 2, 'Il charge d’un coup en faisant tourner sa nageoire caudale. Il peut transpercer ses proies à une vitesse dépassant les 100 nœuds.'),
    (848, 1, 'It manipulates the chemical makeup of its poison to produce electricity. The voltage is weak,  but it can cause a tingling paralysis.'),
    (848, 2, 'Par un procédé chimique,  il change son poison en électricité. L’intensité du courant est faible,  mais peut engourdir un ennemi.'),
    (849, 1, 'This short-tempered and aggressive Pokémon chugs stagnant water to absorb any toxins it might contain.'),
    (849, 2, 'Impatient et bagarreur,  ce Pokémon avale de grandes gorgées d’eau croupie pour en absorber toute la toxicité.'),
    (850, 1, 'It wraps prey up with its heated body,  cooking them in its coils. Once they’re well-done,  it will voraciously nibble them down to the last morsel.'),
    (850, 2, 'Il enserre fermement ses proies avec son corps brûlant et,  quand elles sont bien grillées,  il les dévore.'),
    (851, 1, 'While its burning body is already dangerous on its own,  this excessively hostile Pokémon also has large and very sharp fangs.'),
    (851, 2, 'Il est de nature agressive. Non seulement son corps brûlant est dangereux,  mais il possède en plus d’énormes crocs très pointus.'),
    (852, 1, 'Its tentacles tear off easily,  but it isn’t alarmed when that happens—it knows they’ll grow back. It’s about as smart as a three-year-old.'),
    (852, 2, 'Il a l’intelligence d’un enfant de trois ans. Il perd souvent ses tentacules,  mais comme ils repoussent,  il ne s’en soucie guère.'),
    (853, 1, 'Searching for an opponent to test its skills against,  it emerges onto land. Once the battle is over,  it returns to the sea.'),
    (853, 2, 'Mû par le besoin de tester la force de ses bras,  il se rend sur la terre ferme pour trouver un adversaire. Il retourne à l’eau après le combat.'),
    (854, 1, 'The teacup in which this Pokémon makes its home is a famous piece of antique tableware. Many forgeries are in circulation.'),
    (854, 2, 'Il élit domicile dans des tasses de thé anciennes de grand renom. Parmi celles-ci se trouvent de nombreuses contrefaçons.'),
    (855, 1, 'Leaving leftover black tea unattended is asking for this Pokémon to come along and pour itself into it,  turning the tea into a new Polteageist.'),
    (855, 2, 'Dès qu’il voit un reste de thé noir,  il se verse dedans pour donner naissance à un Polthégeist.'),
    (856, 1, 'If this Pokémon senses a strong emotion,  it will run away as fast as it can. It prefers areas without people.'),
    (856, 2, 'Il aime les lieux inhabités. S’il perçoit des émotions trop fortes,  il s’enfuit aussi vite que possible.'),
    (857, 1, 'Using the braids on its head,  it pummels foes to get them to quiet down. One blow from those braids would knock out a professional boxer.'),
    (857, 2, 'Il frappe ses ennemis avec ses tresses pour les faire taire. Sa puissance est telle qu’il peut mettre K.O. un boxeur professionnel d’un seul coup.'),
    (858, 1, 'If you’re too loud around it,  you risk being torn apart by the claws on its tentacle. This Pokémon is also known as the Forest Witch.'),
    (858, 2, 'On l’appelle aussi la « sorcière de la forêt ». Ce Pokémon lacère quiconque fait trop de bruit avec les griffes de son tentacule.'),
    (859, 1, 'It sneaks into people’s homes,  stealing things and feasting on the negative energy of the frustrated occupants.'),
    (859, 2, 'Il se glisse dans les foyers pour commettre un larcin et en profite pour se nourrir de l’énergie négative des habitants contrariés.'),
    (860, 1, 'With sly cunning,  it tries to lure people into the woods. Some believe it to have the power to make crops grow.'),
    (860, 2, 'La nuit,  il ruse pour attirer ses proies dans la forêt. On raconte qu’il a le pouvoir de faire pousser les cultures agricoles.'),
    (861, 1, 'Its hairs work like muscle fibers. When its hairs unfurl,  they latch on to opponents,  ensnaring them as tentacles would.'),
    (861, 2, 'Ses cheveux sont comme des muscles filandreux qu’il peut détacher pour saisir ses adversaires,  tels des tentacules.'),
    (862, 1, 'It evolved after experiencing numerous fights. While crossing its arms,  it lets out a shout that would make any opponent flinch.'),
    (862, 2, 'Il a évolué après avoir enchaîné de nombreux combats. Le cri qu’il pousse lorsqu’il fait un « X » avec ses bras ébranle n’importe quel ennemi.'),
    (863, 1, 'After many battles,  it evolved dangerous claws that come together to form daggers when extended.'),
    (863, 2, 'Il s’est tant adonné au combat qu’il a évolué : il est désormais doté de griffes redoutables qui prennent la forme de dagues en s’allongeant.'),
    (864, 1, 'Be cautious of the ectoplasmic body surrounding its soul. You’ll become stiff as stone if you touch it.'),
    (864, 2, 'Ceux qui ont le malheur de toucher le corps spirituel qui protège son noyau se retrouveront immobilisés,  comme changés en pierre.'),
    (865, 1, 'After deflecting attacks with its hard leaf shield,  it strikes back with its sharp leek stalk. The leek stalk is both weapon and food.'),
    (865, 2, 'Il pare les attaques avec le tranchant de son solide poireau,  et contre-attaque avec la pointe de la tige. Son arme est également comestible.'),
    (866, 1, 'Its amusing movements make it very popular. It releases its psychic power from the pattern on its belly.'),
    (866, 2, 'Ses gestes hilarants le rendent très populaire. Il peut libérer ses pouvoirs psychiques depuis le motif sur son ventre.'),
    (867, 1, 'Never touch its shadowlike body,  or you’ll be shown the horrific memories behind the picture carved into it.'),
    (867, 2, 'Quiconque touchera son corps semblable à une ombre devra endurer la vision des souvenirs effroyables gravés dans ses motifs.'),
    (868, 1, 'They say that any patisserie visited by Milcery is guaranteed success and good fortune.'),
    (868, 2, 'Les pâtissiers connaissent tous ce vieil adage : Quand Crèmy apparaît,  le succès est assuré.'),
    (869, 1, 'When Alcremie is content,  the cream it secretes from its hands becomes sweeter and richer.'),
    (869, 2, 'Quand il est heureux,  la crème qu’il produit avec ses mains devient plus sucrée et plus onctueuse.'),
    (870, 1, 'The six of them work together as one Pokémon. Teamwork is also their battle strategy,  and they constantly change their formation as they fight.'),
    (870, 2, 'À six,  ils représentent un Pokémon unique. Ils peuvent changer de formation et comptent sur leur travail d’équipe en combat.'),
    (871, 1, 'It stores electricity in each spine. Even if one gets broken off,  it still continues to emit electricity for at least three hours.'),
    (871, 2, 'Chacune de ses épines est chargée en électricité. S’il en perd une,  celle-ci continue d’émettre un courant électrique pendant trois heures.'),
    (872, 1, 'It eats snow that piles up on the ground. The more snow it eats,  the bigger and more impressive the spikes on its back grow.'),
    (872, 2, 'Il se nourrit de la neige entassée sur le sol. Plus il en mange,  plus les épines sur son dos grandissent.'),
    (873, 1, 'It shows no mercy to any who desecrate fields and mountains. It will fly around on its icy wings,  causing a blizzard to chase offenders away.'),
    (873, 2, 'Sans pitié pour les vandales,  il bat ses ailes gelées pour provoquer des blizzards et punir quiconque ose souiller les champs et les collines.'),
    (874, 1, 'Once a year,  on a specific date and at a specific time,  they gather out of nowhere and form up in a circle.'),
    (874, 2, 'Tous les ans à la même date,  ils arrivent de nulle part pour se réunir en cercle. C’est une de leurs coutumes.'),
    (875, 1, 'This Pokémon keeps its heat-sensitive head cool with ice. It fishes for its food,  dangling its single hair into the sea to lure in prey.'),
    (875, 2, 'Ne supportant pas la chaleur,  il se rafraîchit toujours la tête avec de la glace. Il pêche de quoi se nourrir à l’aide de son cheveu.'),
    (876, 1, 'Through its horns,  it can pick up on the emotions of creatures around it. Positive emotions are the source of its strength.'),
    (876, 2, 'Avec ses cornes,  il peut percevoir les émotions des êtres vivants alentour. Celles qui sont positives lui servent de source d’énergie.'),
    (877, 1, 'It carries electrically roasted seeds with it as if they’re precious treasures. No matter how much it eats,  it always gets hungry again in short order.'),
    (877, 2, 'Il a beau manger,  il a tout le temps faim. Il a toujours des graines grillées à l’électricité sur lui.'),
    (878, 1, 'If a job requires serious strength,  this Pokémon will excel at it. Its copper body tarnishes in the rain,  turning a vibrant green color.'),
    (878, 2, 'Les travaux physiques,  c’est son affaire. Son corps de cuivre rouille sous la pluie et prend une vive couleur verte.'),
    (879, 1, 'These Pokémon live in herds. Their trunks have incredible grip strength,  strong enough to crush giant rocks into powder.'),
    (879, 2, 'Ces Pokémon vivent en troupeau. L’étreinte de leur trompe est si forte qu’elle suffit à réduire un rocher en poussière.'),
    (880, 1, 'The powerful muscles in its tail generate its electricity. Compared to its lower body,  its upper half is entirely too small.'),
    (880, 2, 'Il envoie des décharges avec les muscles puissants de sa queue. La partie supérieure de son corps est trop petite par rapport à la partie inférieure.'),
    (881, 1, 'This Pokémon lived on prehistoric seashores and was able to preserve food with the ice on its body. It went extinct because it moved so slowly.'),
    (881, 2, 'Autrefois,  il vivait en bord de mer et conservait sa nourriture dans la glace de son corps,  mais il s’est éteint,  car il avait du mal à se déplacer.'),
    (882, 1, 'Its mighty legs are capable of running at speeds exceeding 40 mph,  but this Pokémon can’t breathe unless it’s underwater.'),
    (882, 2, 'Ses pattes robustes lui permettent de courir à plus de 60 km/h,  mais en revanche,  il ne peut respirer que sous l’eau.'),
    (883, 1, 'The skin on its face is impervious to attack,  but breathing difficulties made this Pokémon go extinct anyway.'),
    (883, 2, 'Aucune attaque ne pouvait égratigner la peau de son visage,  mais il s’est éteint,  car il avait du mal à respirer.'),
    (884, 1, 'The special metal that composes its body is very light,  so this Pokémon has considerable agility. It lives in caves because it dislikes the rain.'),
    (884, 2, 'Son corps,  composé d’un métal spécial,  est léger et lui offre une excellente mobilité. Il est toutefois sensible à la pluie et vit donc dans les grottes.'),
    (885, 1, 'If this weak Pokémon is by itself,  a mere child could defeat it. But if Dreepy has friends to help it train,  it can evolve and become much stronger.'),
    (885, 2, 'Seul,  il est si faible qu’il ne saurait rivaliser avec un enfant,  mais en coopérant avec ses semblables,  il peut devenir assez fort pour évoluer.'),
    (886, 1, 'Without a Dreepy to place on its head and care for,  it gets so uneasy it’ll try to substitute any Pokémon it finds for the missing Dreepy.'),
    (886, 2, 'Il prend soin du Fantyrm sur sa tête. Quand ce dernier n’est plus là,  il panique et tente de le remplacer par un autre Pokémon.'),
    (887, 1, 'Apparently the Dreepy inside Dragapult’s horns eagerly look forward to being launched out at Mach speeds.'),
    (887, 2, 'Il paraît que les Fantyrm installés dans ses cornes attendent impatiemment le moment où ils seront propulsés à la vitesse du son.'),
    (888, 1, 'This Pokémon has slumbered for many years. Some say it’s Zamazenta’s elder sister—others say the two Pokémon are rivals.'),
    (888, 2, 'On dit qu’il s’agit de la figure fraternelle et du rival de Zamazenta,  un Pokémon plongé dans un long sommeil.'),
    (889, 1, 'This Pokémon slept for aeons while in the form of a statue. It was asleep for so long,  people forgot that it ever existed.'),
    (889, 2, 'Ce Pokémon,  changé en statue,  est resté pétrifié si longtemps qu’il a failli tomber dans l’oubli.'),
    (890, 1, 'It was inside a meteorite that fell 20, 000 years ago. There seems to be a connection between this Pokémon and the Dynamax phenomenon.'),
    (890, 2, 'Il se trouvait dans une météorite qui s’est écrasée il y a 20 000 ans. Il semble y avoir un lien entre ce Pokémon et le phénomène Dynamax.'),
    (891, 1, 'If Kubfu pulls the long white hair on its head,  its fighting spirit heightens and power wells up from the depths of its belly.'),
    (891, 2, 'Lorsqu’il tire sur les longs poils blancs sur sa tête,  il devient plus combatif et de l’énergie jaillit de sous son nombril.'),
    (892, 1, 'Inhabiting the mountains of a distant region,  this Pokémon races across sheer cliffs,  training its legs and refining its moves.'),
    (892, 2, 'Il vit dans une lointaine région montagneuse où il peaufine ses techniques et muscle ses jambes en courant le long des falaises abruptes.'),
    (893, 1, 'Once the vines on Zarude’s body tear off,  they become nutrients in the soil. This helps the plants of the forest grow.'),
    (893, 2, 'Lorsque ses lianes se détachent de son corps,  elles fertilisent le sol et favorisent la croissance des plantes de la forêt.'),
    (894, 1, 'Its entire body is made up of a single organ that generates electrical energy. Regieleki is capable of creating all Galar’s electricity.'),
    (894, 2, 'Son corps est entièrement composé d’organes générant de l’électricité. Il peut produire assez d’énergie pour alimenter tout Galar.'),
    (895, 1, 'Its body is composed of crystallized dragon energy. Regidrago is said to have the powers of every dragon Pokémon.'),
    (895, 2, 'Son corps est entièrement composé de cristaux d’énergie draconique. Il possèderait les pouvoirs de tous les Pokémon Dragon.'),
    (896, 1, 'Glastrier has tremendous physical strength,  and the mask of ice covering its face is 100 times harder than diamond.'),
    (896, 2, 'Ce Pokémon à la force hors du commun porte un masque composé de glace cent fois plus solide que le diamant.'),
    (897, 1, 'As it dashes through the night,  Spectrier absorbs the life-force of sleeping creatures. It craves silence and solitude.'),
    (897, 2, 'Ce Pokémon friand de silence et de solitude galope à travers les ténèbres nocturnes et aspire l’énergie vitale des êtres endormis.'),
    (898, 1, 'Calyrex is known in legend as a king that ruled over Galar in ancient times. It has the power to cause hearts to mend and plants to spring forth.'),
    (898, 2, 'Ce roi légendaire qui a régné sur Galar il y a fort longtemps possède le pouvoir d’apaiser les cœurs et de faire germer les plantes.'),
    (899, 1, 'The black orbs shine with an uncanny light when the Pokémon is erecting invisible barriers. The fur shed from its beard retains heat well and is a highly useful material for winter clothing.'),
    (900, 1, 'A violent creature that fells towering trees with its crude axes and shields itself with hard stone. If one should chance upon this Pokémon in the wilds,  one\'s only recourse is to flee.'),
    (901, 1, 'I believe it was Hisui\'s swampy terrain that gave Ursaluna its burly physique and newfound capacity to manipulate peat at will.'),
    (902, 1, 'Clads itself in the souls of comrades that perished before fulfilling their goals of journeying upstream. No other species throughout all Hisui\'s rivers is Basculegion\'s equal.'),
    (903, 1, 'Because of Sneasler\'s virulent poison and daunting physical prowess,  no other species could hope to best it on the frozen highlands. Preferring solitude,  this species does not form packs.'),
    (904, 1, 'Its lancelike spikes and savage temperament have earned it the nickname ”sea fiend.” It slurps up poison to nourish itself.'),
    (905, 1, 'When it flies to this land from across the sea,  the bitter winter comes to an end. According to legend,  this Pokémon\'s love gives rise to the budding of fresh life across Hisui.'),
    (906, 1, 'The sweet scent its body gives off mesmerizes those around it. The scent grows stronger when this Pokémon is in the sun.'),
    (907, 1, 'The hardness of Floragato’s fur depends on the Pokémon’s mood. When Floragato is prepared to battle,  its fur becomes pointed and needle sharp.'),
    (908, 1, 'With skillful misdirection,  it rigs foes with pollen-packed flower bombs. Meowscarada sets off the bombs before its foes realize what’s going on.'),
    (909, 1, 'Its flame sac is small,  so energy is always leaking out. This energy is released from the dent atop Fuecoco’s head and flickers to and fro.'),
    (910, 1, 'The valve in Crocalor’s flame sac is closely connected to its vocal cords. This Pokémon utters a guttural cry as it spews flames every which way.'),
    (911, 1, 'Skeledirge’s gentle singing soothes the souls of all that hear it. It burns its enemies to a crisp with flames of over 5, 400 degrees Fahrenheit.'),
    (912, 1, 'Its strong legs let it easily swim around in even fast-flowing rivers. It likes to keep things tidy and is prone to overthinking things.'),
    (913, 1, 'The hardworking Quaxwell observes people and Pokémon from various regions and incorporates their movements into its own dance routines.'),
    (914, 1, 'Dancing in ways that evoke far-away places,  this Pokémon mesmerizes all that see it. Flourishes of its decorative water feathers slice into its foes.'),
    (915, 1, 'This Pokémon spurns all but the finest of foods. Its body gives off an herblike scent that bug Pokémon detest.'),
    (916, 1, 'It entrances female Pokémon with the sweet,  alluring scent that wafts from all over its body.'),
    (917, 1, 'The thread it secretes from its rear is as strong as wire. The secret behind the thread’s strength is the topic of ongoing research.'),
    (918, 1, 'Spidops covers its territory in tough,  sticky threads to set up traps for intruders.'),
    (919, 1, 'It’s highly skilled at a fighting style in which it uses its jumping capabilities to dodge incoming attacks while also dealing damage to opponents.'),
    (920, 1, 'It uses its normally folded third set of legs when in Showdown Mode. This places a huge burden on its body,  so it can’t stay in this mode for long.'),
    (921, 1, 'The pads of its paws are electricity-discharging organs. Pawmi fires electricity from its forepaws while standing unsteadily on its hind legs.'),
    (922, 1, 'Pawmo uses a unique fighting technique in which it uses its forepaws to strike foes and zap them with electricity from its paw pads simultaneously.'),
    (923, 1, 'Pawmot’s fluffy fur acts as a battery. It can store the same amount of electricity as an electric car.'),
    (924, 1, 'The pair sticks together no matter what. They split any food they find exactly in half and then eat it together.'),
    (925, 1, 'The larger pair protects the little ones during battles. When facing strong opponents,  the whole group will join the fight.'),
    (926, 1, 'The yeast in Fidough’s breath is useful for cooking,  so this Pokémon has been protected by people since long ago.'),
    (927, 1, 'The surface of this Pokémon’s skin hardens when exposed to intense heat,  and its body has an appetizing aroma.'),
    (928, 1, 'This Pokémon converts nutrients into oil,  which it stores in the fruit on its head. It can easily go a whole week without eating or drinking.'),
    (929, 1, 'It basks in the sun to its heart’s content until the fruits on its head ripen. After that,  Dolliv departs from human settlements and goes on a journey.'),
    (930, 1, 'This Pokémon drives back enemies by launching its rich,  aromatic oil at them with enough force to smash a boulder.'),
    (931, 1, 'Green-feathered flocks hold the most sway. When they’re out searching for food in the mornings and evenings,  it gets very noisy.'),
    (932, 1, 'The ground scrapes its body as it travels,  causing it to leave salt behind. Salt is constantly being created and replenished inside Nacli’s body.'),
    (933, 1, 'It compresses rock salt inside its body and shoots out hardened salt pellets with enough force to perforate an iron sheet.'),
    (934, 1, 'Many Pokémon gather around Garganacl,  hoping to lick at its mineral-rich salt.'),
    (935, 1, 'Its firepower increases when it fights,  reaching over 1, 800 degrees Fahrenheit. It likes berries that are rich in fat.'),
    (936, 1, 'This Pokémon clads itself in armor that has been fortified by psychic and fire energy,  and it shoots blazing fireballs.'),
    (937, 1, 'An old set of armor steeped in grudges caused this Pokémon’s evolution. Ceruledge cuts its enemies to pieces without mercy.'),
    (938, 1, 'It floats using the electricity stored in its body. When thunderclouds are around,  Tadbulb will float higher off the ground.'),
    (939, 1, 'What appear to be eyeballs are actually organs for discharging the electricity generated by Bellibolt’s belly-button dynamo.'),
    (940, 1, 'These Pokémon make their nests on coastal cliffs. The nests have a strange,  crackling texture,  and they’re a popular delicacy.'),
    (941, 1, 'It uses its throat sac to store electricity generated by its wings. There’s hardly any oil in its feathers,  so it is a poor swimmer.'),
    (942, 1, 'Its well-developed jaw and fangs are strong enough to crunch through boulders,  and its thick fat makes for an excellent defense.'),
    (943, 1, 'Mabosstiff loves playing with children. Though usually gentle,  it takes on an intimidating look when protecting its family.'),
    (944, 1, 'To keep enemies away from its territory,  it paints markings around its nest using a poisonous liquid that has an acrid odor.'),
    (945, 1, 'Each Grafaiai paints its own individual pattern,  and it will paint that same pattern over and over again throughout its life.'),
    (946, 1, 'Not even Bramblin knows where it is headed as it tumbles across the wilderness,  blown by the wind. It loathes getting wet.'),
    (947, 1, 'Brambleghast wanders around arid regions. On rare occasions,  mass outbreaks of these Pokémon will bury an entire town.'),
    (948, 1, 'Though it looks like Tentacool,  Toedscool is a completely different species. Its legs may be thin,  but it can run at a speed of 30 mph.'),
    (949, 1, 'It coils its 10 tentacles around prey and sucks out their nutrients,  causing the prey pain. The folds along the rim of its head are a popular delicacy.'),
    (950, 1, 'This Pokémon lives on sheer cliffs. It sidesteps opponents’ attacks,  then lunges for their weak spots with its claws.'),
    (951, 1, 'Traditional Paldean dishes can be extremely spicy because they include the shed front teeth of Capsakid among their ingredients.'),
    (952, 1, 'The green head has turned vicious due to the spicy chemicals stimulating its brain. Once it goes on a rampage,  there is no stopping it.'),
    (953, 1, 'It rolls its mud ball around while the energy it needs for evolution matures. Eventually the time comes for it to evolve.'),
    (954, 1, 'An infant sleeps inside the ball. Rabsca rolls the ball soothingly with its legs to ensure the infant sleeps comfortably.'),
    (955, 1, 'It spends its time running around wastelands. If anyone steals its beloved berries,  it will chase them down and exact its revenge.'),
    (956, 1, 'It emits psychic power from the gaps between its multicolored frills and sprints at speeds greater than 120 mph.'),
    (957, 1, 'This Pokémon pounds iron scraps together to make a hammer. It will remake the hammer again and again until it’s satisfied with the result.'),
    (958, 1, 'These Pokémon make their homes in piles of scrap metal. They test the strength of each other’s hammers by smashing them together.'),
    (959, 1, 'The hammer tops 220 pounds,  yet it gets swung around easily by Tinkaton as it steals whatever it pleases and carries its plunder back home.'),
    (960, 1, 'Though it looks like Diglett,  Wiglett is an entirely different species. The resemblance seems to be a coincidental result of environmental adaptation.'),
    (961, 1, 'A variety of fish Pokémon,  Wugtrio was once considered to be a regional form of Dugtrio.'),
    (962, 1, 'Bombirdier uses the apron on its chest to bundle up food,  which it carries back to its nest. It enjoys dropping things that make loud noises.'),
    (963, 1, 'Its water ring is made from seawater mixed with a sticky fluid that Finizen secretes from its blowhole.'),
    (964, 1, 'Its physical capabilities are no different than a Finizen’s,  but when its allies are in danger,  it transforms and powers itself up.'),
    (965, 1, 'The steel section is Varoom’s actual body. This Pokémon clings to rocks and converts the minerals within into energy to fuel its activities.'),
    (966, 1, 'Revavroom viciously threatens others with the sound of its exhaust. It sticks its tongue out from its cylindrical mouth and sprays toxic fluids.'),
    (967, 1, 'It can sprint at over 70 mph while carrying a human. The rider’s body heat warms Cyclizar’s back and lifts the Pokémon’s spirit.'),
    (968, 1, 'This Pokémon lives in arid deserts. It maintains its metal body by consuming iron from the soil.'),
    (969, 1, 'Glimmet’s toxic mineral crystals look just like flower petals. This Pokémon scatters poisonous powder like pollen to protect itself.'),
    (970, 1, 'Glimmora’s petals are made of crystallized poison energy. It has recently become evident that these petals resemble Tera Jewels.'),
    (971, 1, 'This friendly Pokémon doesn’t like being alone. Pay it even the slightest bit of attention,  and it will follow you forever.'),
    (972, 1, 'A lovingly mourned Pokémon was reborn as Houndstone. It doesn’t like anyone touching the protuberance atop its head.'),
    (973, 1, 'Thanks to a behavior of theirs known as “synchronizing, ” an entire flock of these Pokémon can attack simultaneously in perfect harmony.'),
    (974, 1, 'It lives in frigid regions in pods of five or so individuals. It loves the minerals found in snow and ice.'),
    (975, 1, 'Ice energy builds up in the horn on its upper jaw,  causing the horn to reach cryogenic temperatures that freeze its surroundings.'),
    (976, 1, 'Veluza has excellent regenerative capabilities. It sheds spare flesh from its body to boost its agility,  then charges at its prey.'),
    (977, 1, 'It treats Tatsugiri like its boss and follows it loyally. Though powerful,  Dondozo is apparently not very smart.'),
    (978, 1, 'Tatsugiri is an extremely cunning Pokémon. It feigns weakness to lure in prey,  then orders its partner to attack.'),
    (979, 1, 'It imbues its fists with the power of the rage that it kept hidden in its heart. Opponents struck by these imbued fists will be shattered to their core.'),
    (980, 1, 'It lives at the bottom of ponds and swamps. It will carry Wooper on its back and ferry them across water from one shore to the other.'),
    (981, 1, 'The hardened head from the tail protects the head of the main body as Farigiraf whips its long neck around to headbutt enemies.'),
    (982, 1, 'It drives enemies out of its nest by sucking in enough air to fill its long,  narrow lungs,  then releasing the air in an intense blast.'),
    (983, 1, 'Though it commands a massive army in battle,  it’s not skilled at devising complex strategies. It just uses brute strength to keep pushing.'),
    (984, 1, 'This creature resembles a mysterious Pokémon that,  according to a paranormal magazine,  has lived since ancient times.'),
    (985, 1, 'It resembles a mysterious Pokémon described in a paranormal magazine as a Jigglypuff from one billion years ago.'),
    (986, 1, 'It bears a slight resemblance to a Pokémon described in a dubious magazine as a cross between a dinosaur and a mushroom.'),
    (987, 1, 'It has similar features to a ghostly pterosaur that was covered in a paranormal magazine,  but the two have little else in common.'),
    (988, 1, 'This Pokémon somewhat resembles an ancient form of Volcarona that was introduced in a dubious magazine.'),
    (989, 1, 'It slightly resembles a Magneton that lived for 10, 000 years and was featured in an article in a paranormal magazine.'),
    (990, 1, 'Sightings of this Pokémon have occurred in recent years. It resembles a mysterious object described in an old expedition journal.'),
    (991, 1, 'It resembles a mysterious object mentioned in an old book. There are only two reported sightings of this Pokémon.'),
    (992, 1, 'This Pokémon shares many similarities with Iron Hands,  an object mentioned in a certain expedition journal.'),
    (993, 1, 'It’s possible that Iron Jugulis,  an object described in an old book,  may actually be this Pokémon.'),
    (994, 1, 'No records exist of this species being caught. Data is lacking,  but the Pokémon’s traits match up with an object described in an old book.'),
    (995, 1, 'Some of its notable features match those of an object named within a certain expedition journal as Iron Thorns.'),
    (996, 1, 'This Pokémon lives in forests and craggy areas. Using the power of its dorsal fin,  it cools the inside of its nest like a refrigerator.'),
    (997, 1, 'It attacks with the blade of its frozen dorsal fin by doing a front flip in the air. Arctibax’s strong back and legs allow it to pull off this technique.'),
    (998, 1, 'It launches itself into battle by flipping upside down and spewing frigid air from its mouth. It finishes opponents off with its dorsal blade.'),
    (999, 1, 'It lives inside an old treasure chest. Sometimes it gets left in shop corners since no one realizes it’s actually a Pokémon.'),
    (1000, 1, 'It has a sturdy body made up of stacked coins. Gholdengo overwhelms its enemies by firing coin after coin at them in quick succession.'),
    (1001, 1, 'It drains the life-force from vegetation,  causing nearby forests to instantly wither and fields to turn barren.'),
    (1002, 1, 'The hatred of those who perished by the sword long ago has clad itself in snow and become a Pokémon.'),
    (1003, 1, 'It slowly brings its exceedingly heavy head down upon the ground,  splitting the earth open with huge fissures that run over 160 feet deep.'),
    (1004, 1, 'The envy accumulated within curved beads that sparked multiple conflicts has clad itself in fire and become a Pokémon.'),
    (1005, 1, 'According to an article in a dubious magazine,  this Pokémon has some connection to a phenomenon that occurs in a certain region.'),
    (1006, 1, 'It’s possible that this is the object listed as Iron Valiant in a certain expedition journal.'),
    (1007, 1, 'This Pokémon resembles Cyclizar,  but it is far burlier and more ferocious. Nothing is known about its ecology or other features.'),
    (1008, 1, 'This seems to be the Iron Serpent mentioned in an old book. The Iron Serpent is said to have turned the land to ash with its lightning.'),
    (1009, 1, 'It resembles an illustration published in a paranormal magazine,  said to be a depiction of a super-ancient Suicune.'),
    (1010, 1, 'According to the few eyewitness accounts that exist,  it used its shining blades to julienne large trees and boulders.'),
    (1011, 1, 'The head sticking out belongs to the fore-wyrm,  while the tail belongs to the core-wyrm. The two share one apple and help each other out.'),
    (1012, 1, 'Poltchageist looks like a regional form of Sinistea,  but it was recently discovered that the two Pokémon are entirely unrelated.'),
    (1013, 1, 'It prefers cool,  dark places,  such as the back of a shelf or the space beneath a home\'s floorboards. It wanders in search of prey after sunset.'),
    (1014, 1, 'Okidogi is a ruffian with a short temper. It can pulverize anything by swinging around the chain on its neck.'),
    (1015, 1, 'Munkidori keeps itself somewhere safe while it toys with its foes,  using psychokinesis to induce intense dizziness.'),
    (1016, 1, 'Fezandipiti beats its glossy wings to scatter pheromones that captivate people and Pokémon.'),
    (1017, 1, 'This mischief-loving Pokémon is full of curiosity. It battles by drawing out the type-based energy contained within its masks.'),
    (1018, 1, 'It digs holes on mountains,  searching for food. It’s so durable that being caught in a cave-in won’t faze it.'),
    (1019, 1, 'These capricious syrpents have banded together. On the rare occasion that their moods align,  their true power is unleashed.'),
    (1020, 1, 'It resembles an eerie Pokémon once shown in a paranormal magazine. That Pokémon was said to be an Entei regenerated from a fossil.'),
    (1021, 1, 'It bears resemblance to a Pokémon that became a hot topic for a short while after a paranormal magazine touted it as Raikou\'s ancestor.'),
    (1022, 1, 'It was named after a mysterious object recorded in an old book. Its body seems to be metallic.'),
    (1023, 1, 'There was supposedly an incident in which it launched shining blades to cut everything around it to pieces. Little else is known about it.'),
    (1024, 1, 'It’s thought that this Pokémon lived in ancient Paldea until it got caught in seismic shifts and went extinct.'),
    (1025, 1, 'Its peach-shaped shell serves as storage for a potent poison. It makes poisonous mochi and serves them to people and Pokémon.'),
    (1026, 1, 'Deoxys emerged from a virus that came from space. It is highly intelligent and wields psychokinetic powers. This Pokémon shoots lasers from the crystalline organ on its chest.'),
    (1026, 2, 'Deoxys était à l’origine un virus provenant de l’espace. Il est extrêmement intelligent et dispose de pouvoirs télékinétiques. Ce Pokémon envoie des lasers avec l’organe cristallin situé sur sa poitrine.'),
