    (1029, 1, 'When Burmy evolved,  its cloak became a part of this Pokémon’s body. The cloak is never shed.'),
    (1029, 2, 'Quand Cheniti a évolué,  sa cape a fusionné avec son corps. Cheniselle ne s’en sépare jamais.'),
