    (1038, 1, 'Its form changes depending on the weather. The rougher conditions get,  the rougher Castform’s disposition!'),
    (1038, 2, 'Il n’y a pas que son apparence qui change en fonction de la météo : son tempérament aussi ! Plus il y a de vent,  plus il se montre agressif.'),
