    (1041, 1, 'Though it differs from other Basculin in several respects,  including demeanor—this one is gentle—I have categorized it as a regional form given the vast array of shared qualities.'),
    (1041, 2, 'On l’utilisait autrefois en cuisine. La chair grasse des Bargantua à motif rouge était plutôt destinée aux jeunes.'),
    (1042, 1, 'This Pokémon’s power level rises along with the temperature of its fire,  which can reach 2, 500 degrees Fahrenheit.'),
    (1042, 2, 'Sa puissance augmente à mesure que la flamme de son corps s’intensifie. La température de celle-ci peut parfois dépasser les 1 400 °C.'),
    (1043, 1, 'Its melodies are sung with a special vocalization method that can control the feelings of those who hear it.'),
    (1043, 2, 'Sa voix si particulière lui permet de chanter des mélodies qui ensorcellent les gens et modifient leurs émotions.'),
    (1044, 1, 'This storm-stirring Pokémon is said to cause the seasons to turn by whipping up the air. I suspect its humanlike form to be a false one.'),
    (1044, 2, 'L’énergie dégagée par sa queue provoque d’énormes tempêtes dont la force peut renverser des maisons.'),
    (1045, 1, 'They say this wielder of electricity has waged war with its nemesis,  Tornadus,  since time immemorial. The lightning bolts it hurls pierce the very earth and enrich the soil.'),
    (1045, 2, 'Il vole dans le ciel d’Unys et fait tomber des éclairs,  provoquant des incendies qui font sa mauvaise réputation.'),
    (1046, 1, 'When the incarnations of wind and of lightning clash,  Landorus arrives to quell the conflict. After the tempests and thunderbolts abate,  the land is sure to be blessed with bountiful harvests.'),
    (1046, 2, 'Il utilise l’énergie qu’il tire du vent et de la foudre pour enrichir les sols en nutriments pour les cultures.'),
    (1047, 1, 'It appears that this Pokémon uses its powers over ice to freeze its own body in order to stabilize its cellular structure.'),
    (1047, 2, 'Il se serait congelé lui-même avec son souffle glacé pour stabiliser sa structure cellulaire.'),
    (1048, 1, 'It appears that this Pokémon uses its powers over ice to freeze its own body in order to stabilize its cellular structure.'),
    (1048, 2, 'Il se serait congelé lui-même avec son souffle glacé pour stabiliser sa structure cellulaire.'),
    (1049, 1, 'They say that Keldeo must survive harsh battles and fully develop the horn on its forehead before this Pokémon’s true power will awaken.'),
    (1049, 2, 'Lorsqu’il livre un combat difficile,  la corne sur son front se renforce et se développe,  ce qui éveillerait sa véritable puissance.'),
    (1050, 1, 'The defensive instinct of the males is strong. It’s when they’re protecting themselves or their partners that they unleash their full power.'),
    (1050, 2, 'Le mâle a un instinct de défense très développé. Il n’hésite pas à lancer une attaque à pleine puissance pour protéger ses partenaires et lui.'),
    (1051, 1, 'Its potent spectral powers allow it to manipulate others. It once used its powers to force people and Pokémon to build a kingdom to its liking.'),
    (1051, 2, 'Grâce à ses puissants pouvoirs spirituels,  il a contrôlé des humains et des Pokémon pour créer un pays conforme à ses idéaux.'),
    (1052, 1, 'The light that streams out from the holes in the pumpkin can hypnotize and control the people and Pokémon that see it.'),
    (1052, 2, 'Il peut manipuler les humains et les Pokémon en les hypnotisant grâce à la lumière qui filtre par les trous de son ventre en forme de citrouille.'),
