    (1058, 1, 'A bewitching aroma wafts from its flower. The fragrance becalms those engaged in a battle.'),
    (1058, 2, 'Une douce senteur émane de sa plante. Cette fragrance calme tous ceux qui sont engagés dans un combat.'),
    (1059, 1, 'Its wings can carry this Pokémon close to an altitude of 4, 600 feet. It blows out fire at very high temperatures.'),
    (1059, 2, 'Ses ailes lui permettent de voler à plus de 1 400 m d’altitude. Ce Pokémon crache du feu à des températures très élevées.'),
