    (1061, 1, 'The rocket cannons on its shell fire jets of water capable of punching holes through thick steel.'),
    (1061, 2, 'Les canons sur sa carapace tirent des jets d’eau capables de percer même de l’acier trempé.'),
    (1062, 1, 'The longer Alakazam lives,  the larger and heavier its head becomes. Our tests have shown that the strength of its psychic powers correlates positively to the weight of its head.'),
    (1062, 2, 'Il dispose d’immenses pouvoirs psychiques. On raconte qu’il s’en est servi afin de créer les cuillères qu’il tient dans chaque main.'),
    (1063, 1, 'Possesses potential victims\' shadows in an effort to steal away the victims\' lives. If your shadow begins to laugh,  you must take hold of a protective charm posthaste!'),
    (1063, 2, 'On dit qu’Ectoplasma surgit parfois des ténèbres pour prendre la vie des personnes égarées en montagne.'),
    (1064, 1, 'There are records of a lost human child being raised by a childless Kangaskhan.'),
    (1064, 2, 'Certains documents certifient que les Kangourex sans progéniture élevaient des enfants humains en détresse.'),
    (1065, 1, 'This Pokémon clamps its pincers down on its prey and then either splits the prey in half or flings it away.'),
    (1065, 2, 'Une fois sa proie enserrée entre ses cornes,  deux choix s’offrent à lui : la couper en deux ou la projeter au loin de toutes ses forces.'),
    (1066, 1, 'I suspect this Pokémon to be the true identity of a dragon written of in ancient texts,  which claimed that it razed an entire village with white-hot beams from its maw.'),
    (1066, 2, 'Quand il se laisse emporter par la rage,  même la plus violente des tempêtes ne peut l’empêcher de détruire tout ce qui l’entoure.'),
    (1067, 1, 'Aerodactyl’s sawlike fangs can shred skin to tatters—even the skin of Steel-type Pokémon.'),
    (1067, 2, 'Sa dentition semblable à une scie peut même broyer la peau des Pokémon Acier.'),
    (1068, 1, 'Its DNA is almost the same as Mew’s. However,  its size and disposition are vastly different.'),
    (1068, 2, 'Son ADN est presque le même que celui de Mew,  mais sa taille et son caractère sont très différents.'),
    (1069, 1, 'Its DNA is almost the same as Mew’s. However,  its size and disposition are vastly different.'),
    (1069, 2, 'Son ADN est presque le même que celui de Mew,  mais sa taille et son caractère sont très différents.'),
    (1070, 1, 'Its tail shines bright and strong. It has been prized since long ago as a beacon for sailors.'),
    (1070, 2, 'Sa queue brille d’une lumière éclatante. Depuis des temps très anciens,  il est vénéré comme le guide des marins.'),
    (1071, 1, 'Evolved by way of a curious item. The shell covering its body has been shown to be stronger than forged steel.'),
    (1071, 2, 'Malgré son corps fin,  sa puissance de frappe est prodigieuse,  car même ses muscles sont composés de métal.'),
    (1072, 1, 'This Pokémon has an unparalleled horn. Heracross itself demonstrates tremendous power—it\'s capable of throwing several people trained in the traditional arts of war at once.'),
    (1072, 2, 'Ce Pokémon est fier de sa force colossale qui lui permet de soulever cent fois son propre poids avec facilité.'),
    (1073, 1, 'Identifiable by its eerie howls,  people a long time ago thought it was the grim reaper and feared it.'),
    (1073, 2, 'Ceux qui le craignaient jadis lui ont donné le surnom de « messager de la Faucheuse » à cause de son hurlement sinistre si particulier.'),
    (1074, 1, 'The quakes caused when it walks make even great mountains crumble and change the surrounding terrain.'),
    (1074, 2, 'Son pas est si lourd qu’il fait trembler le sol et s’écrouler même les plus grandes montagnes,  ce qui altère la topographie de la zone.'),
    (1075, 1, 'Blaziken has incredibly strong legs—it can easily clear a 30-story building in one leap. This Pokémon’s blazing punches leave its foes scorched and blackened.'),
    (1075, 2, 'Braségali a des jambes incroyablement puissantes. Il peut sauter par-dessus un immeuble de trente étages. Les coups de poing enflammés de ce Pokémon peuvent carboniser ses ennemis.'),
    (1076, 1, 'It will dedicate itself to defending a master it has come to adore. Its pure white dress,  reminiscent of those worn by ladies of nobility,  is the dress of one who is willing to risk their life.'),
    (1076, 2, 'Prêt à tout pour protéger son Dresseur,  il peut aller jusqu’à épuiser sa force mentale pour créer un mini trou noir.'),
    (1077, 1, 'It chomps with its gaping mouth. Its huge jaws are actually steel horns that have been transformed.'),
    (1077, 2, 'Ses cornes d’acier forment une grande mâchoire avec laquelle il mord férocement ses adversaires.'),
    (1078, 1, 'Long ago,  there was a king who wore a helmet meant to resemble the head of an Aggron. He was trying to channel the Pokémon’s strength.'),
    (1078, 2, 'Il y a fort longtemps,  un roi portait un casque à l’effigie de Galeking,  pensant qu’il pourrait ainsi s’approprier sa force.'),
    (1079, 1, 'Through the power of meditation,  Medicham developed its sixth sense. It gained the ability to use psychokinetic powers. This Pokémon is known to meditate for a whole month without eating.'),
    (1079, 2, 'Grâce au pouvoir de la méditation,  Charmina a développé son sixième sens. Il peut utiliser des pouvoirs télékinétiques. On sait que ce Pokémon peut méditer pendant un mois sans manger.'),
    (1080, 1, 'It rarely appears before people. It is said to nest where lightning has fallen.'),
    (1080, 2, 'Ce Pokémon évite de se montrer aux humains. On raconte qu’il fait son nid aux endroits où la foudre s’est abattue.'),
    (1081, 1, 'Resentment at being cast off made it spring into being. Some say that treating it well will satisfy it,  and it will once more become a stuffed toy.'),
    (1081, 2, 'Il est né de la rancune qu’il a ressentie quand il a été abandonné. Il redevient apparemment une poupée si l’on en prend grand soin.'),
    (1082, 1, 'Because of this Pokémon’s ability to detect danger,  people mistook Absol as a bringer of doom.'),
    (1082, 2, 'Sa capacité à pressentir le danger lui a autrefois valu la réputation de porter malheur.'),
    (1083, 1, 'Soars across the heavens at blinding speed—a magnificent sight! It has a feral disposition. Utmost caution is required if one meets a Garchomp out in the wilds.'),
    (1083, 2, 'Ce Pokémon très rapide même au sol capture ses proies sur les monts enneigés et rentre vite dans son antre avant que son corps ne gèle.'),
    (1084, 1, 'A most gallant-looking creature. It emits energy waves and controls them with precision,  using them to sense even faraway beings. I have given the name ”aura” to this power.'),
    (1084, 2, 'Étant capable de lire ce que pensent les humains,  ce Pokémon ne s’attache qu’aux Dresseurs dotés d’un cœur pur.'),
    (1085, 1, 'A powerful Pokémon that can split huge boulders with ease. Dislikes associating with others and chooses to live quietly deep within the mountains,  playing with the snow.'),
    (1085, 2, 'Ce grand Pokémon déclenche des blizzards. Lorsqu’il agite son corps,  tout ce qui l’entoure se retrouve couvert de neige.'),
    (1086, 1, 'It gives its own power to flowers,  pouring its heart into caring for them. Floette never forgives anyone who messes up a flower bed.'),
    (1086, 2, 'Il fait profiter ses fleurs de ses pouvoirs et met tout son cœur à leur entretien. Gare à ceux qui ravagent ses plates-bandes !'),
    (1087, 1, 'Latias is highly intelligent and capable of understanding human speech. It is covered with a glass-like down. The Pokémon enfolds its body with its down and refracts light to alter its appearance.'),
    (1087, 2, 'Latias est très intelligent et comprend le langage des hommes. Il est recouvert d’une espèce de duvet ressemblant à du verre. Ce Pokémon s’enveloppe dans ce duvet et reflète la lumière pour changer son apparence.'),
    (1088, 1, 'Latios will only open its heart to a Trainer with a compassionate spirit. This Pokémon can fly faster than a jet plane by folding its forelegs to minimize air resistance.'),
    (1088, 2, 'Latios n’ouvrira son cœur qu’à un Dresseur doté d’un esprit compatissant. Ce Pokémon peut voler plus vite qu’un avion à réaction en repliant ses pattes avant pour améliorer son aérodynamisme.'),
    (1089, 1, 'Swampert predicts storms by sensing subtle differences in the sounds of waves and tidal winds with its fins. If a storm is approaching,  it piles up boulders to protect itself.'),
    (1089, 2, 'Laggron peut prédire l’arrivée des tempêtes en utilisant ses nageoires pour sentir les variations dans les vagues et les marées. Si une tempête s’approche,  il empile des rochers pour protéger son habitat.'),
    (1090, 1, 'Sceptile has seeds growing on its back. They are said to be bursting with nutrients that revitalize trees. This Pokémon raises the trees in a forest with loving care.'),
    (1090, 2, 'Jungko a des graines qui lui poussent sur le dos. On dit qu’elles regorgent de nutriments qui revitalisent les arbres. Ce Pokémon s’occupe des forêts avec amour.'),
    (1091, 1, 'It feeds on gemstone crystals. In darkness,  its eyes sparkle with the glitter of jewels.'),
    (1091, 2, 'Ce Pokémon se nourrit de pierres précieuses. Dans les ténèbres,  ses yeux brillent du reflet des joyaux.'),
    (1092, 1, 'This Pokémon has a kind disposition,  but if it’s provoked,  it will threaten opponents with shrill cries before attacking them without mercy.'),
    (1092, 2, 'Il est de nature aimable,  mais si on le met en colère,  il intimide son adversaire en poussant un cri strident et l’attaque sans pitié.'),
    (1093, 1, 'The blades extending from its elbows are sharper than the finest swords. Its swordsmanship,  albeit self-taught,  is astonishingly impressive.'),
    (1093, 2, 'Ses sens aiguisés lui indiquent lorsque quelqu’un est en danger. Il accourt alors à la rescousse.'),
    (1094, 1, 'This Pokémon has a kind heart. By touching with its feelers,  Audino can gauge other creatures’ feelings and physical conditions.'),
    (1094, 2, 'Ce Pokémon gentil est capable de deviner les émotions et l’état de santé des autres rien qu’en les touchant avec ses antennes.'),
    (1095, 1, 'This Pokémon is known as the Bully of the Sea. Any ship entering the waters Sharpedo calls home will be attacked—no exceptions.'),
    (1095, 2, 'Surnommé le « tyran des mers »,  ce Pokémon attaque sans exception tous les navires qui osent s’aventurer sur son territoire.'),
    (1096, 1, 'Being bitten by a Shellder shocked this Pokémon into standing on two legs. If the Shellder lets go,  it seems Slowbro will turn back into a Slowpoke.'),
    (1096, 2, 'La morsure du Kokiyas l’a tellement surpris qu’il est devenu bipède. Il paraît qu’il redevient un Ramoloss si le Kokiyas lâche prise.'),
    (1097, 1, 'This Pokémon evolved through use of a strange item. Its body is coated with steel powder and notably hard—not even diamond can leave so much as a scratch.'),
    (1097, 2, 'On pense que son corps s’est transformé à force d’avaler le fer contenu dans la terre en creusant.'),
    (1098, 1, 'This Pokémon flies at Mach 2 speed,  seeking prey. Its large talons are feared as wicked weapons.'),
    (1098, 2, 'Ce Pokémon vole à Mach 2 quand il chasse. Ses grandes serres sont des armes redoutables.'),
    (1099, 1, 'It covers its body with an armor of ice harder than steel. Uses its breath to freeze prey,  which it then devours as if they were frozen desserts.'),
    (1099, 2, 'Il a le pouvoir de geler l’humidité ambiante en un instant et peut ainsi immobiliser ses proies.'),
    (1100, 1, 'It can instantly create many diamonds by compressing the carbon in the air between its hands.'),
    (1100, 2, 'Il peut créer une multitude de diamants en un instant en serrant ses mains,  simplement en compressant les molécules de carbone contenues dans l’air.'),
    (1101, 1, 'Metagross is the result of the fusion of two Metang. This Pokémon defeats its opponents through use of its supercomputer-level brain.'),
    (1101, 2, 'Né de la fusion de deux Métang,  il vient à bout de ses ennemis grâce à son cerveau qui est aussi performant qu’un superordinateur.'),
    (1102, 1, 'Kyogre is said to be the personification of the sea itself. Legends tell of its many clashes against Groudon,  as each sought to gain the power of nature.'),
    (1102, 2, 'Un Pokémon considéré comme l’avatar des océans. Selon les légendes,  il a disputé de nombreux combats avec Groudon pour contrôler l’énergie de la nature.'),
    (1103, 1, 'Through Primal Reversion and with nature’s full power,  it will take back its true form. It can cause magma to erupt and expand the landmass of the world.'),
    (1103, 2, 'Grâce à l’énergie de la nature,  il peut accomplir sa Primo-Résurgence pour retrouver son apparence originelle. Ce pouvoir lui permet de créer du magma pour étendre les continents.'),
    (1104, 1, 'It flies forever through the ozone layer,  consuming meteoroids for sustenance. The many meteoroids in its body provide the energy it needs to Mega Evolve.'),
    (1104, 2, 'Un Pokémon qui vit dans la couche d’ozone et se nourrit des météorites qu’il intercepte. Leur énergie s’accumule dans son corps,  ce qui lui permet de méga-évoluer.'),
    (1105, 1, 'Possesses cheek sacs in which it stores electricity. This clever forest-dweller roasts tough berries with an electric shock before consuming them.'),
    (1105, 2, 'Les Pikachu se disent bonjour en se frottant la queue et en y faisant passer du courant électrique.'),
