    (1111, 1, 'It is said to be able to seize anything it desires with its six rings and six huge arms. With its power sealed,  it is transformed into a much smaller form.'),
    (1111, 2, 'On raconte que grâce à ses six anneaux et ses six énormes bras,  il est capable de dérober tout ce qui lui plaît. Mais son pouvoir a été scellé,  et il a été réduit à l’état d’un être minuscule.'),
    (1112, 1, 'The humps on Camerupt’s back are formed by a transformation of its bones. They sometimes blast out molten magma. This Pokémon apparently erupts often when it is enraged.'),
    (1112, 2, 'Les bosses sur le dos de Camérupt sont apparues après une déformation de ses os. Elles crachent parfois du magma en fusion. Ce Pokémon entre apparemment en éruption lorsqu’il est énervé.'),
    (1113, 1, 'Its fur is warm and yet remarkably light. This Pokémon kicks as though it were a master of karate,  driving back its opponents with ease.'),
    (1113, 2, 'À la fin de la saison chaude,  il mue et se recouvre d’une fourrure épaisse et légère pour se préparer à affronter le froid hivernal.'),
    (1114, 1, 'While basking in the joy of flight generally keeps this Pokémon in high spirits,  Salamence turns into an uncontrollable menace if something angers it.'),
    (1114, 2, 'Heureux de pouvoir voler dans le ciel,  il est souvent de bonne humeur,  mais il devient incontrôlable lorsqu’on le met en colère.'),
    (1115, 1, 'It has three poisonous stingers on its forelegs and its tail. They are used to jab its enemy repeatedly.'),
    (1115, 2, 'Il se sert de ses trois aiguillons empoisonnés situés sur les pattes avant et l’abdomen pour attaquer sans relâche ses adversaires.'),
    (1116, 1, 'Will chew on anything with its fangs. If you see one,  you can be certain that 40 more live in the area.'),
    (1116, 2, 'Il peut ronger n’importe quoi avec ses deux dents. Quand on en voit un,  il y en a certainement 40 dans le coin.'),
    (1117, 1, 'Its hind feet are webbed. They act as flippers,  so it can swim in rivers and hunt for prey.'),
    (1117, 2, 'Ses pattes arrière sont palmées. Il peut donc poursuivre sa proie dans les cours d’eau et les rivières.'),
