    (1125, 1, 'It can discharge bursts of electricity exceeding 100, 000 volts— a single strike with that amount of power would incapacitate one of the Copperajah of my homeland.'),
    (1125, 2, 'Si ses joues sont à court d’énergie,  il lève la queue et capte l’électricité contenue dans l’atmosphère.'),
    (1126, 1, 'It burrows into the ground to create its nest. If hard stones impede its tunneling,  it uses its sharp claws to shatter them and then carries on digging.'),
    (1126, 2, 'Il creuse le sol pour construire sa tanière. Rien n’arrête ses griffes acérées,  pas même la roche la plus solide.'),
    (1127, 1, 'It climbs trees by hooking on with its sharp claws. Sandslash shares the berries it gathers,  dropping them down to Sandshrew waiting below the tree.'),
    (1127, 2, 'Il grimpe aux arbres grâce à ses griffes acérées et fait tomber des Baies pour les Sabelette qui attendent au sol.'),
    (1128, 1, 'In its belly burns a fire,  which Vulpix spits out in the form of fireballs. When young,  this Pokémon has but one white tail. As the Pokémon matures,  this single tail splits into six.'),
    (1128, 2, 'Avec l’âge,  la fourrure de ses six queues devient de plus en plus belle et soyeuse. Elle est chaude au toucher.'),
    (1129, 1, 'The coat of gleaming golden fur is quite magnificent. This species is said to store sacred power in its nine long tails and to live for a millennium.'),
    (1129, 2, 'Il est très intelligent et rancunier. Quiconque attrape une de ses queues se fera maudire pour 1 000 ans.'),
    (1130, 1, 'It burrows through the ground at a shallow depth. It leaves raised earth in its wake,  making it easy to spot.'),
    (1130, 2, 'Ce Pokémon creuse sous terre à faible profondeur. La terre qu’il laisse dans son sillage le rend facile à repérer.'),
    (1131, 1, 'These Diglett triplets dig over 60 miles below sea level. No one knows what it’s like underground.'),
    (1131, 2, 'Ce trio de Taupiqueur est capable de creuser jusqu’à 100 km sous terre,  vers l’inconnu.'),
    (1132, 1, 'It loves to collect shiny things. If it’s in a good mood,  it might even let its Trainer have a look at its hoard of treasures.'),
    (1132, 2, 'Tatillon sur la propreté de la pièce sur son front,  il se lave la figure avec grand soin. Il ne s’entend pas avec les Miaouss de Galar.'),
    (1133, 1, 'Its elegant and refined behavior clashes with that of the barbaric Perrserker. The relationship between the two is one of mutual disdain.'),
    (1133, 2, 'Il se comporte avec grâce et élégance,  et ne s’entend pas avec les rustres Berserkatt : les deux espèces se méprisent.'),
    (1134, 1, 'Makes its home in mountainous regions,  using its arms to climb along harsh mountain roads. Can be troublesome—carelessly kicking one will cause it to fly into a rage and chase after you.'),
    (1134, 2, 'On en trouve près des sentiers de montagne. Si vous marchez dessus par inadvertance,  ils s’énervent et attaquent.'),
    (1135, 1, 'Dwells in holes dug into sheer walls of stone. It enjoys rolling down slopes as though it were a boulder during a rockfall,  so keep an eye upward while traversing mountain roads.'),
    (1135, 2, 'Il dévale les sentiers de montagne et traverse les obstacles en les pulvérisant.'),
    (1136, 1, 'The rocklike shell is shed each year. The cast-off shell then crumbles,  reverting to a mass of soil,  which can be spread across fields to promote crop growth.'),
    (1136, 2, 'Juste après la mue,  son corps est blanc et tendre. Au contact de l’air,  sa peau se solidifie et forme une armure.'),
    (1137, 1, 'Made of congealed sludge. It smells too putrid to touch. Even weeds won’t grow in its path.'),
    (1137, 2, 'Ce tas de fange sent si mauvais qu’il est impossible de le toucher. Plus rien ne pousse dans son sillage putride.'),
    (1138, 1, 'Smells so awful,  it can cause fainting. Through degeneration of its nose,  it lost its sense of smell.'),
    (1138, 2, 'Son odeur immonde provoque des évanouissements. Son odorat s’est atrophié à cause de sa propre puanteur.'),
    (1139, 1, 'When they work together,  Exeggutor’s three heads can put out powerful psychic energy. Cloudy days make this Pokémon sluggish.'),
    (1139, 2, 'Les attaques psychiques lancées par ses trois têtes à l’unisson sont très puissantes. Par temps nuageux,  ses mouvements sont plus lents.'),
    (1140, 1, 'When this Pokémon evolved,  the skull of its mother fused to it. Marowak’s temperament also turned vicious at the same time.'),
    (1140, 2, 'En évoluant,  il est devenu violent,  et le crâne de sa mère qu’il portait a fusionné avec sa tête.'),
    (1141, 1, 'It appears and vanishes with a ninja’s grace. It toys with its enemies using swift movements,  while slicing them with throwing stars of sharpest water.'),
    (1141, 2, 'Aussi insaisissable qu’un ninja,  il se joue de ses ennemis grâce à sa célérité,  et les tranche de ses Sheauriken.'),
    (1142, 1, 'It appears and vanishes with a ninja’s grace. It toys with its enemies using swift movements,  while slicing them with throwing stars of sharpest water.'),
    (1142, 2, 'Aussi insaisissable qu’un ninja,  il se joue de ses ennemis grâce à sa célérité,  et les tranche de ses Sheauriken.'),
    (1143, 1, 'Some say it can change to an even more powerful form when battling those who threaten the ecosystem.'),
    (1143, 2, 'Ce Pokémon serait capable de prendre une forme encore plus puissante quand il se bat contre un ennemi qui menace l’écosystème.'),
    (1144, 1, 'Some say it can change to an even more powerful form when battling those who threaten the ecosystem.'),
    (1144, 2, 'Ce Pokémon serait capable de prendre une forme encore plus puissante quand il se bat contre un ennemi qui menace l’écosystème.'),
    (1145, 1, 'Some say it can change to an even more powerful form when battling those who threaten the ecosystem.'),
    (1145, 2, 'Ce Pokémon serait capable de prendre une forme encore plus puissante quand il se bat contre un ennemi qui menace l’écosystème.'),
    (1146, 1, 'Patient by nature,  this Pokémon loses control of itself and pounces when it spots its favorite meal—Rattata!'),
    (1146, 2, 'D’un naturel très patient,  il ne peut toutefois s’empêcher de bondir sur son plat favori,  Rattata,  s’il en voit un.'),
    (1147, 1, 'If it carries a Charjabug to use as a spare battery,  a flying Vikavolt can rapidly fire high-powered beams of electricity.'),
    (1147, 2, 'S’il emporte un Chrysapile en tant que batterie de secours,  il peut tirer une salve de rayons électriques extrêmement puissants en plein vol.'),
    (1148, 1, 'This Oricorio has drunk red nectar. If its Trainer gives the wrong order,  this passionate Pokémon becomes fiercely angry.'),
    (1148, 2, 'Un Plumeline ayant bu du Nectar Rouge. D’un naturel passionné,  il brûle de rage quand son Dresseur se trompe d’ordre.'),
    (1149, 1, 'This Oricorio has drunk red nectar. If its Trainer gives the wrong order,  this passionate Pokémon becomes fiercely angry.'),
    (1149, 2, 'Un Plumeline ayant bu du Nectar Rouge. D’un naturel passionné,  il brûle de rage quand son Dresseur se trompe d’ordre.'),
