    (1150, 2, 'Un Plumeline ayant bu du Nectar Rouge. D’un naturel passionné,  il brûle de rage quand son Dresseur se trompe d’ordre.'),
    (1151, 1, 'With swift movements,  this Pokémon gradually backs its prey into a corner. Lycanroc’s fangs are always aimed toward opponents’ weak spots.'),
    (1151, 2, 'Il poursuit ses proies avec rapidité et patience. Une fois la cible acculée,  il attaque toujours son point faible avec ses crocs.'),
    (1152, 1, 'When it senses danger,  its eyes tear up. The sparkle of its tears signals other Wishiwashi to gather.'),
    (1152, 2, 'Ses yeux se mouillent quand il sent le danger approcher. Le scintillement de ses larmes sert de signal pour que ses congénères se rassemblent.'),
    (1153, 1, 'The petals on this Pokémon’s arms are thin and super sharp,  and they can fire laser beams if Lurantis gathers light first.'),
    (1153, 2, 'Les pétales sur ses deux bras sont fins,  mais très tranchants. Ils peuvent également absorber la lumière pour la renvoyer sous forme de laser.'),
    (1154, 1, 'The winner of competitions between Salazzle is decided by which one has the most male Salandit with it.'),
    (1154, 2, 'Les conflits entre Malamandre seraient réglés par un simple calcul : le spécimen dont la suite comporte le plus de Tritox l’emporte.'),
    (1155, 1, 'Although its outer shell is uncommonly durable,  the shock of falling to the ground smashes the shell to smithereens.'),
    (1155, 2, 'Sa carapace,  pourtant très solide,  éclate en mille morceaux quand il s’écrase sur la terre en tombant du ciel.'),
