    (1167, 2, 'Sa carapace,  pourtant très solide,  éclate en mille morceaux quand il s’écrase sur la terre en tombant du ciel.'),
    (1168, 1, 'There was a scientist who peeked under Mimikyu’s old rag in the name of research. The scientist died of a mysterious disease.'),
    (1168, 2, 'Les malheureux chercheurs qui ont regardé sous son déguisement en lambeaux ont succombé à une mystérieuse maladie.'),
    (1169, 1, 'There was a scientist who peeked under Mimikyu’s old rag in the name of research. The scientist died of a mysterious disease.'),
    (1169, 2, 'Les malheureux chercheurs qui ont regardé sous son déguisement en lambeaux ont succombé à une mystérieuse maladie.'),
