    (1171, 1, 'Certain ruins have paintings of ancient warriors wearing armor made of Kommo-o scales.'),
    (1171, 2, 'Dans les ruines,  on trouve parfois des fresques représentant des guerriers antiques qui portent des armures faites avec ses écailles.'),
    (1172, 1, 'Built roughly 500 years ago by a scientist,  the part called the Soul-Heart is the actual life-form.'),
    (1172, 2, 'Il a été créé par un scientifique il y a environ 500 ans de cela. Sa véritable essence est un organe nommé Animacœur.'),
    (1173, 1, 'Possesses cheek sacs in which it stores electricity. This clever forest-dweller roasts tough berries with an electric shock before consuming them.'),
    (1173, 2, 'Les Pikachu se disent bonjour en se frottant la queue et en y faisant passer du courant électrique.'),
    (1174, 1, 'When this Pokémon evolved,  the skull of its mother fused to it. Marowak’s temperament also turned vicious at the same time.'),
    (1174, 2, 'En évoluant,  il est devenu violent,  et le crâne de sa mère qu’il portait a fusionné avec sa tête.'),
    (1175, 1, 'Ribombee absolutely hate getting wet or rained on. In the cloudy Galar region,  they are very seldom seen.'),
    (1175, 2, 'Il a horreur d’être trempé par la pluie. On ne le voit que très rarement à Galar,  région connue pour son temps couvert.'),
    (1176, 1, 'This Pokémon intimidates opponents by striking the ground with the rocks on its neck. The moment an opponent flinches,  Rockruff attacks.'),
    (1176, 2, 'Il intimide ses ennemis en cognant les rochers autour de son cou contre le sol. Au premier signe de faiblesse,  il passe à l’assaut.'),
    (1177, 1, 'With swift movements,  this Pokémon gradually backs its prey into a corner. Lycanroc’s fangs are always aimed toward opponents’ weak spots.'),
    (1177, 2, 'Il poursuit ses proies avec rapidité et patience. Une fois la cible acculée,  il attaque toujours son point faible avec ses crocs.'),
    (1178, 1, 'It acts as a caretaker for Dewpider,  putting them inside its bubble and letting them eat any leftover food.'),
    (1178, 2, 'Il prend soin de petits Araqua en les abritant dans sa bulle et en les laissant grignoter les restes de ses repas.'),
    (1179, 1, 'When it’s in trouble,  it curls up into a ball,  makes its fur spikes stand on end,  and then discharges electricity indiscriminately.'),
    (1179, 2, 'En cas de danger,  il se roule en boule,  dresse ses épines dorsales et lance des décharges électriques au hasard.'),
    (1180, 1, 'It needs light to survive,  and it goes on a rampage seeking it out. Its laser beams will cut anything to pieces.'),
    (1180, 2, 'Sa quête de lumière,  sa source de vie,  le rend violent. Il détruit tout sur son passage avec ses rayons laser.'),
