    (1185, 1, 'Possesses cheek sacs in which it stores electricity. This clever forest-dweller roasts tough berries with an electric shock before consuming them.'),
    (1185, 2, 'Les Pikachu se disent bonjour en se frottant la queue et en y faisant passer du courant électrique.'),
    (1186, 1, 'It loves to collect shiny things. If it’s in a good mood,  it might even let its Trainer have a look at its hoard of treasures.'),
    (1186, 2, 'Tatillon sur la propreté de la pièce sur son front,  il se lave la figure avec grand soin. Il ne s’entend pas avec les Miaouss de Galar.'),
    (1187, 1, 'These Pokémon live in herds out in the grassland. Newborn foals lack their fiery manes,  which will develop about an hour after birth.'),
    (1187, 2, 'Il semblerait qu’une fois qu’un Dresseur a gagné la confiance de Ponyta,  sa crinière enflammée ne le brûle plus au toucher.'),
    (1188, 1, 'Fiery mane aglow,  Rapidash darts like an arrow across the land. This prodigiously swift creature can traverse the vast region of Hisui in a day and a half.'),
    (1188, 2, 'Au sein d’un troupeau,  c’est le plus rapide qui devient le chef. Il choisit les lieux où se rendre et détermine la vitesse de galop.'),
    (1189, 1, 'When this Pokémon’s tail is soaked in water,  sweetness seeps from it. Slowpoke uses this trait to lure in and fish up other Pokémon.'),
    (1189, 2, 'Lorsqu’il trempe le bout de sa queue dans l’eau,  une substance sucrée s’en dégage. Il s’en sert pour appâter ses proies quand il pêche.'),
    (1190, 1, 'Being bitten by a Shellder shocked this Pokémon into standing on two legs. If the Shellder lets go,  it seems Slowbro will turn back into a Slowpoke.'),
    (1190, 2, 'La morsure du Kokiyas l’a tellement surpris qu’il est devenu bipède. Il paraît qu’il redevient un Ramoloss si le Kokiyas lâche prise.'),
    (1191, 1, 'They use a plant stalk as a weapon,  but not all of them use it in the same way. Several distinct styles of stalk fighting have been observed.'),
    (1191, 2, 'Il se bat à l’aide de sa tige. Il existe plusieurs écoles quant à son maniement.'),
    (1192, 1, 'It can’t suck in air quite as well as a Galarian Weezing,  but the toxins it creates are more potent than those of its counterpart.'),
    (1192, 2, 'Il ne peut pas aspirer autant d’air que le Smogogo de Galar,  mais le poison qu’il produit est plus puissant.'),
    (1193, 1, 'The behavior of this clown-like Pokémon reminds one of pantomime. It creates invisible walls using a force emitted from its fingertips.'),
    (1193, 2, 'Son talent pour le mime est indéniable. Il émet des ondes du bout des doigts pour créer un mur qui le protège de nombreuses attaques.'),
    (1194, 1, 'This Pokémon can control ice at will. Articuno is said to live in snowy mountains riddled with permafrost.'),
    (1194, 2, 'Il possède le pouvoir de contrôler la glace. Selon les dires,  il vivrait sur les sommets recouverts de neiges éternelles.'),
    (1195, 1, 'Zapdos is a legendary bird Pokémon. It’s said that when Zapdos rubs its feathers together,  lightning will fall immediately after.'),
    (1195, 2, 'On raconte que lorsque ce Pokémon oiseau légendaire fait vibrer ses plumes,  le frottement fait tomber la foudre instantanément.'),
    (1196, 1, 'There are stories of this Pokémon using its radiant,  flame-cloaked wings to light up paths for those lost in the mountains.'),
    (1196, 2, 'On raconte qu’il a sauvé des personnes perdues en montagne en illuminant les sentiers à l’aide de ses splendides ailes flamboyantes.'),
    (1197, 1, 'Slowking can solve any problem presented to it,  but no one can understand a thing Slowking says.'),
    (1197, 2, 'Il est capable de résoudre tous les problèmes qu’on lui présente,  mais personne ne parvient à comprendre ce qu’il dit.'),
    (1198, 1, 'These Pokémon live in warm seas. In prehistoric times,  many lived in the oceans around the Galar region as well.'),
    (1198, 2, 'Ces Pokémon habitués des mers chaudes se trouvaient autrefois en masse sur les côtes de Galar.'),
    (1199, 1, 'Zigzagoon that adapted to regions outside Galar acquired this appearance. If you’ve lost something,  this Pokémon can likely find it.'),
    (1199, 2, 'Le Zigzaton de Galar a adopté cette forme dans les autres régions. Il est très doué pour dénicher des choses.'),
    (1200, 1, 'It uses its explosive speed and razor-sharp claws to bring down prey. Running along winding paths is not its strong suit.'),
    (1200, 2, 'Il se sert de sa force de propulsion et de ses griffes aiguisées pour achever ses proies. Il a du mal à courir sur les routes sinueuses.'),
    (1201, 1, 'This popular symbol of good fortune will never fall over in its sleep,  no matter how it’s pushed or pulled.'),
    (1201, 2, 'On a beau le pousser ou le tirer,  quand il dort,  rien ne le fait vaciller. Cette qualité lui a valu de devenir un emblème pour les porte-bonheurs.'),
    (1202, 1, 'This Pokémon’s power level rises along with the temperature of its fire,  which can reach 2, 500 degrees Fahrenheit.'),
    (1202, 2, 'Sa puissance augmente à mesure que la flamme de son corps s’intensifie. La température de celle-ci peut parfois dépasser les 1 400 °C.'),
    (1203, 1, 'This Pokémon’s power level rises along with the temperature of its fire,  which can reach 2, 500 degrees Fahrenheit.'),
    (1203, 2, 'Sa puissance augmente à mesure que la flamme de son corps s’intensifie. La température de celle-ci peut parfois dépasser les 1 400 °C.'),
    (1204, 1, 'The spirit of a person from a bygone age became this Pokémon. It rambles through ruins,  searching for someone who knows its face.'),
    (1204, 2, 'Il est né de l’âme d’un être humain d’un peuple antique. Il erre dans les ruines à la recherche de quiconque reconnaîtra son visage.'),
    (1205, 1, 'For some reason,  this Pokémon smiles slightly when it emits a strong electric current from the yellow markings on its body.'),
    (1205, 2, 'Lorsque les parties jaunes de son corps envoient une puissante décharge électrique,  il ébauche un sourire. Personne ne sait pourquoi.'),
    (1206, 1, 'Some say it can change to an even more powerful form when battling those who threaten the ecosystem.'),
    (1206, 2, 'Ce Pokémon serait capable de prendre une forme encore plus puissante quand il se bat contre un ennemi qui menace l’écosystème.'),
    (1207, 1, 'This hungry Pokémon swallows Arrokuda whole. Occasionally,  it makes a mistake and tries to swallow a Pokémon other than its preferred prey.'),
    (1207, 2, 'Très glouton,  il avale les Embrochet d’une seule bouchée,  mais il lui arrive de se tromper et de tenter de gober un autre Pokémon.'),
    (1208, 1, 'This hungry Pokémon swallows Arrokuda whole. Occasionally,  it makes a mistake and tries to swallow a Pokémon other than its preferred prey.'),
    (1208, 2, 'Très glouton,  il avale les Embrochet d’une seule bouchée,  mais il lui arrive de se tromper et de tenter de gober un autre Pokémon.'),
    (1209, 1, 'This short-tempered and aggressive Pokémon chugs stagnant water to absorb any toxins it might contain.'),
    (1209, 2, 'Impatient et bagarreur,  ce Pokémon avale de grandes gorgées d’eau croupie pour en absorber toute la toxicité.'),
    (1210, 1, 'This Pokémon keeps its heat-sensitive head cool with ice. It fishes for its food,  dangling its single hair into the sea to lure in prey.'),
    (1210, 2, 'Ne supportant pas la chaleur,  il se rafraîchit toujours la tête avec de la glace. Il pêche de quoi se nourrir à l’aide de son cheveu.'),
    (1211, 1, 'Through its horns,  it can pick up on the emotions of creatures around it. Positive emotions are the source of its strength.'),
    (1211, 2, 'Avec ses cornes,  il peut percevoir les émotions des êtres vivants alentour. Celles qui sont positives lui servent de source d’énergie.'),
    (1212, 1, 'It carries electrically roasted seeds with it as if they’re precious treasures. No matter how much it eats,  it always gets hungry again in short order.'),
    (1212, 2, 'Il a beau manger,  il a tout le temps faim. Il a toujours des graines grillées à l’électricité sur lui.'),
    (1213, 1, 'This Pokémon has slumbered for many years. Some say it’s Zamazenta’s elder sister—others say the two Pokémon are rivals.'),
    (1213, 2, 'On dit qu’il s’agit de la figure fraternelle et du rival de Zamazenta,  un Pokémon plongé dans un long sommeil.'),
    (1214, 1, 'This Pokémon slept for aeons while in the form of a statue. It was asleep for so long,  people forgot that it ever existed.'),
    (1214, 2, 'Ce Pokémon,  changé en statue,  est resté pétrifié si longtemps qu’il a failli tomber dans l’oubli.'),
    (1215, 1, 'It was inside a meteorite that fell 20, 000 years ago. There seems to be a connection between this Pokémon and the Dynamax phenomenon.'),
    (1215, 2, 'Il se trouvait dans une météorite qui s’est écrasée il y a 20 000 ans. Il semble y avoir un lien entre ce Pokémon et le phénomène Dynamax.'),
    (1216, 1, 'Inhabiting the mountains of a distant region,  this Pokémon races across sheer cliffs,  training its legs and refining its moves.'),
    (1216, 2, 'Il vit dans une lointaine région montagneuse où il peaufine ses techniques et muscle ses jambes en courant le long des falaises abruptes.'),
    (1217, 1, 'Once the vines on Zarude’s body tear off,  they become nutrients in the soil. This helps the plants of the forest grow.'),
    (1217, 2, 'Lorsque ses lianes se détachent de son corps,  elles fertilisent le sol et favorisent la croissance des plantes de la forêt.'),
    (1218, 1, 'Calyrex is known in legend as a king that ruled over Galar in ancient times. It has the power to cause hearts to mend and plants to spring forth.'),
    (1218, 2, 'Ce roi légendaire qui a régné sur Galar il y a fort longtemps possède le pouvoir d’apaiser les cœurs et de faire germer les plantes.'),
    (1219, 1, 'Calyrex is known in legend as a king that ruled over Galar in ancient times. It has the power to cause hearts to mend and plants to spring forth.'),
    (1219, 2, 'Ce roi légendaire qui a régné sur Galar il y a fort longtemps possède le pouvoir d’apaiser les cœurs et de faire germer les plantes.'),
    (1220, 1, 'A bewitching aroma wafts from its flower. The fragrance becalms those engaged in a battle.'),
    (1220, 2, 'Une douce senteur émane de sa plante. Cette fragrance calme tous ceux qui sont engagés dans un combat.'),
    (1221, 1, 'Its wings can carry this Pokémon close to an altitude of 4, 600 feet. It blows out fire at very high temperatures.'),
    (1221, 2, 'Ses ailes lui permettent de voler à plus de 1 400 m d’altitude. Ce Pokémon crache du feu à des températures très élevées.'),
    (1222, 1, 'The rocket cannons on its shell fire jets of water capable of punching holes through thick steel.'),
    (1222, 2, 'Les canons sur sa carapace tirent des jets d’eau capables de percer même de l’acier trempé.'),
    (1223, 1, 'It collects honey every day. It rubs honey onto the hairs on its legs to carry it back to its nest.'),
    (1223, 2, 'Il ramasse du nectar chaque jour et l’agglutine sur les poils de ses pattes pour le transporter jusqu’à son nid.'),
    (1224, 1, 'Possesses cheek sacs in which it stores electricity. This clever forest-dweller roasts tough berries with an electric shock before consuming them.'),
    (1224, 2, 'Les Pikachu se disent bonjour en se frottant la queue et en y faisant passer du courant électrique.'),
    (1225, 1, 'It loves to collect shiny things. If it’s in a good mood,  it might even let its Trainer have a look at its hoard of treasures.'),
    (1225, 2, 'Tatillon sur la propreté de la pièce sur son front,  il se lave la figure avec grand soin. Il ne s’entend pas avec les Miaouss de Galar.'),
    (1226, 1, 'In close combat,  its four arms afford it offensive and defensive supremacy. In but a blink,  this valiant Pokémon can overwhelm its foes with more than 1, 000 blows from its fists.'),
    (1226, 2, 'Il enchaîne les coups de poing avec ses quatre bras à une vitesse surprenante.'),
    (1227, 1, 'Possesses potential victims\' shadows in an effort to steal away the victims\' lives. If your shadow begins to laugh,  you must take hold of a protective charm posthaste!'),
    (1227, 2, 'On dit qu’Ectoplasma surgit parfois des ténèbres pour prendre la vie des personnes égarées en montagne.'),
    (1228, 1, 'Its oversized claw is very powerful,  but when it’s not in battle,  the claw just gets in the way.'),
    (1228, 2, 'Sa pince gigantesque possède une puissance destructrice phénoménale,  mais hors combat,  son poids devient un handicap.'),
    (1229, 1, 'Crossing icy seas is no issue for this cold-resistant Pokémon. Its smooth skin is a little cool to the touch.'),
    (1229, 2, 'Il résiste bien aux très basses températures et peut nager dans des mers glaciales. Sa peau est lisse et légèrement froide au toucher.'),
    (1230, 1, 'Harbors the potential to evolve into manifold forms. Within Eevee lies the key to the mysteries of Pokémon evolution—I\'m certain of it.'),
    (1230, 2, 'L’ADN de ce Pokémon très particulier recèle de nombreuses possibilités d’évolution.'),
    (1231, 1, 'This glutton appears in villages without warning and devours the entirety of their rice granaries—such occurrences have long been counted among the gravest of disasters.'),
    (1231, 2, 'L’estomac de ce Pokémon est si résistant qu’il peut même digérer de la nourriture avariée.'),
    (1232, 1, 'The toxic liquid it launches from its right arm is so virulent that it can kill a weakened creature instantly.'),
    (1232, 2, 'Le liquide qu’il projette de son bras droit est si toxique que si une créature fragile en est aspergée,  elle succombe sur-le-champ.'),
    (1233, 1, 'Centrifugal force is behind the punches of Melmetal’s heavy hex-nut arms. Melmetal is said to deliver the strongest punches of all Pokémon.'),
    (1233, 2, 'On dit que,  grâce à la force centrifuge,  les coups de poing qu’il assène avec ses lourds écrous seraient les plus dévastateurs parmi les Pokémon.'),
    (1234, 1, 'The one with the best drumming techniques becomes the boss of the troop. It has a gentle disposition and values harmony among its group.'),
    (1234, 2, 'Celui qui possède les meilleures techniques de percussion devient le chef. De nature calme,  il privilégie l’harmonie du groupe.'),
    (1235, 1, 'It’s skilled at both offense and defense,  and it gets pumped up when cheered on. But if it starts showboating,  it could put itself in a tough spot.'),
    (1235, 2, 'Exceptionnel en attaque comme en défense,  il s’exalte quand on l’encourage,  mais il lui arrive de se mettre en danger en jouant solo.'),
    (1236, 1, 'Its nictitating membranes let it pick out foes’ weak points so it can precisely blast them with water that shoots from its fingertips at Mach 3.'),
    (1236, 2, 'Il repère le point faible de l’ennemi grâce à sa membrane nictitante,  puis il transperce sa cible en tirant des jets d’eau à Mach 3 du bout des doigts.'),
    (1237, 1, 'With their great intellect and flying skills,  these Pokémon very successfully act as the Galar region’s airborne taxi service.'),
    (1237, 2, 'Grâce à son adresse remarquable en vol et sa grande intelligence,  il travaille comme taxi volant de Galar.'),
    (1238, 1, 'It emits psychic energy to observe and study what’s around it—and what’s around it can include things over six miles away.'),
    (1238, 2, 'Il déploie ses pouvoirs psychiques pour sonder les alentours,  sur un rayon pouvant atteindre 10 km.'),
    (1239, 1, 'This Pokémon rapidly extends its retractable neck to sink its sharp fangs into distant enemies and take them down.'),
    (1239, 2, 'Son cou extensible lui permet d’atteindre des ennemis éloignés en un instant pour leur porter un coup décisif avec ses crocs aiguisés.'),
    (1240, 1, 'While it’s engaged in battle,  its mountain of coal will burn bright red,  sending off sparks that scorch the surrounding area.'),
    (1240, 2, 'Lorsqu’il s’engage dans un combat,  son tas de charbon brûle et vire au rouge,  ce qui répand de petites étincelles qui calcinent ce qui l’entoure.'),
    (1241, 1, 'It flies on wings of apple skin and spits a powerful acid. It can also change its shape into that of an apple.'),
    (1241, 2, 'Il vole avec ses ailes faites de pelures de pomme et crache une substance très acide. Il peut aussi prendre la forme de ce fruit.'),
    (1242, 1, 'Its body is covered in sweet nectar,  and the skin on its back is especially yummy. Children used to have it as a snack.'),
    (1242, 2, 'Son corps est recouvert de nectar. La peau de son dos,  particulièrement sucrée,  constituait jadis le goûter des enfants.'),
    (1243, 1, 'Its unique style of coiling allows it to blast sand out of its sand sac more efficiently.'),
    (1243, 2, 'S’il s’enroule d’une manière aussi particulière,  c’est pour optimiser l’expulsion de sable par ses narines.'),
    (1244, 1, 'This short-tempered and aggressive Pokémon chugs stagnant water to absorb any toxins it might contain.'),
    (1244, 2, 'Impatient et bagarreur,  ce Pokémon avale de grandes gorgées d’eau croupie pour en absorber toute la toxicité.'),
    (1245, 1, 'While its burning body is already dangerous on its own,  this excessively hostile Pokémon also has large and very sharp fangs.'),
    (1245, 2, 'Il est de nature agressive. Non seulement son corps brûlant est dangereux,  mais il possède en plus d’énormes crocs très pointus.'),
    (1246, 1, 'If you’re too loud around it,  you risk being torn apart by the claws on its tentacle. This Pokémon is also known as the Forest Witch.'),
    (1246, 2, 'On l’appelle aussi la « sorcière de la forêt ». Ce Pokémon lacère quiconque fait trop de bruit avec les griffes de son tentacule.'),
    (1247, 1, 'Its hairs work like muscle fibers. When its hairs unfurl,  they latch on to opponents,  ensnaring them as tentacles would.'),
    (1247, 2, 'Ses cheveux sont comme des muscles filandreux qu’il peut détacher pour saisir ses adversaires,  tels des tentacules.'),
    (1248, 1, 'When Alcremie is content,  the cream it secretes from its hands becomes sweeter and richer.'),
    (1248, 2, 'Quand il est heureux,  la crème qu’il produit avec ses mains devient plus sucrée et plus onctueuse.'),
    (1249, 1, 'These Pokémon live in herds. Their trunks have incredible grip strength,  strong enough to crush giant rocks into powder.'),
    (1249, 2, 'Ces Pokémon vivent en troupeau. L’étreinte de leur trompe est si forte qu’elle suffit à réduire un rocher en poussière.'),
    (1250, 1, 'The special metal that composes its body is very light,  so this Pokémon has considerable agility. It lives in caves because it dislikes the rain.'),
    (1250, 2, 'Son corps,  composé d’un métal spécial,  est léger et lui offre une excellente mobilité. Il est toutefois sensible à la pluie et vit donc dans les grottes.'),
    (1251, 1, 'Inhabiting the mountains of a distant region,  this Pokémon races across sheer cliffs,  training its legs and refining its moves.'),
    (1251, 2, 'Il vit dans une lointaine région montagneuse où il peaufine ses techniques et muscle ses jambes en courant le long des falaises abruptes.'),
    (1252, 1, 'Inhabiting the mountains of a distant region,  this Pokémon races across sheer cliffs,  training its legs and refining its moves.'),
    (1252, 2, 'Il vit dans une lointaine région montagneuse où il peaufine ses techniques et muscle ses jambes en courant le long des falaises abruptes.'),
    (1253, 1, 'This short-tempered and aggressive Pokémon chugs stagnant water to absorb any toxins it might contain.'),
    (1253, 2, 'Impatient et bagarreur,  ce Pokémon avale de grandes gorgées d’eau croupie pour en absorber toute la toxicité.'),
    (1254, 1, 'They patrol their territory in pairs. I believe the igneous rock components in the fur of this species are the result of volcanic activity in its habitat.'),
    (1254, 2, 'Très fidèle,  il aboie de toutes ses forces pour protéger son Dresseur d’Origine quand un danger le guette.'),
    (1255, 1, 'Snaps at its foes with fangs cloaked in blazing flame. Despite its bulk,  it deftly feints every which way,  leading opponents on a deceptively merry chase as it all but dances around them.'),
    (1255, 2, 'Ce Pokémon est admiré depuis toujours pour sa beauté. Il court avec tellement de légèreté qu’on dirait qu’il vole.'),
    (1256, 1, 'An enigmatic Pokémon that happens to bear a resemblance to a Poké Ball. When excited,  it discharges the electric current it has stored in its belly,  then lets out a great,  uproarious laugh.'),
    (1256, 2, 'On dit qu’il se déguise en Poké Ball. Il s’autodétruit à la moindre stimulation.'),
    (1257, 1, 'The tissue on the surface of its body is curiously similar in composition to an Apricorn. When irritated,  this Pokémon lets loose an electric current equal to 20 lightning bolts.'),
    (1257, 2, 'Il stocke de l’énergie électrique dans son corps,  ce qui le rend instable et explosif.'),
    (1258, 1, 'Said to purify lost,  forsaken souls with its flames and guide them to the afterlife. I believe its form has been influenced by the energy of the sacred mountain towering at Hisui\'s center.'),
    (1258, 2, 'Typhlosion se cache derrière un chatoyant nuage de chaleur qu’il crée en attisant ses flammes intenses. Ce Pokémon peut générer des rafales explosives qui réduisent tout en cendres.'),
    (1259, 1, 'Fishers detest this troublesome Pokémon because it sprays poison from its spines,  getting it everywhere. A different form of Qwilfish lives in other regions.'),
    (1259, 2, 'Ses petites épines étaient autrefois des écailles. Elles sécrètent des toxines pouvant faire perdre connaissance.'),
    (1260, 1, 'Its sturdy,  curved claws are ideal for traversing precipitous cliffs. From the tips of these claws drips a venom that infiltrates the nerves of any prey caught in Sneasel\'s grasp.'),
    (1260, 2, 'Un Pokémon aussi cruel que fourbe. Il se glisse dans le nid des autres Pokémon en leur absence pour dérober leurs Œufs.'),
    (1261, 1, 'Hard of heart and deft of blade,  this rare form of Samurott is a product of the Pokémon\'s evolution in the region of Hisui. Its turbulent blows crash into foes like ceaseless pounding waves.'),
    (1261, 2, 'Il peut terrasser ses ennemis d’un coup de la lame enchâssée dans son armure,  et les faire taire d’un seul regard.'),
    (1262, 1, 'I suspect that its well-developed legs are the result of a life spent on mountains covered in deep snow. The scent it exudes from its flower crown heartens those in proximity.'),
    (1262, 2, 'L’huile essentielle extraite de sa fleur dégage un parfum exceptionnel,  mais elle coûte extrêmement cher.'),
    (1263, 1, 'A once-departed soul,  returned to life in Hisui. Derives power from resentment,  which rises as energy atop its head and takes on the forms of foes. In this way,  Zorua vents lingering malice.'),
    (1263, 2, 'Il lui arrive de se changer en être humain,  surtout en enfant,  pour venir chercher de la nourriture en ville.'),
    (1264, 1, 'With its disheveled white fur,  it looks like an embodiment of death. Heedless of its own safety,  Zoroark attacks its nemeses with a bitter energy so intense,  it lacerates Zoroark\'s own body.'),
    (1264, 2, 'Les Dresseurs en manque de compagnie ordonnent à Zoroark de leur montrer une illusion pour tromper leur solitude.'),
    (1265, 1, 'Screaming a bloodcurdling battle cry,  this huge and ferocious bird Pokémon goes out on the hunt. It blasts lakes with shock waves,  then scoops up any prey that float to the water\'s surface.'),
    (1265, 2, 'Son caractère agressif et violent lui a valu de perdre son rôle de transporteur à Galar au profit de Corvaillus.'),
    (1266, 1, 'A creature given to melancholy. I suspect its metallic shell developed as a result of the mucus on its skin reacting with the iron in Hisui\'s water.'),
    (1266, 2, 'Son petit cerveau est caché dans la bosse qui est sur son dos. Il ne pense pas à grand-chose,  si ce n’est à se nourrir et à fuir devant ses ennemis.'),
    (1267, 1, 'Able to freely control the hardness of its metallic shell. It loathes solitude and is extremely clingy—it will fume and run riot if those dearest to it ever leave its side.'),
    (1267, 2, 'Il attaque à l’aide de ses longues cornes. Ses coups sont cent fois plus puissants que ceux d’un champion poids lourds de boxe.'),
    (1268, 1, 'The armor of ice covering its lower jaw puts steel to shame and can shatter rocks with ease. This Pokémon barrels along steep mountain paths,  cleaving through the deep snow.'),
    (1268, 2, 'Les crevasses sur son dos s’approfondissent au cours de la journée,  mais se comblent de nouveau pendant la nuit.'),
    (1269, 1, 'The air stored inside the rachises of Decidueye\'s feathers insulates the Pokémon against Hisui\'s extreme cold. This is firm proof that evolution can be influenced by environment.'),
    (1269, 2, 'Il décoche ses plumes acérées en un dixième de seconde. Sa victime n’a pas le temps de le voir agir qu’elle est déjà grièvement touchée.'),
    (1270, 1, 'This Pokémon is revered as a deity in Hisuian legend. The birth of Dialga was what caused the vast river of time to begin flowing in our world.'),
    (1270, 2, 'Il peut contrôler le temps. Les mythes de Sinnoh en parlent comme d’une divinité ancienne.'),
    (1271, 1, 'This Pokémon is feared as a deity in Hisuian legend. The birth of Palkia was what caused the walls of our world to disappear,  creating a sky that spans for infinity.'),
    (1271, 2, 'Il peut modeler l’espace. Les mythes de Sinnoh en parlent comme d’une divinité ancienne.'),
    (1272, 1, 'Though it differs from other Basculin in several respects,  including demeanor—this one is gentle—I have categorized it as a regional form given the vast array of shared qualities.'),
    (1272, 2, 'On l’utilisait autrefois en cuisine. La chair grasse des Bargantua à motif rouge était plutôt destinée aux jeunes.'),
    (1273, 1, 'Clads itself in the souls of comrades that perished before fulfilling their goals of journeying upstream. No other species throughout all Hisui\'s rivers is Basculegion\'s equal.'),
    (1274, 1, 'When it flies to this land from across the sea,  the bitter winter comes to an end. According to legend,  this Pokémon\'s love gives rise to the budding of fresh life across Hisui.'),
    (1275, 1, 'The Tauros of the Galar region are volatile in nature,  and they won’t allow people to ride on their backs.'),
    (1275, 2, 'Les Tauros vivant à Galar ont un tempérament violent et ne tolèrent pas que les êtres humains montent sur leur dos.'),
    (1276, 1, 'The Tauros of the Galar region are volatile in nature,  and they won’t allow people to ride on their backs.'),
    (1276, 2, 'Les Tauros vivant à Galar ont un tempérament violent et ne tolèrent pas que les êtres humains montent sur leur dos.'),
    (1277, 1, 'The Tauros of the Galar region are volatile in nature,  and they won’t allow people to ride on their backs.'),
    (1277, 2, 'Les Tauros vivant à Galar ont un tempérament violent et ne tolèrent pas que les êtres humains montent sur leur dos.'),
    (1278, 1, 'When walking on land,  it covers its body with a poisonous film that keeps its skin from dehydrating.'),
    (1278, 2, 'Lorsqu’il est sur la terre ferme,  il couvre son corps d’un voile toxique qui le protège de la déshydratation.'),
    (1279, 1, 'It entrances female Pokémon with the sweet,  alluring scent that wafts from all over its body.'),
    (1280, 1, 'It drives enemies out of its nest by sucking in enough air to fill its long,  narrow lungs,  then releasing the air in an intense blast.'),
    (1281, 1, 'Its physical capabilities are no different than a Finizen’s,  but when its allies are in danger,  it transforms and powers itself up.'),
    (1282, 1, 'The larger pair protects the little ones during battles. When facing strong opponents,  the whole group will join the fight.'),
    (1283, 1, 'Tatsugiri is an extremely cunning Pokémon. It feigns weakness to lure in prey,  then orders its partner to attack.'),
    (1284, 1, 'Tatsugiri is an extremely cunning Pokémon. It feigns weakness to lure in prey,  then orders its partner to attack.'),
    (1285, 1, 'Green-feathered flocks hold the most sway. When they’re out searching for food in the mornings and evenings,  it gets very noisy.'),
    (1286, 1, 'Green-feathered flocks hold the most sway. When they’re out searching for food in the mornings and evenings,  it gets very noisy.'),
    (1287, 1, 'Green-feathered flocks hold the most sway. When they’re out searching for food in the mornings and evenings,  it gets very noisy.'),
    (1288, 1, 'It lives inside an old treasure chest. Sometimes it gets left in shop corners since no one realizes it’s actually a Pokémon.'),
    (1289, 1, 'This Pokémon resembles Cyclizar,  but it is far burlier and more ferocious. Nothing is known about its ecology or other features.'),
    (1290, 1, 'This Pokémon resembles Cyclizar,  but it is far burlier and more ferocious. Nothing is known about its ecology or other features.'),
    (1291, 1, 'This Pokémon resembles Cyclizar,  but it is far burlier and more ferocious. Nothing is known about its ecology or other features.'),
    (1292, 1, 'This Pokémon resembles Cyclizar,  but it is far burlier and more ferocious. Nothing is known about its ecology or other features.'),
    (1293, 1, 'This seems to be the Iron Serpent mentioned in an old book. The Iron Serpent is said to have turned the land to ash with its lightning.'),
    (1294, 1, 'This seems to be the Iron Serpent mentioned in an old book. The Iron Serpent is said to have turned the land to ash with its lightning.'),
    (1295, 1, 'This seems to be the Iron Serpent mentioned in an old book. The Iron Serpent is said to have turned the land to ash with its lightning.'),
    (1296, 1, 'This seems to be the Iron Serpent mentioned in an old book. The Iron Serpent is said to have turned the land to ash with its lightning.'),
    (1297, 1, 'I believe it was Hisui\'s swampy terrain that gave Ursaluna its burly physique and newfound capacity to manipulate peat at will.'),
    (1298, 1, 'This mischief-loving Pokémon is full of curiosity. It battles by drawing out the type-based energy contained within its masks.'),
    (1299, 1, 'This mischief-loving Pokémon is full of curiosity. It battles by drawing out the type-based energy contained within its masks.'),
    (1300, 1, 'This mischief-loving Pokémon is full of curiosity. It battles by drawing out the type-based energy contained within its masks.'),
    (1301, 1, 'It’s thought that this Pokémon lived in ancient Paldea until it got caught in seismic shifts and went extinct.'),
    (1302, 1, 'It’s thought that this Pokémon lived in ancient Paldea until it got caught in seismic shifts and went extinct.')
