DROP TABLE IF EXISTS `pokemon_type`;
DROP TABLE IF EXISTS `description`;
DROP TABLE IF EXISTS `name`;
DROP TABLE IF EXISTS `cry`;
DROP TABLE IF EXISTS `cry_type`;
DROP TABLE IF EXISTS `sprite`;
DROP TABLE IF EXISTS `sprite_type`;
DROP TABLE IF EXISTS `type_name`;
DROP TABLE IF EXISTS `type`;
DROP TABLE IF EXISTS `language`;
DROP TABLE IF EXISTS `pokemon`;

CREATE TABLE `pokemon` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `pokedex_number` int unsigned NOT NULL,
  `name` varchar(100) NOT NULL,
  `height` int unsigned NOT NULL,
  `weight` int unsigned NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `pokemon_name_unique` (`name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `language` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `locale` varchar(2) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `language_locale_unique` (`locale`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `type` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL,
  `sprite_url` text,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `type_name` (
  `type_id` int unsigned NOT NULL,
  `language_id` int unsigned NOT NULL,
  `text` text NOT NULL,
  PRIMARY KEY (`type_id`,`language_id`),
  KEY `type_name_language_FK` (`language_id`),
  CONSTRAINT `type_name_language_FK` FOREIGN KEY (`language_id`) REFERENCES `language` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `type_name_type_FK` FOREIGN KEY (`type_id`) REFERENCES `type` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `sprite_type` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `code` varchar(100) NOT NULL,
  `name` varchar(100) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `sprite_type_code_unique` (`code`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `sprite` (
  `pokemon_id` int unsigned NOT NULL,
  `sprite_type_id` int unsigned NOT NULL,
  `sprite_url` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL,
  PRIMARY KEY (`pokemon_id`, `sprite_type_id`),
  CONSTRAINT `sprite_pokemon_FK` FOREIGN KEY (`pokemon_id`) REFERENCES `pokemon` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `sprite_sprite_type_FK` FOREIGN KEY (`sprite_type_id`) REFERENCES `sprite_type` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `cry_type` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `code` varchar(100) NOT NULL,
  `name` varchar(100) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `cry_type_code_unique` (`code`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `cry` (
  `pokemon_id` int unsigned NOT NULL,
  `cry_type_id` int unsigned NOT NULL,
  `audio_url` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL,
  PRIMARY KEY (`pokemon_id`, `cry_type_id`),
  CONSTRAINT `cry_cry_type_FK` FOREIGN KEY (`cry_type_id`) REFERENCES `cry_type` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `cry_pokemon_FK` FOREIGN KEY (`pokemon_id`) REFERENCES `pokemon` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `name` (
  `pokemon_id` int unsigned NOT NULL,
  `language_id` int unsigned NOT NULL,
  `text` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`pokemon_id`,`language_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `description` (
  `pokemon_id` int unsigned NOT NULL,
  `language_id` int unsigned NOT NULL,
  `text` text NOT NULL,
  PRIMARY KEY (`pokemon_id`, `language_id`),
  CONSTRAINT `description_language_FK` FOREIGN KEY (`language_id`) REFERENCES `language` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `description_pokemon_FK` FOREIGN KEY (`pokemon_id`) REFERENCES `pokemon` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `pokemon_type` (
  `pokemon_id` int unsigned NOT NULL,
  `type_id` int unsigned NOT NULL,
  `position` int unsigned NOT NULL,
  PRIMARY KEY (`pokemon_id`,`type_id`),
  CONSTRAINT `pokemon_type_pokemon_FK` FOREIGN KEY (`pokemon_id`) REFERENCES `pokemon` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `pokemon_type_type_FK` FOREIGN KEY (`type_id`) REFERENCES `type` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

